REPLACE INTO `catalog_product_entity_text` VALUES (312,149,0,47,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (313,75,0,47,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nBodybutter-Set \"Perfect Evening\"\r\nFeinste Körperbuttern für die abendliche Intensivpflege. Die Bodybutter \"Snow White\" ohne Duftstoffe ist perfekt geeignet für alle empfindlichen Körperstellen. Midnight Blue mit zartem Lavendelduft beruhigt und entspannt. Nach Belieben am Körper einsetzten, Hände und Füße nicht vergessen.\r\nDas Bodybutter-Set \"Perfect Evening\"\r\nin der eleganten Verpackung, eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n \r\nInformationen zum Produkt:\r\n- 250ml Bodybutter Snow White (body & face)\r\n- 250ml Bodybutter Midnight Blue (hand & feet)\r\n\r\nEin Set aus feinster Bio-Naturkosmetik für den abendlichen Home-Spa\r\n');
REPLACE INTO `catalog_product_entity_text` VALUES (314,149,0,48,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (315,75,0,48,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nBodybutter-Set \"Pure Luxury\"\r\nDie Kombination dieser beiden luxuriösen Körperbuttern verwandelt jedes Badezimmer in einen perfekten Home-Spa. Wenige, sorgfältig ausgewählte und hochwertigste Zutaten versorgen die Haut mit natürlicher Feuchtigkeit. Belastende Zusatzstoffe und konventionelle Füllstoffe entfallen. Versorge Deine Haut nur mit dem Besten aus der Natur. \r\nDas Bodybutter-Set \"Pure Luxury\"\r\nin der eleganten Verpackung, eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n \r\nInformationen zum Produkt:\r\n- 250ml Bodybutter Rose Haven\r\n- 250ml Bodybutter Vanilla Harmony, \r\n\r\nEin Set aus feinster Bio-Naturkosmetik in verwöhnenden Duftnoten.\r\n');
REPLACE INTO `catalog_product_entity_text` VALUES (316,149,0,49,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (317,75,0,49,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nBodybutter-Set \"Try Me\"\r\nLass Dich verwöhnen von drei ausgesuchten Duftvarianten der feinen Naturkosmetik von Coscoon. Entdecke eine Bodybutter ohne Füll- und Mineralstoffe, frisch gerührt und einzig aus wertvollen Zutaten der Natur kreiert. Teste und entscheide Dich für Deinen Lieblingsduft!\r\nDas Bodybutter-Set \"Try Me\"\r\nin der schönen Verpackung, eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n \r\nInformationen zum Produkt:\r\nProbier-Set mit 3 verschiedenen Duftvarianten der Bodybutter \r\n- Midnight Blue\r\n- Rose Haven\r\n- Vanilla Harmony\r\n');
REPLACE INTO `catalog_product_entity_text` VALUES (318,149,0,50,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (319,75,0,50,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nDie DIY-Event Box KIDS\r\nist ein absolutes Highlight für die nächste Kinderparty. Ihr produziert nach Anleitung 4 Kits für einen bunten DIY-Nachmittag für 4-8 Kinder, mit eigener Lippenpflege und BadeTörtchen. Ihr erlebt, wie aus einzelnen Bestandteilen ein tolles Produkt entsteht. Das macht großen Spaß, vermittelt Wissen und gibt ein starkes Gefühl für eigene Kompetenzen. Für Kinder ab 10 Jahren geeignet.  \r\nDie DIY-Event Box KIDS \r\nin der schönen Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n\r\nInformationen zum Produkt:\r\n- 2 x LipBalm Vanilla Kiss\r\n- 2 x BadeTörtchen True Lavender. \r\n\r\nIm Ergebnis entstehen 8 LipBalme und 12 BadeTörtchen');
REPLACE INTO `catalog_product_entity_text` VALUES (320,149,0,51,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (321,75,0,51,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nDie DIY-Event Box WOMEN\r\nDie perfekte Eventbox für Deinen außergewöhnlichen Mädels-Nachmittag enthält 4 Kits für 2 bis 4 Frauen. Macht es Euch gemütlich und zaubert gemeinsam frische Naturkosmetik. Kinderleicht und mit viel Liebe entstehen traumhafte Pflegeprodukte aus der Natur! Du brauchst nur noch eine Küche und Deine Freundinnen! Also, einfach bestellen und Event planen!\r\nDie DIY-Event Box WOMEN \r\nin der schönen Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n\r\nInformationen zum Produkt:\r\n- SheaSahne Blossom Rose +ONE\r\n- SheaSahne Vanilla Bliss +ONE\r\n- LipBalm Blossom Rose\r\n- BadeTörtchen True Lavender\r\n\r\nIm Ergebnis entstehen 4 x 120 ml Körperbutter, 4 LipBalme und 6 BadeTörtchen\r\n');
REPLACE INTO `catalog_product_entity_text` VALUES (322,149,0,52,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (323,75,0,52,'Besonders im Sommer benötigt die Haut unserer Kinder einen besonderen Schutz. Da sich Kinderhaut noch in der Entwicklungsphase befindet, verfügt sie noch nicht über die körpereigenen Schutzmechanismen vor schädlicher UV-Strahlung, welche die Haut eines Erwachsenen besitzt. Deswegen haben wir von Dr. Severin eine Sonnencreme entwickelt, die nicht nur einen hohen Schutzfaktor bietet, sondern mit ihren sensitiven Eigenschaften speziell für zarte Kinderhaut geeignet ist. Die Dr. Severin Kinder Sonnencreme stammt aus kompetenten Produktionsstandorten in Deutschland und entspricht hohen Qualitätsansprüchen und Herstellungsstandards.');
REPLACE INTO `catalog_product_entity_text` VALUES (324,149,0,53,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (325,75,0,53,'Die Dr. Severin Aktivkohle Maske Wash-Off hilft ihrer Haut bei der Regeneration. Täglich wird ihre Haut durch schädliche Umwelteinflüsse angegriffen. Um diesen Belastungen trotzen zu können braucht ihre Haut die richtige Pflege. Deswegen hat unser Dr. Severin Entwicklungsteam für Sie diese einzigartige Wash-Off Maske entwickelt. SIe ist reich an Nährstoffen und effektiv gegen Hautunreinheiten. Lehnen SIe sich zurück und lassen sie unsere Maske arbeiten. Die samtige Textur und der frische Duft machen ihr Zuhause zur Wellness-Oase. Bei regelmäßiger Anwendung wird sich ihr Hautbild nachhaltig verbessern. Denn unsere Maske dringt tief in ihre Haut ein und reinigt porentief. Durch die Aktivkohle werden Hautunreinheiten wie Mitesser und Pickel bekämpft und vorgebeugt. Setzen Sie unreiner Haut ein Ende mit der Dr. Severin Aktivkohle Wash-Off Maske!');
REPLACE INTO `catalog_product_entity_text` VALUES (326,149,0,54,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (327,75,0,54,'Unsere Anti Stretchmark Creme hilft Ihrer Haut mit jeder Belastung mitzuhalten. \r\nBei schnellem Muskelaufbau aber auch in der Schwangerschaft kommt es oft zu unschönen Nebenfolgen: Dehnungsstreifen. Denn extra für diesen Fall haben wir von Dr. Severin zusammen mit dual innovations eine Creme entwickelt, die jede Haut bei Belastung schützt. Diese Anti-Stretch Creme gibt Ihrer Haut die Nährstoffe, die sie braucht um mit schnellem Muskelaufbau oder dem wachsenden Baby-Bauch mitzuhalten.\r\nDie Mischung aus bester Sheabutter, süßem Mandelöl und Vitamin E ist die Lösung für Muskelaufbau ohne lästige Dehnungsstreifen. Die Elastizität der Haut wird langfristig erhöht und das Bindegewebe wird gestrafft. Die Wirkstoffe dringen tief in die Haut ein und geben ihr einen Power- und Feuchtigkeits-Boost. Außerdem werden Falten, Narben und Hautverfärbungen wie Pigmentstörungen oder unerwünschte Sommersprossen abgemildert. Die Dr. Severin Anti Stretchmark Creme ist für Schwangerschaften, Muskelaufbau oder für Sportanfänger genau das richtige, denn sie beugt Dehnungsstreifen vor und bekämpft vorhandene.\r\nDie praktische Größe passt in jede Tasche und die extra feste Verschlusskappe verhindert auslaufen unterwegs.');
REPLACE INTO `catalog_product_entity_text` VALUES (328,149,0,55,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (329,75,0,55,'Diese einzigartige Aktivkohle-Maske ist ideal für die Tiefenreinigung Ihrer Haut. Sie müssen es nur ein- bis zweimal pro Woche verwenden, um Ihre Haut frei von Unreinheiten wie Mitessern zu fühlen. Dank der Kombination von Schlamm aus dem Toten Meer und Aktivkohle hat unser Forschungsteam von Dr. Severin eine unglaublich effiziente Maske für Sie entwickelt. Seine weiche Textur garantiert eine leichte Anwendung, während sein fruchtiger Duft ein erfrischendes Frühlingsgefühl auf der Haut hinterlässt.\r\nBei jeder Anwendung unserer Blackhead Peel-Off Maske können Sie sich auf eine glatte, samtige Haut freuen. Nehmen Sie sich Zeit für eine regelmäßige Gesichtsreinigung und lassen Sie sich mit einem frischen, seidig schimmernden Teint belohnen. Aktivkohle ist ein zuverlässiges Mittel gegen Unreinheiten auf der Haut. Und die beliebte Peel-Off-Formel garantiert eine Tiefenreinigung, die Sie tatsächlich spüren können. Die Black Peel-Off Masken folgen Ihnen dank dieser zehn praktischen Einzelpackungen überall hin. Unsere Maske ist für Frauen und Männer gleichermaßen geeignet.\r\nTun Sie Ihrer Haut etwas Gutes und verwöhnen Sie sich mit unserer Dr. Severin® Blackhead Remover Peel-Off Maske!');
REPLACE INTO `catalog_product_entity_text` VALUES (330,149,0,56,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (331,75,0,56,'Sugaring ist eine der ältesten Formen der Haarentfernung der Welt, aber erst seit kurzem ist sie in Europa wegen ihrer Hautfreundlichkeit beliebt. Bei der Entwicklung von Dr. Severin® Sugaring Paste war es uns besonders wichtig, die Anwendung so rein und einfach wie möglich zu gestalten. Dr. Severin® Sugaring Paste ist parfümfrei und wird nach einer altbewährten traditionellen Rezeptur hergestellt. Alles, was wir geändert haben, war das Herstellungsverfahren, um es noch einfacher und hautfreundlicher zu machen. Das Ergebnis ist ein traditionelles Produkt in seiner reinsten Form, innoviert und optimiert mit moderner Fertigungstechnologie zu Dr. Severin® Sugaring Paste. ');
REPLACE INTO `catalog_product_entity_text` VALUES (332,149,0,57,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (333,75,0,57,'Beleben Sie Ihre Haut mit diesem reinigenden und kühlenden Körperpeeling. Beugt eingewachsenen Haaren vor durch natürliche Enzyme aus der Papayafrucht und dem Peelingeffekt des uralten Kristallsalzes aus dem toten Meer. Das revitalisierende Peeling hinterlässt einen zartpflegenden Mandel- und Arganölfilm auf der Haut. Massierend auf die feuchte Haut auftragen. Mit warmem Wasser abspülen.');
REPLACE INTO `catalog_product_entity_text` VALUES (334,149,0,58,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (335,75,0,58,'Nach der Rasur: Dr. Severin. Das Dr. Severin Men Original Body After Shave Balsam – für eine effektive Nachbehandlung der Haarentfernung am Körper oder im Gesicht. Gerade die Haarentfernung an empfindlichen Hautpartien, wie dem Achsel- oder Brustbereich kann unangenehme Hautirritationen hervorrufen. Hier ist eine besondere Nachbehandlung und Pflege besonders wichtig.');
REPLACE INTO `catalog_product_entity_text` VALUES (336,149,0,59,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (337,75,0,59,'Das Dr. Severin Men Original Body After Shave Balsam eignet sich speziell für eine effektive Nachbehandlung der Haarentfernung am Körper oder im Gesicht. Gerade die Haarentfernung an empfindlichen Hautpartien, wie dem Achsel- oder Brustbereich kann unangenehme Hautirritationen hervorrufen. Hier ist eine besondere Nachbehandlung und Pflege besonders wichtig.');
REPLACE INTO `catalog_product_entity_text` VALUES (338,149,0,60,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (339,75,0,60,'Die von Dr. Severin® entwickelten Phyto-Farbpigmente neutralisieren die Verfärbungen aus der Umwelt. So wird der Gelbstich wirkungsvoll entfernt und ein schönes, glanzvolles silbernes, weißes oder graues Haar kommt wieder zum Vorschein. Das Haar wirkt schon nach der ersten Wäsche einheitlich schimmernd und weniger gelblich. Fühlen Sie sich wohl in Ihrem Haar – Mit dem Dr. Severin® Silber Spezial Shampoo.');
REPLACE INTO `catalog_product_entity_text` VALUES (340,149,0,61,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (341,75,0,61,'Gönnen Sie Ihrer Haut etwas Gutes. Das Dr. Severin® Starter-Paket enthält alle wichtigen Bestandteile für eine angenehme Haarentfernung. Das Dr. Severin® Aequoreus Enzym Meersalz Peeling bereitet Ihre Haut ideal auf die Haarentfernung vor, indem es kleine, eingewachsene Härchen freilegt, sodass diese bei der Haarentfernung berücksichtigt werden. Die Dr. Severin® Cleopatra Sugaring Paste entfernt die Haare und ist besonders hautverträglich. Sie wurde rein und ohne Parfüm entwickelt. Sugaring gilt als effektiver als Waxing und weniger hautreizend als Epilieren. Nach der Haarentfernung hilft das Dr. Severin® Women Original Body After Shave Balsam, Hautirritationen, eingewachsenen Haaren sowie Rasierpickeln entgegenzuwirken. Die bewährte Dr. Severin® Formel wirkt schonend zur Haut und hilft, sie zu beruhigen.');
REPLACE INTO `catalog_product_entity_text` VALUES (342,149,0,62,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (343,75,0,62,'Sofort sichtbare Faltenreduktion: Glatte Haut - wenige Sekunden nach dem Auftragen. Dafür sorgt der Wirkkomplex aus langkettiger Hyaluronsäure mit Vitamin C. Die Dr. Severin Forschung hat hierfür das optimale 3:1-Verhältnis entwickelt. Die Wirkstoffkomponenten wurden in eine ph-ideale Umgebung eingebettet, um die Aufnahme durch die Haut zu optimieren. Daraus ergibt sich eine sofort sichtbare Faltenreduktion über mehrere Stunden. Nur beste, hochwertige Inhaltsstoffe werden verwendet, um das Dr. Severin Vitamin C Hyaluron Serum zu gewinnen. Straffen Sie Ihre Haut durch das Auftragen des Serums im Gesicht, am Hals und im Dekolletébereich. Wirksame Hyaluronsäure hilft, Falten zu vermindern indem sie für Elastizität und Spannkraft sorgt. Auch der Anti-Aging-Effekt von Vitamin C kommt beim Serum von Dr. Severin zum Tragen. Vitamin C hilft dem Körper, Kollagen zu produzieren, das mit seinem Gerüst eine Hautstruktur bildet, die größere Spannungen aushält ohne zu reißen. Das Dr. Severin Vitamin C Hyaluron Serum kombiniert die Wirkung aus beiden Wirkstoffen und sorgt so für ein glattes, gleichmäßiges Hautbild.');
REPLACE INTO `catalog_product_entity_text` VALUES (344,149,0,63,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (345,75,0,63,'Sie kennen das Problem: In Herbst und Winter sorgen niedrige Temperaturen und nasskaltes Wetter für allgemeines Unwohlsein. Insbesondere unsere Füße leiden in dieser Jahreszeit. Haben wir kalte, frierende Füße, hat das Auswirkungen auf den gesamten Organismus, denn sie tragen wesentlich zur Regulierung des Temperaturhaushaltes im Körper bei. Wir schaffen Abhilfe: Die wärmende Fußcreme von Dr. Severin sorgt für Wohlbefinden durch einen einzigartigen Wärme- und Pflegeeffekt. Herrschen draußen kalte Temperaturen, leiden unsere Füße oft zuerst darunter. Kalte, frierende Füße sorgen für allgemeines Unwohlsein und die trockene und kalte Luft kann rissige und raue Haut an den Füßen verursachen. Starke Beanspruchungen, beispielsweise durch einen Winterspaziergang oder berufliche Tätigkeiten im Freien, können diese Symptome verstärken. Juckreiz oder ein Spannungsgefühl auf der Haut können ebenso die Folge trockener Haut sein. Die wärmende Fußcreme von Dr. Severin bietet die Lösung. Sie überzeugt durch drei wesentliche Effekte: Sie wärmt, spendet Feuchtigkeit und sorgt für eine geschmeidige Haut. Damit Sie jede Jahreszeit in vollen Zügen genießen können.');
REPLACE INTO `catalog_product_entity_text` VALUES (346,149,0,64,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (347,75,0,64,'Besonders in den kühlen Jahreszeiten leiden viele unter kalten sowie trockenen Händen, hier lässt Sie unsere Dr. Severin wärmende Handcreme nicht im Stich. Tragen Sie die Creme auf und massieren Sie diese sanft ein, sofort wird die Durchblutung gefördert und ein angenehmes Wärmegefühl verbreitet sich. Durch die einmalige Kombination mit Vitamin E und Mandelöl, wird der Feuchtigkeitsdepot der Haut wieder aufgefüllt und Ihre Hände werden beruhigend gepflegt und glatter aussehen. Das Produkt ist vegan und wurde ohne Alkohol entwickelt.');
REPLACE INTO `catalog_product_entity_text` VALUES (348,149,0,65,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (349,75,0,65,'Das Dr. Severin Women Original Body After Shave Balsam hilft wirksam gegen Entzündungen, Rasierpickel und Hautirritationen an Achseln, Beinen und im Intimbereich. Es ist besonders zur Anwendung nach Rasur, Epilation, Waxing oder Sugaring geeignet, kann aber auch zur generellen Hautpflege verwendet werden. Das Dr. Severin Women Original Body After Shave Balsam wirkt hautberuhigend und antibakteriell für das Wohlbefinden der Haut');
REPLACE INTO `catalog_product_entity_text` VALUES (350,149,0,66,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (351,75,0,66,'Durch die tägliche Rasur wird Ihre Haut besonders angegriffen. Sie erleidet Verletzungen,  Bakterien dringen in die verletzte Haut ein und es entstehen Rötungen und Rasierpickelchen. \r\nDurch die bakterielle Störung der Hautbarriere können zudem Haare in der Haut einwachsen. Diese müssen im schlimmsten Fall von einem Arzt behandelt werden. \r\nMit diesem Problem setzen wir uns von Dr. Severin® uns schon lange auseinander. Auf Grundlage dieser langjährigen Erfahrung haben wir das Dr. Severin® Body Aftershave Balm Propolis Protection für Sie entwickelt. \r\nDurch das besondere Zusammenspiel von Propolis und den anderen ausgewählten Zutaten, werden die Schmerzen und das Juckreiz nach der  Rasur gelindert bzw. vorgebeugt. Außerdem sorgen unsere exzellenten Inhaltsstoffe dafür, dass Ihre Haut die nötige Feuchtigkeit erhält und gestärkt wird. Somit ist unser Dr. Severin® Body Aftershave Balm Propolis Protection die perfekte Ergänzung zu Ihrer Körperpflege-Routine. Durch die tägliche Rasur wird Ihre Haut besonders angegriffen. Sie erleidet Verletzungen,  Bakterien dringen in die verletzte Haut ein und es entstehen Rötungen und Rasierpickelchen. \r\nDurch die bakterielle Störung der Hautbarriere können zudem Haare in der Haut einwachsen. Diese müssen im schlimmsten Fall von einem Arzt behandelt werden. \r\nMit diesem Problem setzen wir uns von Dr. Severin® uns schon lange auseinander. Auf Grundlage dieser langjährigen Erfahrung haben wir das Dr. Severin® Body Aftershave Balm Propolis Protection für Sie entwickelt. \r\nDurch das besondere Zusammenspiel von Propolis und den anderen ausgewählten Zutaten, werden die Schmerzen und das Juckreiz nach der  Rasur gelindert bzw. vorgebeugt. Außerdem sorgen unsere exzellenten Inhaltsstoffe dafür, dass Ihre Haut die nötige Feuchtigkeit erhält und gestärkt wird. Somit ist unser Dr. Severin® Body Aftershave Balm Propolis Protection die perfekte Ergänzung zu Ihrer Körperpflege-Routine. ');
