REPLACE INTO `catalog_product_entity_text` VALUES (353,75,0,67,'Durch die tägliche Rasur wird Ihre Haut besonders angegriffen. Sie erleidet Verletzungen, Bakterien dringen in die verletzte Haut ein und es entstehen Rötungen und Rasierpickelchen. \r\nDurch die bakterielle Störung der Hautbarriere können zudem Haare in der Haut einwachsen. Diese müssen im schlimmsten Fall von einem Arzt behandelt werden. \r\nMit diesem Problem setzen wir uns von Dr. Severin® uns schon lange auseinander. Auf Grundlage dieser langjährigen Erfahrung haben wir das Dr. Severin® Body Aftershave Balm Propolis Protection für Sie entwickelt. \r\nDurch das besondere Zusammenspiel von Propolis und den anderen ausgewählten Zutaten, werden die Schmerzen und das Juckreiz nach der Rasur gelindert bzw. vorgebeugt. Außerdem sorgen unsere exzellenten Inhaltsstoffe dafür, dass Ihre Haut die nötige Feuchtigkeit erhält und gestärkt wird. Somit ist unser Dr. Severin® Body Aftershave Balm Propolis Protection die perfekte Ergänzung zu Ihrer Körperpflege-Routine. Durch die tägliche Rasur wird Ihre Haut besonders angegriffen. Sie erleidet Verletzungen, Bakterien dringen in die verletzte Haut ein und es entstehen Rötungen und Rasierpickelchen. \r\nDurch die bakterielle Störung der Hautbarriere können zudem Haare in der Haut einwachsen. Auf Grundlage dieser langjährigen Erfahrung haben wir das Dr. Severin® Body Aftershave Balm Propolis Protection für Sie entwickelt. \r\nDurch das besondere Zusammenspiel von Propolis und den anderen ausgewählten Zutaten, werden die Schmerzen und das Juckreiz nach der Rasur gelindert bzw. vorgebeugt. Außerdem sorgen unsere exzellenten Inhaltsstoffe dafür, dass Ihre Haut die nötige Feuchtigkeit erhält und gestärkt wird. Somit ist unser Dr. Severin® Body Aftershave Balm Propolis Protection die perfekte Ergänzung zu Ihrer Körperpflege-Routine. ');
REPLACE INTO `catalog_product_entity_text` VALUES (354,149,0,68,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (355,75,0,68,'Zelebrieren Sie die Genuss-Momente des Tages! Unterbrechen Sie den oft stressigen Alltag für einige Augenblicke und nehmen Sie sich die Zeit für einen guten Espresso aus den gebogenen Tassen und eine süße Kleinigkeit, ein Stück Kuchen, Obst oder Gebäck auf den schlichten, formschönen Dessert-Tellern. Das Espresso-Dessert-Set, bestehend aus 2 Espressotassen und Untertassen, 2 Dessert-Tellern, sowie Zucker- und Wasser-/Milchkännchen, bietet Ihnen den richtigen Rahmen dafür. Für den täglichen Gebrauch geeignet.\r\nHinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.\r\n');
REPLACE INTO `catalog_product_entity_text` VALUES (356,149,0,69,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (357,75,0,69,'Innehalten und genießen. Nehmen Sie sich die Zeit und genießen Sie einen guten Espresso aus den gebogenen Tassen. Das Set eignet sich optimal für die schönen Augenblicke zu zweit oder als besonderes Geschenk. Für den täglichen Gebrauch geeignet.\r\n\r\nHinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.');
REPLACE INTO `catalog_product_entity_text` VALUES (358,149,0,70,'7');
REPLACE INTO `catalog_product_entity_text` VALUES (359,75,0,70,'Die handgefertigte Holzfassung dieses Modelles besteht aus 100% Sandelholz. Das Gestell und die Bügel sind 5-Schicht verleimt. Das verleiht ihnen hohe Stabilität, wobei sie trotzdem flexibel bleiben. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die grünen Spiegelglas Kunststoffgläser der Sonnenbrille sind polarisiert und aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus.  Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
REPLACE INTO `catalog_product_entity_text` VALUES (360,149,0,71,'7');
REPLACE INTO `catalog_product_entity_text` VALUES (361,75,0,71,'Die handgefertigte Holzfassung dieses Modelles besteht aus Sandelholz und Acetat. Das Gestell und die Bügel sind 5-Schicht verleimt. Das verleiht ihnen hohe Stabilität, wobei sie trotzdem flexibel bleiben. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die klassisch dunklen Kunststoffgläser sind polarisiert und aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus.  Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
REPLACE INTO `catalog_product_entity_text` VALUES (362,149,0,72,'7');
REPLACE INTO `catalog_product_entity_text` VALUES (363,75,0,72,'Die handgefertigte Holzfassung dieses Modelles besteht aus Nussholz in Kombination mit Acetat. Das Gestell und die Bügel sind 5-Schicht verleimt. Das verleiht ihnen hohe Stabilität, wobei sie trotzdem flexibel bleiben. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die Kunststoffgläser aus orangem Spiegelglas sind polarisiert und aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus. Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
