REPLACE INTO `catalog_product_entity_text` VALUES (399,75,0,90,'Italienisches Design trifft auf Südtiroler Lifestyle. Das Modell BLACK EDITION ist unser Topseller und eine richtige Männeruhr. Das Gehäuse und das Uhrenband sind aus einem Stück Sandelholz gearbeitet. Das Zifferblatt, die Krone und die Schließe sind farblich abgestimmt und wirken durch das vornehmlich schwarze Design sehr edel. Der Gehäusekorpus sowie das Armband bestehen aus 100% Sandelholz, die Schließe dagegen aus Edelstahl. Die Zeiger sind speziell beschichtet und leuchten in der Dunkelheit nach. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Die Uhr wird in einer schönen Holzbox geliefert.');
