REPLACE INTO `catalog_product_entity_text` VALUES (401,75,0,91,'Italienisches Design trifft auf Südtiroler Lifestyle. Der Chronograph DAMIAN ist aus feinstem Sandelholz gefertigt und mit einem silbernen Zifferblatt ausgestattet. Dadurch ist diese Holzuhr alltagstauglich, passt aber auch perfekt zu eleganteren Anlässen. Der Gehäusekorpus und das Armband bestehen aus 100% Sandelholz und sind aus einem Stück Holz gefertigt. Die Schließe dagegen ist aus Edelstahl. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Imprägniert mit Haut-freundlichem Material ist sie auch geeignet für Allergiker. Sie bedarf keiner speziellen Pflege. Die Uhr wird in einer schönen Holzbox geliefert.');
