REPLACE INTO `catalog_product_entity_text` VALUES (469,75,0,125,'Italienisches Design trifft auf Südtiroler Lifestyle. Unser NOA im Boho-Stil passt gleichermaßen für Damen und Herren. Das hellbraune Lederarmband harmoniert perfekt mit dem Edelstahl Gehäuse und dem Echtholz-Zifferblatt. Die feine Datumsanzeige rundet den puristischen Style ab. Das Zifferblatt besteht aus Zebranoholz. Die Schließe und das Gehäuse sind aus Edelstahl und das Armband aus Leder. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch das Lederarmband ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Imprägniert mit hautfreundlichem Material ist sie auch geeignet für Allergiker. Sie bedarf keiner speziellen Pflege. Die Uhr wird in einer schönen Holzbox geliefert.\r\n');
