REPLACE INTO `catalog_product_entity_text` VALUES (477,75,0,129,'Italienisches Design trifft auf Südtiroler Lifestyle. Die Kombination aus dunklem Sandelholz und einem Edelstahlgehäuse, macht aus RAÚL einen echten Blickfang. Besonders praktisch ist auch die Anzeige von Wochentag und Datum. Das Armband und das Zifferblatt bestehen aus 100% Sandelholz. Die Schließe und der Gehäusekorpus dagegen sind aus Edelstahl. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Die Uhr wird in einer schönen Holzbox geliefert. Automatikwerk.');
