REPLACE INTO `catalog_product_entity_text` VALUES (487,75,0,134,'Italienisches Design trifft auf Südtiroler Lifestyle. Das Edelstahl Gehäuse hat ein Echtholz Zifferblatt und eine raffinierte Datumsanzeige. Diese Uhr wurde designt für Damen und Herren die klare und schlichte Linien zu schätzen wissen. Das Armband und das Zifferblatt bestehen aus Zebranoholz. Die Schließe und das Gehäuse sind aus Edelstahl. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Imprägniert mit hautfreundlichem Material ist sie auch geeignet für Allergiker. Sie bedarf keiner speziellen Pflege. Die Uhr wird in einer schönen Holzbox geliefert.');
REPLACE INTO `catalog_product_entity_text` VALUES (488,149,0,135,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (489,75,0,135,'Die kleinen Geschmacksverstärker für den optimalen Kaffeegenuss! Verfeinern Sie Ihren Kaffee mit etwas Milch und Zucker und gönnen Sie sich noch eine leckere Kleinigkeit dazu. Das formschöne, schlicht gehaltene Set, bestehend aus einem Milchkännchen, einer Zuckerdose und einer Schale für Kekse, ist aus schwarzem Porzellan gefertigt, innen glasiert und außen bisquit.  Es lässt sich jedoch auch problemlos umfunktionieren! Reichen Sie ein schönes Öl und Salz aus Kännchen und Dose und feine Gewürze aus der Schale zu einer Hauptspeise oder zu etwas Brot, Suppe als Vorspeise. Für den täglichen Gebrauch geeignet.\r\nHinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.\r\n');
