REPLACE INTO `catalog_product_entity_text` VALUES (497,75,0,139,'Dieser hochwertige Modeschmuck wird in Italien handgefertigt. Die Ohrringe strahlen in einer Sterling Silber, vergoldeten Fassung und die Schmucksteine des blauen Topas und Lapislazulis im Schachbrett-/ Tafelschliff, unterstreichen die Finesse und Einzigartigkeit jeder Frau.\r\n\r\nDie Accessoires von Coco Bont sind ausgefallen, elegant und zugleich schlicht. Dabei legt Coco Bont sehr großen Wert auf Qualität - im Besonderen im Hinblick auf die Materialien, als auch auf die Verarbeitung und nicht zuletzt auch auf den Tragekomfort. Mit Coco Bont tragen Sie das Besondere, Geschmackvolle und Aparte.\r\n\r\n');
