REPLACE INTO `catalog_product_entity_text` VALUES (576,149,0,179,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (577,75,0,179,'Die zauberhaften Kleinigkeiten aus drei Teilen. Mit den flachen Schalen mit ganz reduzierter Standfläche verwandeln Sie jeden Tisch in eine kleine Schlemmeroase. Ob gefüllt mit Antipasti, einem guten Öl und Salz, Dips, Soßen oder verschiedenen Knabbereien - all diese Köstlichkeiten finden hier Ihren Rahmen. Dabei können die Schalen auch ein wenig hin- und her wippen, was die Präsentation umso schöner macht. Unser Tipp: Die Schalen eignen sich auch wunderbar zur Dekoration. Verschönert mit einigen Blütenblättern, ein paar besonderen Steinen, getrockneten Chilis oder Gewürzen wie Zimtstangen und Anis, Ihrer Kreativität sind keine Grenzen gesetzt! Für den täglichen Gebrauch geeignet.\r\nHinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.\r\n');
