REPLACE INTO `catalog_product_entity_text` VALUES (584,149,0,183,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (585,75,0,183,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nDas SheaSahne DIY-Kit Blossom Rose +ONE enthält hochwertige Bio-Rohstoffe in bester Qualität und in der exakt benötigten Menge. Einfach bestellen und sofort losrühren!\r\nAus reiner Sheabutter und feinstem Wildrosenöl zauberst Du eine luxuriöse Körperbutter. Zarter Rosenduft verwöhnt Körper und Sinne. Rühre in nur wenigen Schritten Deine individuelle Hautpflege. Verzichte auf unnötige Zusatzstoffe und erlebe pure Pflege aus der Natur. Sweet yourself!\r\nDas SheaSahne DIY-Kit Blossom Rose +ONE in der schönen Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n\r\nInformationen zum Produkt:\r\n- Inhalt: Bio-Sheabutter, Bio-Aprikosen Kernöl, Bio-Wildrosenöl, Bio-Maisstärke, natürliches Vitamin E, ätherisches Öl Rosengeranie (kba) & Patchouli (kba), Spatel, Rezeptkarte, Tiegel, Etiketten und Geschenkverpackung durch Upcycling\r\n- Zubereitungsdauer: 45 Minuten\r\n- Schwierigkeitsstufe: mittel\r\n- Ergibt: 2 Tiegel mit je 120ml\r\n- Frei von Mineralölen, Silikonen, Parabenen, ganz ohne Tierversuche und Gentechnik!\r\n');
REPLACE INTO `catalog_product_entity_text` VALUES (586,149,0,184,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (587,75,0,184,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nDas SheaSahne DIY-Kit Fresh Tangerine +ONE enthält hochwertige Bio-Rohstoffe in bester Qualität und in der exakt benötigten Menge. Einfach bestellen und sofort losrühren!\r\nAus reiner Sheabutter und mildem Aprikosen Kernöl zaubern Sie eine ergiebige und leichte Körperbutter. Die hochwertige Sheabutter spendet Feuchtigkeit und glättet Ihre Haut, während der Duft nach Zitrusfrüchten Körper und Sinne erfrischt. Enjoy yourself!\r\nDas SheaSahne DIY-Kit Fresh Tangerine +ONE in der eleganten Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n\r\nInformationen zum Produkt:\r\n- Inhalt: Bio-Sheabutter, Bio-Sonnenblumenöl, Bio-Maisstärke, natürliches Vitamin E, ätherisches Öl Mandarine (kba), Bergamotte (kba) & Lemongrass (kba), Spatel, Rezeptkarte, Tiegel, Etiketten und Geschenkverpackung durch Upcycling \r\n- Zubereitungsdauer: 45 Minuten\r\n- Schwierigkeitsstufe: mittel\r\n- Ergibt: 1 Tiegel mit 120ml\r\n- Frei von Mineralölen, Silikonen, Parabenen, ganz ohne Tierversuche und Gentechnik!\r\n');
