REPLACE INTO `catalog_product_entity_text` VALUES (589,75,0,185,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nDas SheaSahne DIY-Kit TrueLavender +ONE enthält hochwertige Bio-Rohstoffe in bester Qualität und in der exakt benötigten Menge. Einfach bestellen und sofort losrühren!\r\nAus reiner Sheabutter und zartem Mandelöl zaubern Sie eine ergiebige und hochwertige Körperbutter. Die hochwertige Sheabutter spendet Feuchtigkeit und glättet Ihre Haut, während der frische Lavendelduft beruhigt und entspannt. 100% relaxing!\r\nDas SheaSahne DIY-Kit TrueLavender +ONE in der eleganten Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n\r\nInformationen zum Produkt:\r\n- Inhalt: Bio-Sheabutter, Bio-Mandelöl, Bio-Maisstärke, natürliches Vitamin E, ätherisches Öl Lavendel (kba), Spatel, Rezeptkarte, Tiegel, Etiketten und Geschenkverpackung durch Upcycling\r\n- Zubereitungsdauer: ca. 45 Minuten\r\n- Schwierigkeitsstufe: mittel\r\n- Ergibt: 1 Tiegel mit 120ml\r\n- Frei von Mineralölen, Silikonen, Parabenen, ganz ohne Tierversuche und Gentechnik!\r\n');
