REPLACE INTO `catalog_product_entity_text` VALUES (591,75,0,186,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an.\r\nDas SheaSahne DIY-Kit Vanilla Bliss +ONE enthält hochwertige Bio-Rohstoffe in bester Qualität und in der exakt benötigten Menge. Einfach bestellen und sofort losrühren!\r\nAus reiner Sheabutter und zartem Mandelöl zaubern Sie eine ergiebige und leichte Körperbutter. Die hochwertige Sheabutter spendet Feuchtigkeit und glättet Ihre Haut. Der natürliche Vanilleduft verwöhnt Ihre Sinne und gibt Ihnen das Gefühl exotischer Schönheit. 100% lovely!\r\nDas SheaSahne DIY-Kit Vanilla Bliss +ONE in der eleganten Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur!\r\n\r\nInformationen zum Produkt:\r\n- Inhalt: Bio-Sheabutter, Bio-Mandelöl, Bio-Maisstärke, natürliches Vitamin E, natürliches Vanilleextrakt (kba), Spatel, Rezeptkarte, Tiegel, Etiketten und Geschenkverpackung durch Upcycling\r\n- Zubereitungsdauer: 45 Minuten\r\n- Schwierigkeitsstufe: mittel\r\n- Ergibt: 1 Tiegel mit 120ml\r\n- Frei von Mineralölen, Silikonen, Parabenen, ganz ohne Tierversuche und Gentechnik!\r\n');
REPLACE INTO `catalog_product_entity_text` VALUES (592,149,0,187,'5');
REPLACE INTO `catalog_product_entity_text` VALUES (593,75,0,187,'Bereiten Sie sich und Ihren Lieben einen frischen Tee in der richtigen Temperierung und mit der nötigen Sorgfalt zu. Die Teetassen aus schwarzem Porzellan sind innen glasiert und außen bisquit. Material, Farbe und die harmonische Form eignen sich optimal für den perfekten Teegenuss! Das Set besteht aus 4 Tassen und einem Teller, der als Tablett und auch als Teller für Gebäck oder andere Kleinigkeiten verwendet werden kann. Außerdem können die Tassen/Behältnisse vielseitig verwendet werden, bspw. zum Befüllen mit Dips, einem Süppchen, kleinen Vorspeisen oder auch als Trinkbecher. Für den täglichen Gebrauch geeignet.\r\nHinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.');
REPLACE INTO `catalog_product_entity_text` VALUES (594,149,0,188,'4');
REPLACE INTO `catalog_product_entity_text` VALUES (595,75,0,188,'Die Staudt Praeludium Automatic ist eine mechanische Uhr, die Ihnen das Datum und die Uhrzeit in Stunden, Minuten und Sekunden anzeigt. Das Uhrengehäuse hat einen Durchmesser von 42,5 mm und ist aus Edelstahl gefertigt. Die Uhr ist bis zu drei Bar wasserdicht und ein gewölbtes Saphirglas mit doppelter Antireflexbeschichtung sorgt für eine glasklare Sicht auf das charakteristische zweifarbige Zifferblatt. Die eleganten, blattförmigen Zeiger sind aus hochwertigem Stahl gefertigt und von Hand poliert. Das Automatikwerk hat eine Gangreserve von 42 Stunden und ist durch den Gehäuseboden geschützt. Das handgefertigte Alligatorenlederarmband mit Faltschließe sorgt dafür, dass sich die Uhr elegant um Ihr Handgelenk legt. Insgesamt enthält das Werk 25 Steine. Der Rotor hat eine runde und gestreifte Oberfläche und ist mit 18 Karat Roségold beschichtet.');
