REPLACE INTO `catalog_product_entity_text` VALUES (615,75,0,198,'Die Praeludium MOP ist eine mechanische Uhr, die die Zeit in Stunden, Minuten und Sekunden anzeigt. Das Gehäuse hat einen Durchmesser von 37 mm und ist aus hochwertigem Edelstahl gefertigt. Die Uhr ist bis zu drei Bar wasserdicht und ein gewölbtes Saphirglas mit doppelter Antireflexbeschichtung sorgt für eine glasklare Sicht auf das charakteristische zweifarbige Zifferblatt. Die eleganten, blattförmigen Zeiger sind ebenfalls aus Stahl gefertigt und von Hand poliert. Das Automatikwerk hat eine Gangreserve von 42 Stunden und ist durch den Gehäuseboden sichtbar. Das handgefertigte Alligatorenlederarmband mit Faltschließe sorgt dafür, dass sich die Uhr elegant um Ihr Handgelenk legt.Das Werk ist in Perlage ausgeführt und die Schrauben werden durch Hitze gebläut. Insgesamt enthält das Werk 25 Steine. Der Rotor hat ein kreisrundes Côtes de Genève-Finish und ist mit 18 Karat Roségold beschichtet. ');
