REPLACE INTO `catalog_product_entity_text` VALUES (932,149,0,202,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (933,75,0,202,'Ein Kosmos mit Himmelskörpern und Tierkreiszeichen eröffnet sich auf dem Zifferblatt der Babylonian I. Im Zentrum dieser „Galaxie“ befindet sich, wie bei vielen „Alexander Shorokhoff“-Uhren, ein handgraviertes Uhrwerk, das auf der Vorderseite mit einem speziellen Sonnenschliff versehen ist. Ein Wellenornament – Symbol des Wassers und der Flüsse Euphrat und Tigris - liegt darüber und markiert die Horizontalachse. Die Sonne und der Mond ergänzen das harmonische Bild dieser Konstellation. Um dieser „Galaxie“ noch mehr Bedeutung zukommen zu lassen, wurden Tierkreiszeichen in der Mitte auf einem blauschimmernden Perlmuttring platziert. Der dunkelblaue, um 1,5 mm tiefer liegende Rahmen mit den goldenen Sternen lässt die Zahlen und die silberne Stunden- bzw. Minutenmarkierung besonders hervortreten. Die Zeiger präsentieren sich in tiefem Nachtblau.');
REPLACE INTO `catalog_product_entity_text` VALUES (934,149,0,203,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (935,75,0,203,'Der Erfolg des ersten gleichnamigen Modells, das für den German Design Award 2015 nominiert wurde, hat Alexander Shorokhov motiviert, eine zweite Version ins Leben zu rufen. Die Inspiration dazu entstand durch die Berührung mit der Geschichte der größten und mächtigsten Stadt des Altertums: Babylon. Nicht zufällig wird der Name der Stadt mit „Tor des Gottes“ übersetzt. Der Reichtum der Stadt zog in ihrer Glanzzeit die besten Astronomen, Wissenschaftler, Handwerker und Künstler an und machte sie zu einem hochentwickelten kulturellen Zentrum. Nicht zufällig wurden dort die Sternbilder entdeckt, die Tierkreiszeichen erfunden und die ersten Horoskope erstellt. Diese kulturelle Faszination Babylons wird hier aufgegriffen. Die Platine des Werkes und der äußere Ring des Zifferblattes werden in einem hochkomplizierten Verfahren per Hand filigran ausgearbeitet und dekorativ gestaltet. Zusammen mit dem Stundenring aus dunkelblauem Perlmutt mit aufgedruckten Tierkreiszeichen, den gebläuten Zeigern und der Stundenmarkierung entsteht ein faszinierendes Bild. Auch auf der Rückseite der Uhr kann man sich an den meisterhaften Gravuren erfreuen. \r\nDie Babylonian II ist auf nur 300 Stück limitiert. ');
REPLACE INTO `catalog_product_entity_text` VALUES (936,149,0,204,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (937,75,0,204,'Mit der Uhr „Barbara“ erweist Alexander Shorokhov einer der größten zeitgenössischen Jazzmusikerinnen, Barbara Dennerlein, die für ihr Spiel auf der Hammondorgel berühmt wurde, seine Reverenz. „Die avantgardistische Musik von Barbara hat mich in ihren Bann gezogen. Ich habe eine Uhr mit Orgeltasten um einen Notenschlüssel herum kreiert, der auf farbig-lebendigem Hintergrund den Rahmen geradezu sprengt. Das avantgardistische Design entspricht dem Werk dieser einzigartigen Künstlerin“, beschreibt Shorokhov seinen Entwurf bei der Vorstellung der Uhr auf der internationalen Schmuck- und Uhrenausstellung „Baselworld 2015“. Mit einer Limitierung von nur 169 Stück ist das mit dem German Design Award „Special Mention“ prämierte Modell ein echtes Sammlerstück.');
REPLACE INTO `catalog_product_entity_text` VALUES (938,149,0,205,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (939,75,0,205,'Jetzt gibt es den erfolgreichen Handaufzugs-Chronographen auch in einer Automatikversion. Aufgrund seiner großen Beliebtheit bei den Uhrenfreunden wurden alle weiteren Details einschließlich des Designs beibehalten. ');
REPLACE INTO `catalog_product_entity_text` VALUES (940,149,0,206,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (941,75,0,206,'Rot kann auch sehr behutsam und unaufdringlich eingesetzt werden. Mit viel Kreativität und Geschick wird hier ein wirkungsvolles, interessantes Detail hinzugefügt. Ein roter Ring, der in ein sportlich-elegantes Modell, den Chronographen C01-4R der “Avantgarde“-Kollektion, eingebaut wird, bringt noch mehr Eleganz und zeigt, wie diese mächtige Farbe gleichermaßen dezent eingesetzt werden kann.  Der passende rote Sekunden- und der kleine Minutenzeiger vervollständigen die Schwarz-Weiß-Rot-Kombination. Die rote und gelbe Naht auf dem Armband ergänzt die avantgardistische Direktheit und unterstützt das starke, dynamische Lebensgefühl, dass die Uhr vermittelt.   ');
REPLACE INTO `catalog_product_entity_text` VALUES (942,149,0,207,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (943,75,0,207,'„La Mitad del Mundo“ ist ein Äquatormonument in San Antonio de Pichincha in Ecuador. Das Monument liegt ca. 23 Kilometer nördlich der Hauptstadt Quito und markiert den Ort, an dem Charles Marie de La Condamine mit einer französischen Expedition 1736 als erster Europäer die genaue Position des Äquators bestimmte. Die Tag- und Nachtgleiche am Äquator, Zeichen für den Beginn von Frühling und Herbst, wird künstlerisch interpretiert in zwei Halbringen auf dem Zifferblatt, die für jeweils zwölf Stunden stehen. Ins Auge fallen ein leuchtendes Orange des oberen Ringes, das Hitze und Glut symbolisiert, und das warme Blau des unteren Ringes, das auf die lauen Äquatornächte anspielt. Beide umschließen - wie der Äquator - den Ozean, der im Zifferblatt mit schimmerndem hellem und dunklem Perlmutt angedeutet ist.');
REPLACE INTO `catalog_product_entity_text` VALUES (944,149,0,208,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (945,75,0,208,'Ein Fall für zwei, weil das sportlich elegante Design und die geschickt gewählte Gehäusegröße von 39 mm von Männern und Frauen gleichermaßen getragen werden kann. Wie auch immer, mit der LA01 von Alexander Shorokhoff ist man in jedem Fall perfekt ausgestattet. ');
REPLACE INTO `catalog_product_entity_text` VALUES (946,149,0,209,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (947,75,0,209,'Eine einzigartige edle Uhr im vintage design. Das Modell „Sixtythree” hat das Uhrendesign, dank dem zylindrischen Saphirglas, den flachen Vorbildern der 60er Jahre angepasst. Die Uhren wiesen mit ihrer flachen Form und dem zylindrischen Glas ein für die damalige Zeit sehr populäres Design auf. Das Ziel heute besteht darin, die alte Vintage-Tradition im neuen „Alexander Shorokhoff“- Stil zu gestalten und erfolgreich weiterzuführen. Das Edelstahlgehäuse besitzt ein in der Herstellung sehr aufwändiges zylindrisches Saphirglas und einen Saphirglasboden und hat eine Wasserdichte von 5 atm. Wie auch die Modelle aus den 60ern, sind die neuen „63-Modelle“ mit gewölbten dunkelblauen, smaragdgrünen, bordeaux-farbenen und schwarzen Zifferblättern ausgestattet. Die rotvergoldeten Zifferblatt-Indexe 20,40 und 60 werden in einem komplizierten Verfahren, das den gewölbten Teil des Zifferblattes ausgleicht, hergestellt. Damit bekommt die Uhr ein edles Erscheinungsbild. Das großflächige Zifferblatt vermittelt das Gefühl, dass die Uhr viel größer ist als in Wirklichkeit. Das hat einen weiteren Vorteil: Sie kann sowohl von Damen, als auch von Herren gleichermaßen getragen werden. Der Rotor des Schweizer Werks 2892.AS wurde im speziellen “Alexander Shorokhoff”-Stil graviert und veredelt.');
REPLACE INTO `catalog_product_entity_text` VALUES (948,149,0,210,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (949,75,0,210,'Eine einzigartige edle Uhr im vintage design. Das Modell „Sixtythree” hat das Uhrendesign, dank dem zylindrischen Saphirglas, den flachen Vorbildern der 60er Jahre angepasst. Die Uhren wiesen mit ihrer flachen Form und dem zylindrischen Glas ein für die damalige Zeit sehr populäres Design auf. Das Ziel heute besteht darin, die alte Vintage-Tradition im neuen „Alexander Shorokhoff“- Stil zu gestalten und erfolgreich weiterzuführen. Das Edelstahlgehäuse besitzt ein in der Herstellung sehr aufwändiges zylindrisches Saphirglas und einen Saphirglasboden und hat eine Wasserdichte von 5 atm. Wie auch die Modelle aus den 60ern, sind die neuen „63-Modelle“ mit gewölbten dunkelblauen, smaragdgrünen, bordeaux-farbenen und schwarzen Zifferblättern ausgestattet. Die rotvergoldeten Zifferblatt-Indexe 20,40 und 60 werden in einem komplizierten Verfahren, das den gewölbten Teil des Zifferblattes ausgleicht, hergestellt. Damit bekommt die Uhr ein edles Erscheinungsbild. Das großflächige Zifferblatt vermittelt das Gefühl, dass die Uhr viel größer ist als in Wirklichkeit. Das hat einen weiteren Vorteil: Sie kann sowohl von Damen, als auch von Herren gleichermaßen getragen werden. Der Rotor des Schweizer Werks 2892.AS wurde im speziellen “Alexander Shorokhoff”-Stil graviert und veredelt.');
REPLACE INTO `catalog_product_entity_text` VALUES (950,149,0,211,'6');
REPLACE INTO `catalog_product_entity_text` VALUES (951,75,0,211,'Die Menschen erleben die Folgen der Klimaveränderung - globale Erwärmung. Mehr und mehr vermisst man in Europa einen richtigen Winter mit viel Schnee und Frost. Alexander Shorokhov macht mit seiner Uhr „Winter“ aufmerksam auf diese unverzichtbare Jahreszeit und bricht mit traditioneller Uhrengestaltung.  Das ganze Zifferblatt zeigt verwachsene Äste eines Baumes, die von einer glitzernden Schneedecke aus Diamanten, welche in einem innovativen Verfahren aufgetragen werden, bedeckt sind. Auch hier gehen wir sorgsam mit der Natur um und verwenden nur abgeschliffene Steine des Diamanten. Am Ende entsteht eine zarte, feminine Uhr, die mit ihrem außergewöhnlichen und innovativen Design überzeugt und fasziniert. Ein Stück Winter am Handgelenk, ausgezeichnet von der international besetzten Expertenjury des German Design Award, mit dem German Design Award „Special Mention“ 2017.');
REPLACE INTO `catalog_product_entity_text` VALUES (2394,149,0,212,'12');
REPLACE INTO `catalog_product_entity_text` VALUES (2395,75,0,212,'<p>AVRILLO Beltissimo ist eine wahre Verwandlungsk&uuml;nstlerin. Ob als klassische Abendhandtasche (Clutch), als Schultertasche mit einer schicken silberfarbenen Metallkette oder als G&uuml;rteltasche getragen, ist Beltissimo eine zugleich praktisch und sch&ouml;ne Begleiterin. Beltissimo ist so flexibel wie Sie Ihre Tasche brauchen. Angenehm weich in der Haptik hat sie z.B. Platz f&uuml;r ein Mobiltelefon, eine Geldb&ouml;rse, Lippenstift und Schl&uuml;ssel. Also das Wichtigste, was Frau dabei haben m&ouml;chte. Innen kann zudem die Rei&szlig;verschlusstasche Einiges wegstecken, z.B. die Metallkette, wenn diese nicht ben&ouml;tigt wird. Ton in Ton gehalten aus hochwertigem Rindsleder und erlesenem Lachsleder ist sie aufgrund ihrer puren Form zu vielen Outfits gut kombinierbar. Egal ob in der Freizeit, im Urlaub oder im Alltag getragen haben Sie mit der Beltissimo Tasche aus dem Hause AVRILLO eine variable Begleiterin gefunden. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der klassischen Form steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; Ton in Ton Gestaltung</p>\r\n<p>&bull; r&uuml;ckseitige Lederschlaufe f&uuml;r den G&uuml;rtel</p>\r\n<p>&bull; durch Ringkarabiner abnehmbare silberfarbene Metallkette (120 cm L&auml;nge)</p>\r\n<p>&bull; Rei&szlig;verschlussinnentasche 10 x 8 cm</p>\r\n<p>&bull; Magnetverschluss</p>\r\n<p>&bull; Clutch, Schultertasche, G&uuml;rtel- / Bauchtasche</p>\r\n<p>&bull; L&auml;nge 17 cm / Breite 3 cm / H&ouml;he 11 cm</p>');
