REPLACE INTO `catalog_product_entity_text` VALUES (2402,149,0,216,'12');
REPLACE INTO `catalog_product_entity_text` VALUES (2403,75,0,216,'<p>Die AVRILLO Domino Klassik Tasche ist ein komfortabler Begleiter durch den Tag sowie auch die Abendstunden. Auf hochwertig schwarzem Rindsleder kommt das erlesene Lachsleder optisch besonders zur Geltung. Durch seine typische Struktur verschafft es der Tasche einen Unikatscharakter. In ihrer zeitlos, klaren Form wird die Handtasche auf der R&uuml;ckseite durch zwei, von einem Lachslederstreifen abgehobene, F&auml;cher f&uuml;r pers&ouml;nliche Dinge erg&auml;nzt. Die Innentasche gl&auml;nzt mit ihrer funktionalen Aufteilung: Zwei F&auml;cher f&uuml;r Mobiltelefon, Schl&uuml;ssel und Lippenstift, inklusive einer Rei&szlig;verschlusstasche. Daneben bietet sie ausreichend Platz f&uuml;r die Geldb&ouml;rse, einer 0,5 l Trinkflasche und weiteren Utensilien. Somit ist sie ideal f&uuml;r Ausfl&uuml;ge, Stadtbummel und mehr geeignet und macht sowohl als Handtasche als auch Umh&auml;ngetasche eine gute Figur. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Lachsfarmen in Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der klassischen Form in bicolorer Gestaltung sorgen die N&auml;hte f&uuml;r einen tollen Kontrast. Dabei steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; bicolore Gestaltung</p>\r\n<p>&bull; zwei Au&szlig;enf&auml;cher</p>\r\n<p>&bull; seitlich angebrachte Metallringe f&uuml;r den Schultergurt</p>\r\n<p>&bull; durch Ringkarabiner abnehmbarer und verstellbarer Schultergurt mit ledernem Schulterpolster</p>\r\n<p>&bull; Innenfutter aus Baumwollstoff, Farbmuster kann vom Foto abweichen</p>\r\n<p>&bull; zwei Innenf&auml;cher und Rei&szlig;verschlu&szlig;tasche</p>\r\n<p>&bull; zugleich Hand- und Umh&auml;ngetasche</p>\r\n<p>&bull; L&auml;nge 24 cm / Breite 6 cm / H&ouml;he 20 cm</p>');
REPLACE INTO `catalog_product_entity_text` VALUES (2404,149,0,217,'12');
REPLACE INTO `catalog_product_entity_text` VALUES (2405,75,0,217,'Die AVRILLO Domino Klassik Tasche ist ein komfortabler Begleiter durch den Tag sowie auch die Abendstunden. Auf hochwertig schwarzem Rindsleder kommt das erlesene Lachsleder optisch besonders zur Geltung. Durch seine typische Struktur verschafft es der Tasche einen Unikatscharakter. In ihrer zeitlos, klaren Form wird die Handtasche auf der Rückseite durch zwei, von einem Lachslederstreifen abgehobene, Fächer für persönliche Dinge ergänzt. Die Innentasche glänzt mit ihrer funktionalen Aufteilung: Zwei Fächer für Mobiltelefon, Schlüssel und Lippenstift, inklusive einer Reißverschlusstasche. Daneben bietet sie ausreichend Platz für die Geldbörse, einer 0,5 l Trinkflasche und weiteren Utensilien. Somit ist sie ideal für Ausflüge, Stadtbummel und mehr geeignet und macht sowohl als Handtasche als auch Umhängetasche eine gute Figur.\r\n \r\nAVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren Häute von Zuchtlachsen aus Lachsfarmen in Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der klassischen Form in bicolorer Gestaltung sorgen die Nähte für einen tollen Kontrast. Dabei steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt.\r\nDetails:\r\n \r\n•	aus Rindsleder und Lachsleder\r\n•	bicolore Gestaltung\r\n•	zwei Außenfächer\r\n•	seitlich angebrachte Metallringe für den Schultergurt\r\n•	durch Ringkarabiner abnehmbarer und verstellbarer Schultergurt mit ledernem Schulterpolster\r\n•	Innenfutter aus Baumwollstoff, Farbmuster kann von der Abbildung abweichen\r\n•	zwei Innenfächer und Reißverschlußtasche\r\n•	zugleich Hand- und Umhängetasche\r\n•	Länge 24 cm / Breite 6 cm / Höhe 20 cm');
REPLACE INTO `catalog_product_entity_text` VALUES (2406,149,0,218,'12');
REPLACE INTO `catalog_product_entity_text` VALUES (2407,75,0,218,'<p>Die AVRILLO Domino Tasche ist &ndash; egal ob als Handtasche oder Umh&auml;ngetasche &ndash; ein idealer Begleiter durch den ganzen Tag.</p>\r\n<p>Feinstes Lachsleder f&auml;llt auf hochwertigem Rindsleder besonders ins Auge. <br />Die besondere Lachslederstruktur macht die Tasche zu einem Accessoire mit Unikatscharakter. F&uuml;r zus&auml;tzlichen Platz sorgen zwei F&auml;cher auf der R&uuml;ckseite, die von einem Lachslederstreifen optisch betont werden. Die Innentasche besticht mit ihrer funktionalen Aufteilung: Zwei F&auml;cher f&uuml;r Mobiltelefon, Schl&uuml;ssel und Lippenstift, inklusive einer Rei&szlig;verschlusstasche. Daneben bietet sie ausreichend Platz f&uuml;r die Geldb&ouml;rse, einer 0,5 l Trinkflasche und weiteren Utensilien. Somit passt sie perfekt f&uuml;r Ausfl&uuml;ge, Stadtbummel und mehr.</p>\r\n<p>AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Lachsen aus Zuchtfarmen aus Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind ein Markenzeichen von AVRILLO. Die klassische Form in tricolorer Gestaltung sowie kontrastreiche N&auml;hte unterstreichen die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; tricolore Gestaltung</p>\r\n<p>&bull; zwei Au&szlig;enf&auml;cher</p>\r\n<p>&bull; seitlich angebrachte Metallringe f&uuml;r den Schultergurt</p>\r\n<p>&bull; durch Ringkarabiner abnehmbarer und verstellbarer Schultergurt mit ledernem Schulterpolster</p>\r\n<p>&bull; Innenfutter aus Baumwollstoff, Farbmuster kann vom Foto abweichen</p>\r\n<p>&bull; zwei Innenf&auml;cher und Rei&szlig;verschlu&szlig;tasche</p>\r\n<p>&bull; zugleich Hand- und Umh&auml;ngetasche</p>\r\n<p>&bull; L&auml;nge 24 cm / Breite 6 cm / H&ouml;he 20 cm</p>');
REPLACE INTO `catalog_product_entity_text` VALUES (2408,149,0,219,'12');
REPLACE INTO `catalog_product_entity_text` VALUES (2409,75,0,219,'<p>AVRILLO PURE Casual ist so flexibel wie Sie Ihre Tasche brauchen. Tragen Sie noch oder schultern Sie schon? In einem exotischen Farbmix gehalten aus hochwertigem Rindsleder und erlesenem Lachsleder ist PURE Casual eine edle Beuteltasche und / oder auch eine aparte Rucksacktasche. Einerseits klassisch dezent, bekommt sie aber durch den Einsatz eines Rei&szlig;verschlusses im angenehm weichen Trageriemen optisch eine sportive Note. Auf der R&uuml;ckseite beh&auml;lt eine Rei&szlig;verschlusstasche Vieles f&uuml;r sich. Das durchdachte Innenleben mit drei F&auml;chern f&uuml;r Mobiltelefon, Lippenstift und Schl&uuml;ssel sowie einer Rei&szlig;verschlusstasche sorgt f&uuml;r Ordnung. Egal ob Sie Ihre Aktivit&auml;ten in der Freizeit oder im Alltag tragen oder schultern wollen, mit der PURE Casual Beutel-Rucksack-Tasche haben Sie die richtige Wahl getroffen. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der klassischen Form wird der Rei&szlig;verschluss im Trageriemen zum zierenden Element. Dabei steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; tricolore Gestaltung</p>\r\n<p>&bull; Ledertrageriemen mit Rei&szlig;verschluss als Zierelement</p>\r\n<p>&bull; durch Ringkarabiner abnehmbare Ledertrageriemen</p>\r\n<p>&bull; durch Ringkarabiner abnehmbare Lederschultergurte f&uuml;r den Rucksack sind l&auml;ngenverstellbar</p>\r\n<p>&bull; Rei&szlig;verschlusstasche auf der R&uuml;ckseite</p>\r\n<p>&bull; Beuteltasche wird anstelle einer Kordel mit einem Rei&szlig;verschluss zusammengezogen, zus&auml;tzlich innen mit Druckknopf verschlie&szlig;bar</p>\r\n<p>&bull; Innentasche ist abgef&uuml;ttert aus Baumwollstoff, Farbmuster kann vom Foto abweichen</p>\r\n<p>&bull; drei Innenf&auml;cher und Rei&szlig;verschlussinnentasche</p>\r\n<p>&bull; Handtasche / Umh&auml;ngetasche und / oder Rucksack</p>\r\n<p>&bull; L&auml;nge 28 cm / Breite 8 cm / H&ouml;he 32 cm</p>');
