REPLACE INTO `catalog_product_entity_text` VALUES (2417,75,0,223,'<p>AVRILLO PURE Casual ist so flexibel wie Sie Ihre Tasche brauchen. Tragen Sie noch oder schultern Sie schon? Ton in Ton gehalten aus hochwertigem Rindsleder und erlesenem Lachsleder ist PURE Casual eine edle Beuteltasche und / oder auch eine aparte Rucksacktasche. Einerseits klassisch dezent, bekommt sie aber durch den Einsatz eines Rei&szlig;verschlusses im angenehm weichen Trageriemen optisch eine sportive Note. Auf der R&uuml;ckseite beh&auml;lt eine Rei&szlig;verschlusstasche Vieles f&uuml;r sich. Das durchdachte Innenleben mit drei F&auml;chern f&uuml;r Mobiltelefon, Lippenstift und Schl&uuml;ssel sowie einer Rei&szlig;verschlusstasche sorgt f&uuml;r Ordnung. Egal ob Sie Ihre Aktivit&auml;ten in der Freizeit oder im Alltag tragen oder schultern wollen, mit der PURE Casual Beutel-Rucksack-Tasche haben Sie die richtige Wahl getroffen. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der klassischen Form wird der Rei&szlig;verschluss im Trageriemen zum zierenden Element. Dabei steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; bicolore Gestaltung</p>\r\n<p>&bull; Ledertrageriemen mit Rei&szlig;verschluss als Zierelement</p>\r\n<p>&bull; durch Ringkarabiner abnehmbare Ledertrageriemen</p>\r\n<p>&bull; durch Ringkarabiner abnehmbare Lederschultergurte f&uuml;r den Rucksack sind l&auml;ngenverstellbar</p>\r\n<p>&bull; Rei&szlig;verschlusstasche auf der R&uuml;ckseite</p>\r\n<p>&bull; Beuteltasche wird anstelle einer Kordel mit einem Rei&szlig;verschluss zusammengezogen, zus&auml;tzlich innen mit Druckknopf verschlie&szlig;bar</p>\r\n<p>&bull; Innentasche ist abgef&uuml;ttert aus Baumwollstoff, Farbmuster kann vom Foto abweichen</p>\r\n<p>&bull; drei Innenf&auml;cher und Rei&szlig;verschlussinnentasche</p>\r\n<p>&bull; Handtasche / Umh&auml;ngetasche und / oder Rucksack</p>\r\n<p>&bull; L&auml;nge 28 cm / Breite 8 cm / H&ouml;he 32 cm</p>');
