REPLACE INTO `catalog_product_entity_text` VALUES (2419,75,0,224,'<p>Der AVRILLO Shopper ist der ideale Begleiter, ob f&uuml;r einen Stadtbummel oder f&uuml;rs B&uuml;ro. Klares Design und ein interessanter Materialmix stehen hier im Vordergrund. Erlesene Lachsleder sorgen f&uuml;r besondere optische Akzente. Innen bietet eine Rei&szlig;verschlusstasche Platz f&uuml;r ein Mobiltelefon, Schl&uuml;ssel und Lippenstift. Zudem bringt die Tasche einen breiten DIN A 4 Ordner m&uuml;helos unter und kann auch sonst Vieles einstecken. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Lachsfarmen in Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Markant sind die bicolore Gestaltung sowie die kontrastreichen N&auml;hte. Dabei steht die geschmackvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; bicolore Gestaltung</p>\r\n<p>&bull; Tasche mit Magnetverschlu&szlig;</p>\r\n<p>&bull; verstellbarer Schultergurt mit ledernem Schulterpolster</p>\r\n<p>&bull; Rei&szlig;verschlussinnentasche aus Baumwollstoff, Farbmuster kann vom Foto abweichen</p>\r\n<p>&bull; Umh&auml;ngetasche</p>\r\n<p>&bull; L&auml;nge 32 cm / Breite 8 cm / H&ouml;he 36 cm</p>');
