REPLACE INTO `catalog_product_entity_text` VALUES (2429,75,0,229,'<p>Sportivo Alexia besticht neben der besonders markanten Form mit ihren Staum&ouml;glichkeiten. Drei Au&szlig;entaschen, vorn und an den Seiten, gl&auml;nzen mit feinsten Lachslederklappen. Platz ist hier f&uuml;r gro&szlig;e und kleine Utensilien. Auf der R&uuml;ckseite bietet eine Rei&szlig;verschlusstasche zus&auml;tzlichen Platz f&uuml;r pers&ouml;nliche Dinge. Innen begeistert sie mit ihrer funktionalen Ausstattung: Zwei F&auml;cher f&uuml;r Mobiltelefon, Visitenkarten, Lippenstift, inklusive einer Rei&szlig;verschlusstasche garantieren f&uuml;r besonders viel &Uuml;bersichtlichkeit. Unterst&uuml;tzend wirkt hier zudem ein heller Stoff, damit Sie in der Tasche leicht und schnell finden, wonach Sie suchen. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Lachsfarmen in Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der auff&auml;lligen Form in bicolorer Gestaltung sowie kontrastreicher N&auml;hte steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; bicolore Gestaltung</p>\r\n<p>&bull; drei Au&szlig;entaschen mit Magnetverschlu&szlig;</p>\r\n<p>&bull; Rei&szlig;verschlu&szlig;tasche</p>\r\n<p>&bull; seitlich angebrachte Metallringe f&uuml;r den Schultergurt</p>\r\n<p>&bull; durch Ringkarabiner abnehmbarer und verstellbarer Schultergurt mit ledernem Schulterpolster</p>\r\n<p>&bull; Innenfutter aus Baumwollstoff, Farbmuster kann vom Foto abweichen</p>\r\n<p>&bull; drei Innenf&auml;cher und Rei&szlig;verschlu&szlig;tasche</p>\r\n<p>&bull; Tasche steht auf vier F&uuml;&szlig;en</p>\r\n<p>&bull; zugleich Hand- und Umh&auml;ngetasche</p>\r\n<p>&bull; L&auml;nge 36 cm / Breite 12 cm / H&ouml;he 24 cm</p>');
