REPLACE INTO `catalog_product_entity_text` VALUES (2437,75,0,233,'<p>Bei der Kollektion Sportivo zeigt sich AVRILLO von der sportlich, eleganten Seite. Dabei stehen Funktionalit&auml;t, klares Design, wie auch die Kombination der Materialien im Vordergrund. Die gro&szlig;e Vordertasche mit feinstem Lachsleder sorgt f&uuml;r unaufdringlichen Luxus und bietet Platz f&uuml;r gro&szlig;e und kleine Utensilien. Auf der R&uuml;ckseite runden die beiden Taschenf&auml;cher, hervorgehoben mit einem Lachslederstreifen, die Staum&ouml;glichkeiten ab. Zudem ist Zina der ideale Begleiter im Businessbereich, da sie Platz f&uuml;r ein Tablet bietet. Innen gewinnt sie mit ihrer hervorragenden Aufteilung inklusive einer Rei&szlig;verschlusstasche und der Verwendung eines hellen Stoffes, damit Sie in der Tasche leicht und schnell finden, wonach Sie suchen. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Lachsfarmen in Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind ein Markenzeichen von AVRILLO. Die klassische Form in bicolorer Gestaltung sowie kontrastreiche N&auml;hte unterstreichen die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder.</p>\r\n<p>Details:</p>\r\n<p>&bull; aus Rindsleder und Lachsleder</p>\r\n<p>&bull; tricolore Gestaltung</p>\r\n<p>&bull; eine Au&szlig;entasche mit Magnetverschlu&szlig;</p>\r\n<p>&bull; zwei Au&szlig;enf&auml;cher mit Magnetverschlu&szlig;</p>\r\n<p>&bull; seitlich angebrachte Metallringe f&uuml;r den Schultergurt</p>\r\n<p>&bull; durch Ringkarabiner abnehmbarer und verstellbarer Schultergurt mit ledernem Schulterpolster</p>\r\n<p>&bull; Innenfutter aus Baumwollstoff, Farbmuster kann vom Foto abweichen</p>\r\n<p>&bull; drei Innenf&auml;cher und Rei&szlig;verschlu&szlig;tasche</p>\r\n<p>&bull; Tasche steht auf vier F&uuml;&szlig;en</p>\r\n<p>&bull; zugleich Hand- und Umh&auml;ngetasche</p>\r\n<p>&bull; L&auml;nge 36 cm / Breite 12 cm / H&ouml;he 24 cm</p>');
