REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (47,73,'Bodybutter-Set \"Perfect Evening\"');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (47,74,'1001698');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (47,75,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an. Bodybutter-Set \"Perfect Evening\" Feinste Körperbuttern für die abendliche Intensivpflege. Die Bodybutter \"Snow White\" ohne Duftstoffe ist perfekt geeignet für alle empfindlichen Körperstellen. Midnight Blue mit zartem Lavendelduft beruhigt und entspannt. Nach Belieben am Körper einsetzten, Hände und Füße nicht vergessen. Das Bodybutter-Set \"Perfect Evening\" in der eleganten Verpackung, eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur! Informationen zum Produkt: - 250ml Bodybutter Snow White (body & face) - 250ml Bodybutter Midnight Blue (hand & feet) Ein Set aus feinster Bio-Naturkosmetik für den abendlichen Home-Spa');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (47,148,'Coscoon Cosmetics');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (48,73,'Bodybutter-Set \"Pure Luxury\"');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (48,74,'1001697');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (48,75,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an. Bodybutter-Set \"Pure Luxury\" Die Kombination dieser beiden luxuriösen Körperbuttern verwandelt jedes Badezimmer in einen perfekten Home-Spa. Wenige, sorgfältig ausgewählte und hochwertigste Zutaten versorgen die Haut mit natürlicher Feuchtigkeit. Belastende Zusatzstoffe und konventionelle Füllstoffe entfallen. Versorge Deine Haut nur mit dem Besten aus der Natur. Das Bodybutter-Set \"Pure Luxury\" in der eleganten Verpackung, eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur! Informationen zum Produkt: - 250ml Bodybutter Rose Haven - 250ml Bodybutter Vanilla Harmony, Ein Set aus feinster Bio-Naturkosmetik in verwöhnenden Duftnoten.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (48,148,'Coscoon Cosmetics');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (49,73,'Bodybutter-Set \"Try Me\"');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (49,74,'1001699');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (49,75,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an. Bodybutter-Set \"Try Me\" Lass Dich verwöhnen von drei ausgesuchten Duftvarianten der feinen Naturkosmetik von Coscoon. Entdecke eine Bodybutter ohne Füll- und Mineralstoffe, frisch gerührt und einzig aus wertvollen Zutaten der Natur kreiert. Teste und entscheide Dich für Deinen Lieblingsduft! Das Bodybutter-Set \"Try Me\" in der schönen Verpackung, eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur! Informationen zum Produkt: Probier-Set mit 3 verschiedenen Duftvarianten der Bodybutter - Midnight Blue - Rose Haven - Vanilla Harmony');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (49,148,'Coscoon Cosmetics');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (50,73,'DIY-Event-Box KIDS');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (50,74,'1001696');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (50,75,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an. Die DIY-Event Box KIDS ist ein absolutes Highlight für die nächste Kinderparty. Ihr produziert nach Anleitung 4 Kits für einen bunten DIY-Nachmittag für 4-8 Kinder, mit eigener Lippenpflege und BadeTörtchen. Ihr erlebt, wie aus einzelnen Bestandteilen ein tolles Produkt entsteht. Das macht großen Spaß, vermittelt Wissen und gibt ein starkes Gefühl für eigene Kompetenzen. Für Kinder ab 10 Jahren geeignet. Die DIY-Event Box KIDS in der schönen Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur! Informationen zum Produkt: - 2 x LipBalm Vanilla Kiss - 2 x BadeTörtchen True Lavender. Im Ergebnis entstehen 8 LipBalme und 12 BadeTörtchen');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (50,148,'Coscoon Cosmetics');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (51,73,'DIY-Event-Box WOMEN');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (51,74,'1001695');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (51,75,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an. Die DIY-Event Box WOMEN Die perfekte Eventbox für Deinen außergewöhnlichen Mädels-Nachmittag enthält 4 Kits für 2 bis 4 Frauen. Macht es Euch gemütlich und zaubert gemeinsam frische Naturkosmetik. Kinderleicht und mit viel Liebe entstehen traumhafte Pflegeprodukte aus der Natur! Du brauchst nur noch eine Küche und Deine Freundinnen! Also, einfach bestellen und Event planen! Die DIY-Event Box WOMEN in der schönen Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur! Informationen zum Produkt: - SheaSahne Blossom Rose +ONE - SheaSahne Vanilla Bliss +ONE - LipBalm Blossom Rose - BadeTörtchen True Lavender Im Ergebnis entstehen 4 x 120 ml Körperbutter, 4 LipBalme und 6 BadeTörtchen');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (51,148,'Coscoon Cosmetics');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (68,73,'Espresso-Dessert-Set GEBOGEN');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (68,74,'1001825');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (68,75,'Zelebrieren Sie die Genuss-Momente des Tages! Unterbrechen Sie den oft stressigen Alltag für einige Augenblicke und nehmen Sie sich die Zeit für einen guten Espresso aus den gebogenen Tassen und eine süße Kleinigkeit, ein Stück Kuchen, Obst oder Gebäck auf den schlichten, formschönen Dessert-Tellern. Das Espresso-Dessert-Set, bestehend aus 2 Espressotassen und Untertassen, 2 Dessert-Tellern, sowie Zucker- und Wasser-/Milchkännchen, bietet Ihnen den richtigen Rahmen dafür. Für den täglichen Gebrauch geeignet. Hinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (68,93,'weiß');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (68,148,'MANTWILL Porzellanmanufaktur');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (69,73,'Espresso-Set GEBOGEN, 2er Set');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (69,74,'1001824');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (69,75,'Innehalten und genießen. Nehmen Sie sich die Zeit und genießen Sie einen guten Espresso aus den gebogenen Tassen. Das Set eignet sich optimal für die schönen Augenblicke zu zweit oder als besonderes Geschenk. Für den täglichen Gebrauch geeignet. Hinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (69,93,'weiß');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (69,148,'MANTWILL Porzellanmanufaktur');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (70,73,'Holzbrille Albert');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (70,74,'1001884');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (70,75,'Die handgefertigte Holzfassung dieses Modelles besteht aus 100% Sandelholz. Das Gestell und die Bügel sind 5-Schicht verleimt. Das verleiht ihnen hohe Stabilität, wobei sie trotzdem flexibel bleiben. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die grünen Spiegelglas Kunststoffgläser der Sonnenbrille sind polarisiert und aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus. Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (70,148,'Laimer');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (71,73,'Holzbrille Alida');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (71,74,'1001883');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (71,75,'Die handgefertigte Holzfassung dieses Modelles besteht aus Sandelholz und Acetat. Das Gestell und die Bügel sind 5-Schicht verleimt. Das verleiht ihnen hohe Stabilität, wobei sie trotzdem flexibel bleiben. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die klassisch dunklen Kunststoffgläser sind polarisiert und aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus. Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (71,148,'Laimer');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (72,73,'Holzbrille Amalie');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (72,74,'1001877');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (72,75,'Die handgefertigte Holzfassung dieses Modelles besteht aus Nussholz in Kombination mit Acetat. Das Gestell und die Bügel sind 5-Schicht verleimt. Das verleiht ihnen hohe Stabilität, wobei sie trotzdem flexibel bleiben. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die Kunststoffgläser aus orangem Spiegelglas sind polarisiert und aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus. Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
