REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (73,74,'1001879');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (73,75,'Die handgefertigten Bügel dieses Modelles bestehen aus Sandelholz und Acetat. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die Kunststoffgläser aus blauem Spiegelglas sind polarisiert und aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus. Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
