REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (90,74,'1001885');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (90,75,'Italienisches Design trifft auf Südtiroler Lifestyle. Das Modell BLACK EDITION ist unser Topseller und eine richtige Männeruhr. Das Gehäuse und das Uhrenband sind aus einem Stück Sandelholz gearbeitet. Das Zifferblatt, die Krone und die Schließe sind farblich abgestimmt und wirken durch das vornehmlich schwarze Design sehr edel. Der Gehäusekorpus sowie das Armband bestehen aus 100% Sandelholz, die Schließe dagegen aus Edelstahl. Die Zeiger sind speziell beschichtet und leuchten in der Dunkelheit nach. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Die Uhr wird in einer schönen Holzbox geliefert.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (90,148,'Laimer');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (91,73,'Holzuhr Damian');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (91,74,'1001896');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (91,75,'Italienisches Design trifft auf Südtiroler Lifestyle. Der Chronograph DAMIAN ist aus feinstem Sandelholz gefertigt und mit einem silbernen Zifferblatt ausgestattet. Dadurch ist diese Holzuhr alltagstauglich, passt aber auch perfekt zu eleganteren Anlässen. Der Gehäusekorpus und das Armband bestehen aus 100% Sandelholz und sind aus einem Stück Holz gefertigt. Die Schließe dagegen ist aus Edelstahl. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Imprägniert mit Haut-freundlichem Material ist sie auch geeignet für Allergiker. Sie bedarf keiner speziellen Pflege. Die Uhr wird in einer schönen Holzbox geliefert.');
