REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (131,75,'Italienisches Design trifft auf Südtiroler Lifestyle. Das Modell ROBERTO wird aus Zebranoholz gefertigt, wobei der Gehäusekorpus aus Edelstahl ist. Dieses Zusammenspiel macht die Holzuhr zu einem perfekten Begleiter für jeden Anlass. Besonders nützlich ist außerdem die Anzeige des Wochentages und des Datums. Das Armband und das Zifferblatt bestehen aus 100% Zebranoholz. Die Schließe und der Gehäusekorpus dagegen sind aus Edelstahl. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Die Uhr wird in einer schönen Holzbox geliefert. Automatikwerk. German Design Award Winner 2018.');
