REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (133,75,'Italienisches Design trifft auf Südtiroler Lifestyle. Das Armband und das Zifferblatt bestehen aus Sandelholz. Die Schließe und das Gehäuse sind aus Edelstahl. Das Edelstahl-Gehäuse mit dem Echtholz Zifferblatt und der Datumsanzeige stehen für einen minimalistischen Style. Diese Uhr ist das i-Tüpfelchen eines jeden Outfits und mit seinen 40 mm Durchmesser sowohl für Ihn als auch für Sie geeignet. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Imprägniert mit hautfreundlichem Material ist sie auch geeignet für Allergiker. Sie bedarf keiner speziellen Pflege. Die Uhr wird in einer schönen Holzbox geliefert.');
