REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (135,73,'Milch-/Zucker/Keks-Set RUND, schwarz');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (135,74,'1001829');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (135,75,'Die kleinen Geschmacksverstärker für den optimalen Kaffeegenuss! Verfeinern Sie Ihren Kaffee mit etwas Milch und Zucker und gönnen Sie sich noch eine leckere Kleinigkeit dazu. Das formschöne, schlicht gehaltene Set, bestehend aus einem Milchkännchen, einer Zuckerdose und einer Schale für Kekse, ist aus schwarzem Porzellan gefertigt, innen glasiert und außen bisquit. Es lässt sich jedoch auch problemlos umfunktionieren! Reichen Sie ein schönes Öl und Salz aus Kännchen und Dose und feine Gewürze aus der Schale zu einer Hauptspeise oder zu etwas Brot, Suppe als Vorspeise. Für den täglichen Gebrauch geeignet. Hinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.');
