REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (184,75,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an. Das SheaSahne DIY-Kit Fresh Tangerine +ONE enthält hochwertige Bio-Rohstoffe in bester Qualität und in der exakt benötigten Menge. Einfach bestellen und sofort losrühren! Aus reiner Sheabutter und mildem Aprikosen Kernöl zaubern Sie eine ergiebige und leichte Körperbutter. Die hochwertige Sheabutter spendet Feuchtigkeit und glättet Ihre Haut, während der Duft nach Zitrusfrüchten Körper und Sinne erfrischt. Enjoy yourself! Das SheaSahne DIY-Kit Fresh Tangerine +ONE in der eleganten Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur! Informationen zum Produkt: - Inhalt: Bio-Sheabutter, Bio-Sonnenblumenöl, Bio-Maisstärke, natürliches Vitamin E, ätherisches Öl Mandarine (kba), Bergamotte (kba) & Lemongrass (kba), Spatel, Rezeptkarte, Tiegel, Etiketten und Geschenkverpackung durch Upcycling - Zubereitungsdauer: 45 Minuten - Schwierigkeitsstufe: mittel - Ergibt: 1 Tiegel mit 120ml - Frei von Mineralölen, Silikonen, Parabenen, ganz ohne Tierversuche und Gentechnik!');
