REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (202,73,'Uhr Babylonian I');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (202,74,'1001936');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (202,75,'Ein Kosmos mit Himmelskörpern und Tierkreiszeichen eröffnet sich auf dem Zifferblatt der Babylonian I. Im Zentrum dieser „Galaxie“ befindet sich, wie bei vielen „Alexander Shorokhoff“-Uhren, ein handgraviertes Uhrwerk, das auf der Vorderseite mit einem speziellen Sonnenschliff versehen ist. Ein Wellenornament – Symbol des Wassers und der Flüsse Euphrat und Tigris - liegt darüber und markiert die Horizontalachse. Die Sonne und der Mond ergänzen das harmonische Bild dieser Konstellation. Um dieser „Galaxie“ noch mehr Bedeutung zukommen zu lassen, wurden Tierkreiszeichen in der Mitte auf einem blauschimmernden Perlmuttring platziert. Der dunkelblaue, um 1,5 mm tiefer liegende Rahmen mit den goldenen Sternen lässt die Zahlen und die silberne Stunden- bzw. Minutenmarkierung besonders hervortreten. Die Zeiger präsentieren sich in tiefem Nachtblau.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (202,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (203,73,'Uhr Babylonian II');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (203,74,'1001937');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (203,75,'Der Erfolg des ersten gleichnamigen Modells, das für den German Design Award 2015 nominiert wurde, hat Alexander Shorokhov motiviert, eine zweite Version ins Leben zu rufen. Die Inspiration dazu entstand durch die Berührung mit der Geschichte der größten und mächtigsten Stadt des Altertums: Babylon. Nicht zufällig wird der Name der Stadt mit „Tor des Gottes“ übersetzt. Der Reichtum der Stadt zog in ihrer Glanzzeit die besten Astronomen, Wissenschaftler, Handwerker und Künstler an und machte sie zu einem hochentwickelten kulturellen Zentrum. Nicht zufällig wurden dort die Sternbilder entdeckt, die Tierkreiszeichen erfunden und die ersten Horoskope erstellt. Diese kulturelle Faszination Babylons wird hier aufgegriffen. Die Platine des Werkes und der äußere Ring des Zifferblattes werden in einem hochkomplizierten Verfahren per Hand filigran ausgearbeitet und dekorativ gestaltet. Zusammen mit dem Stundenring aus dunkelblauem Perlmutt mit aufgedruckten Tierkreiszeichen, den gebläuten Zeigern und der Stundenmarkierung entsteht ein faszinierendes Bild. Auch auf der Rückseite der Uhr kann man sich an den meisterhaften Gravuren erfreuen. Die Babylonian II ist auf nur 300 Stück limitiert.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (203,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (204,73,'Uhr Barbara');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (204,74,'1001930');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (204,75,'Mit der Uhr „Barbara“ erweist Alexander Shorokhov einer der größten zeitgenössischen Jazzmusikerinnen, Barbara Dennerlein, die für ihr Spiel auf der Hammondorgel berühmt wurde, seine Reverenz. „Die avantgardistische Musik von Barbara hat mich in ihren Bann gezogen. Ich habe eine Uhr mit Orgeltasten um einen Notenschlüssel herum kreiert, der auf farbig-lebendigem Hintergrund den Rahmen geradezu sprengt. Das avantgardistische Design entspricht dem Werk dieser einzigartigen Künstlerin“, beschreibt Shorokhov seinen Entwurf bei der Vorstellung der Uhr auf der internationalen Schmuck- und Uhrenausstellung „Baselworld 2015“. Mit einer Limitierung von nur 169 Stück ist das mit dem German Design Award „Special Mention“ prämierte Modell ein echtes Sammlerstück.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (204,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (205,73,'Uhr Chrono Classic');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (205,74,'1001934');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (205,75,'Jetzt gibt es den erfolgreichen Handaufzugs-Chronographen auch in einer Automatikversion. Aufgrund seiner großen Beliebtheit bei den Uhrenfreunden wurden alle weiteren Details einschließlich des Designs beibehalten.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (205,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (206,73,'Uhr Chrono Red');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (206,74,'1001933');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (206,75,'Rot kann auch sehr behutsam und unaufdringlich eingesetzt werden. Mit viel Kreativität und Geschick wird hier ein wirkungsvolles, interessantes Detail hinzugefügt. Ein roter Ring, der in ein sportlich-elegantes Modell, den Chronographen C01-4R der “Avantgarde“-Kollektion, eingebaut wird, bringt noch mehr Eleganz und zeigt, wie diese mächtige Farbe gleichermaßen dezent eingesetzt werden kann. Der passende rote Sekunden- und der kleine Minutenzeiger vervollständigen die Schwarz-Weiß-Rot-Kombination. Die rote und gelbe Naht auf dem Armband ergänzt die avantgardistische Direktheit und unterstützt das starke, dynamische Lebensgefühl, dass die Uhr vermittelt.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (206,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (207,73,'Uhr Equa');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (207,74,'1001935');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (207,75,'„La Mitad del Mundo“ ist ein Äquatormonument in San Antonio de Pichincha in Ecuador. Das Monument liegt ca. 23 Kilometer nördlich der Hauptstadt Quito und markiert den Ort, an dem Charles Marie de La Condamine mit einer französischen Expedition 1736 als erster Europäer die genaue Position des Äquators bestimmte. Die Tag- und Nachtgleiche am Äquator, Zeichen für den Beginn von Frühling und Herbst, wird künstlerisch interpretiert in zwei Halbringen auf dem Zifferblatt, die für jeweils zwölf Stunden stehen. Ins Auge fallen ein leuchtendes Orange des oberen Ringes, das Hitze und Glut symbolisiert, und das warme Blau des unteren Ringes, das auf die lauen Äquatornächte anspielt. Beide umschließen - wie der Äquator - den Ozean, der im Zifferblatt mit schimmerndem hellem und dunklem Perlmutt angedeutet ist.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (207,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (208,73,'Uhr Lady Classic');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (208,74,'1001931');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (208,75,'Ein Fall für zwei, weil das sportlich elegante Design und die geschickt gewählte Gehäusegröße von 39 mm von Männern und Frauen gleichermaßen getragen werden kann. Wie auch immer, mit der LA01 von Alexander Shorokhoff ist man in jedem Fall perfekt ausgestattet.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (208,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (209,73,'Uhr Sixtythree');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (209,74,'1001938');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (209,75,'Eine einzigartige edle Uhr im vintage design. Das Modell „Sixtythree” hat das Uhrendesign, dank dem zylindrischen Saphirglas, den flachen Vorbildern der 60er Jahre angepasst. Die Uhren wiesen mit ihrer flachen Form und dem zylindrischen Glas ein für die damalige Zeit sehr populäres Design auf. Das Ziel heute besteht darin, die alte Vintage-Tradition im neuen „Alexander Shorokhoff“- Stil zu gestalten und erfolgreich weiterzuführen. Das Edelstahlgehäuse besitzt ein in der Herstellung sehr aufwändiges zylindrisches Saphirglas und einen Saphirglasboden und hat eine Wasserdichte von 5 atm. Wie auch die Modelle aus den 60ern, sind die neuen „63-Modelle“ mit gewölbten dunkelblauen, smaragdgrünen, bordeaux-farbenen und schwarzen Zifferblättern ausgestattet. Die rotvergoldeten Zifferblatt-Indexe 20,40 und 60 werden in einem komplizierten Verfahren, das den gewölbten Teil des Zifferblattes ausgleicht, hergestellt. Damit bekommt die Uhr ein edles Erscheinungsbild. Das großflächige Zifferblatt vermittelt das Gefühl, dass die Uhr viel größer ist als in Wirklichkeit. Das hat einen weiteren Vorteil: Sie kann sowohl von Damen, als auch von Herren gleichermaßen getragen werden. Der Rotor des Schweizer Werks 2892.AS wurde im speziellen “Alexander Shorokhoff”-Stil graviert und veredelt.');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (209,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (210,73,'Uhr Sixtythree');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (210,74,'1001939');
REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (210,75,'Eine einzigartige edle Uhr im vintage design. Das Modell „Sixtythree” hat das Uhrendesign, dank dem zylindrischen Saphirglas, den flachen Vorbildern der 60er Jahre angepasst. Die Uhren wiesen mit ihrer flachen Form und dem zylindrischen Glas ein für die damalige Zeit sehr populäres Design auf. Das Ziel heute besteht darin, die alte Vintage-Tradition im neuen „Alexander Shorokhoff“- Stil zu gestalten und erfolgreich weiterzuführen. Das Edelstahlgehäuse besitzt ein in der Herstellung sehr aufwändiges zylindrisches Saphirglas und einen Saphirglasboden und hat eine Wasserdichte von 5 atm. Wie auch die Modelle aus den 60ern, sind die neuen „63-Modelle“ mit gewölbten dunkelblauen, smaragdgrünen, bordeaux-farbenen und schwarzen Zifferblättern ausgestattet. Die rotvergoldeten Zifferblatt-Indexe 20,40 und 60 werden in einem komplizierten Verfahren, das den gewölbten Teil des Zifferblattes ausgleicht, hergestellt. Damit bekommt die Uhr ein edles Erscheinungsbild. Das großflächige Zifferblatt vermittelt das Gefühl, dass die Uhr viel größer ist als in Wirklichkeit. Das hat einen weiteren Vorteil: Sie kann sowohl von Damen, als auch von Herren gleichermaßen getragen werden. Der Rotor des Schweizer Werks 2892.AS wurde im speziellen “Alexander Shorokhoff”-Stil graviert und veredelt.');
