REPLACE INTO `catalogsearch_fulltext_scope1` VALUES (224,75,'Der AVRILLO Shopper ist der ideale Begleiter, ob f&uuml;r einen Stadtbummel oder f&uuml;rs B&uuml;ro. Klares Design und ein interessanter Materialmix stehen hier im Vordergrund. Erlesene Lachsleder sorgen f&uuml;r besondere optische Akzente. Innen bietet eine Rei&szlig;verschlusstasche Platz f&uuml;r ein Mobiltelefon, Schl&uuml;ssel und Lippenstift. Zudem bringt die Tasche einen breiten DIN A 4 Ordner m&uuml;helos unter und kann auch sonst Vieles einstecken. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Lachsfarmen in Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Markant sind die bicolore Gestaltung sowie die kontrastreichen N&auml;hte. Dabei steht die geschmackvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt. Details: &bull; aus Rindsleder und Lachsleder &bull; bicolore Gestaltung &bull; Tasche mit Magnetverschlu&szlig; &bull; verstellbarer Schultergurt mit ledernem Schulterpolster &bull; Rei&szlig;verschlussinnentasche aus Baumwollstoff, Farbmuster kann vom Foto abweichen &bull; Umh&auml;ngetasche &bull; L&auml;nge 32 cm / Breite 8 cm / H&ouml;he 36 cm');
