REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (50,75,'Die bewusste Entscheidung, nur noch wenige ausgesuchte Zutaten in hoher Qualität auf die Haut zu lassen, treffen immer mehr Menschen. Der Trend zu selbstgemachter Kosmetik hält an. Die DIY-Event Box KIDS ist ein absolutes Highlight für die nächste Kinderparty. Ihr produziert nach Anleitung 4 Kits für einen bunten DIY-Nachmittag für 4-8 Kinder, mit eigener Lippenpflege und BadeTörtchen. Ihr erlebt, wie aus einzelnen Bestandteilen ein tolles Produkt entsteht. Das macht großen Spaß, vermittelt Wissen und gibt ein starkes Gefühl für eigene Kompetenzen. Für Kinder ab 10 Jahren geeignet. Die DIY-Event Box KIDS in der schönen Verpackung eignet sich wunderbar als selbstgemachtes Geschenk. Schenken Sie Ihren Liebsten pure Pflege aus der Natur! Informationen zum Produkt: - 2 x LipBalm Vanilla Kiss - 2 x BadeTörtchen True Lavender. Im Ergebnis entstehen 8 LipBalme und 12 BadeTörtchen');
