REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (89,75,'Die handgefertigte Holzfassung dieses Modelles besteht aus 100% Sandelholz. Das Gestell und die Bügel sind 5-Schicht verleimt. Das verleiht ihnen hohe Stabilität, wobei sie trotzdem flexibel bleiben. Durch ihr geringes Gewicht ermöglicht sie einen hohen Tragekomfort. Die klassischen, dunklen Kunststoffgläser sind polarisiert, aus der UV Schutz Kategorie 3, bieten somit 400% UV Schutz und geben der Sonnenbrille in Wayfarer Form schlichte Eleganz bei lässigem Design mit auf ihren Weg. Alle LAiMER Holzbrillen sind imprägniert und halten Spritzwasser und Schweiß aus. Außerdem sind sie in Einheitsgrößen erhältlich und sowohl für Männer als auch für Frauen gleichermaßen geeignet. Die anpassungsfähigen Flex-Scharniere ermöglichen eine optimale Passform und garantieren einen perfekten Sitz.');
