REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (134,75,'Italienisches Design trifft auf Südtiroler Lifestyle. Das Edelstahl Gehäuse hat ein Echtholz Zifferblatt und eine raffinierte Datumsanzeige. Diese Uhr wurde designt für Damen und Herren die klare und schlichte Linien zu schätzen wissen. Das Armband und das Zifferblatt bestehen aus Zebranoholz. Die Schließe und das Gehäuse sind aus Edelstahl. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Imprägniert mit hautfreundlichem Material ist sie auch geeignet für Allergiker. Sie bedarf keiner speziellen Pflege. Die Uhr wird in einer schönen Holzbox geliefert.');
