REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (187,73,'Tee-Set / Dip-Set, schwarz');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (187,74,'1001830');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (187,75,'Bereiten Sie sich und Ihren Lieben einen frischen Tee in der richtigen Temperierung und mit der nötigen Sorgfalt zu. Die Teetassen aus schwarzem Porzellan sind innen glasiert und außen bisquit. Material, Farbe und die harmonische Form eignen sich optimal für den perfekten Teegenuss! Das Set besteht aus 4 Tassen und einem Teller, der als Tablett und auch als Teller für Gebäck oder andere Kleinigkeiten verwendet werden kann. Außerdem können die Tassen/Behältnisse vielseitig verwendet werden, bspw. zum Befüllen mit Dips, einem Süppchen, kleinen Vorspeisen oder auch als Trinkbecher. Für den täglichen Gebrauch geeignet. Hinweis: Jedes einzelne Stück wird mit hohem Qualitätsbewusstsein von Hand gefertigt. Im Gegensatz zu maschinell gefertigtem Porzellan kann es zu Abweichungen in Form, Größe und Gewicht kommen; auch vereinzelte kleine Lufteinschlüsse oder Unebenheiten sind möglich. Die Produkte sind besonders und individuell aufgrund ihrer Form und dem Material, vor allem aber, weil sie von Hand hergestellt werden. Denken Sie bitte vor dem Kauf darüber nach.');
