REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (188,73,'Uhr Praeludium Automatic Ivory');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (188,74,'1001862');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (188,75,'Die Staudt Praeludium Automatic ist eine mechanische Uhr, die Ihnen das Datum und die Uhrzeit in Stunden, Minuten und Sekunden anzeigt. Das Uhrengehäuse hat einen Durchmesser von 42,5 mm und ist aus Edelstahl gefertigt. Die Uhr ist bis zu drei Bar wasserdicht und ein gewölbtes Saphirglas mit doppelter Antireflexbeschichtung sorgt für eine glasklare Sicht auf das charakteristische zweifarbige Zifferblatt. Die eleganten, blattförmigen Zeiger sind aus hochwertigem Stahl gefertigt und von Hand poliert. Das Automatikwerk hat eine Gangreserve von 42 Stunden und ist durch den Gehäuseboden geschützt. Das handgefertigte Alligatorenlederarmband mit Faltschließe sorgt dafür, dass sich die Uhr elegant um Ihr Handgelenk legt. Insgesamt enthält das Werk 25 Steine. Der Rotor hat eine runde und gestreifte Oberfläche und ist mit 18 Karat Roségold beschichtet.');
