REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (191,75,'Die Praeludium Guilloche ist eine mechanische Uhr, die die Zeit in Stunden, Minuten und Sekunden anzeigt. Das Gehäuse hat einen Durchmesser von 42,5 mm und ist aus 18 Karat Rotgold gefertigt. Die Uhr ist bis zu drei Bar wasserdicht und ein gewölbtes Saphirglas mit doppelter Entspiegelung sorgt für eine glasklare Sicht. Die eleganten, blattförmigen Zeiger sind aus hochwertigem Stahl gefertigt. Das Handaufzugswerk hat eine Gangreserve von 50 Stunden und ist durch einen Glasboden aus doppelt entspiegeltem Saphirglas sichtbar. Das handgefertigte Alligatorenlederarmband mit Faltschließe sorgt dafür, dass sich die Uhr elegant um Ihr Handgelenk legt. Das Werk enthält 19 Rubine, von denen vier in Chaton de Rubis montiert sind. Um die Regulierung des Uhrwerks zu optimieren, wurde eine Schwanenhals-Feineinstellung eingebaut. Alle Brücken und die Platte sind mit 18 Karat Rotgold beschichtet.');
