REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (194,75,'Die Praeludium Handaufzug ist eine mechanische Uhr, die Ihnen die Zeit in Stunden, Minuten und Sekunden anzeigt. Das Uhrengehäuse hat einen Durchmesser von 42,5 mm und ist aus 18 Karat Roségold gefertigt. Die Uhr ist bis zu drei Bar wasserdicht und ein gewölbtes Saphirglas mit doppelter Antireflexbeschichtung sorgt für eine glasklare Sicht auf das charakteristische zweifarbige Zifferblatt. Die eleganten, blattförmigen Zeiger sind aus hochwertigem Stahl gefertigt und von Hand poliert. Das Handaufzugswerk hat eine Gangreserve von 42 Stunden und ist durch einen Glasboden aus Saphirglas mit doppelter Antireflexbeschichtung sichtbar. Das handgefertigte Alligatorlederarmband mit Doppelfaltschließe sorgt für einen eleganten Sitz der Uhr am Handgelenk. Das Praeludium Handaufzug hat ein Schweizer mechanisches Uhrwerk, das selbst entwickelt wurde und von Hand aufgezogen werden muss. Es basiert auf einem jahrhundertealten Uhrwerk, das vielfach in Taschenuhren verwendet wurde. Die charakteristische 3/4-Brücke hat eine extrem hochwertige Oberfläche mit einer kreisrunden Cote de Geneve-Streifenoptik und einer Mischung aus gebläuten und polierten Schrauben. Das Werk enthält 19 Rubine. Um die Regulierung des Uhrwerks zu optimieren, wurde eine Schwanenhals-Feinregulierung eingebaut. Die Hemmung ist in Perlage ausgeführt. Alle Brücken und die Hauptplatte sind mit 18 Karat Roségold beschichtet.');
