REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (211,73,'Uhr Winter');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (211,74,'1001932');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (211,75,'Die Menschen erleben die Folgen der Klimaveränderung - globale Erwärmung. Mehr und mehr vermisst man in Europa einen richtigen Winter mit viel Schnee und Frost. Alexander Shorokhov macht mit seiner Uhr „Winter“ aufmerksam auf diese unverzichtbare Jahreszeit und bricht mit traditioneller Uhrengestaltung. Das ganze Zifferblatt zeigt verwachsene Äste eines Baumes, die von einer glitzernden Schneedecke aus Diamanten, welche in einem innovativen Verfahren aufgetragen werden, bedeckt sind. Auch hier gehen wir sorgsam mit der Natur um und verwenden nur abgeschliffene Steine des Diamanten. Am Ende entsteht eine zarte, feminine Uhr, die mit ihrem außergewöhnlichen und innovativen Design überzeugt und fasziniert. Ein Stück Winter am Handgelenk, ausgezeichnet von der international besetzten Expertenjury des German Design Award, mit dem German Design Award „Special Mention“ 2017.');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (211,148,'Alexander Shorokhoff');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (212,73,'Tasche Beltissimo Creme');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (212,74,'1001940');
REPLACE INTO `catalogsearch_fulltext_scope2` VALUES (212,75,'AVRILLO Beltissimo ist eine wahre Verwandlungsk&uuml;nstlerin. Ob als klassische Abendhandtasche (Clutch), als Schultertasche mit einer schicken silberfarbenen Metallkette oder als G&uuml;rteltasche getragen, ist Beltissimo eine zugleich praktisch und sch&ouml;ne Begleiterin. Beltissimo ist so flexibel wie Sie Ihre Tasche brauchen. Angenehm weich in der Haptik hat sie z.B. Platz f&uuml;r ein Mobiltelefon, eine Geldb&ouml;rse, Lippenstift und Schl&uuml;ssel. Also das Wichtigste, was Frau dabei haben m&ouml;chte. Innen kann zudem die Rei&szlig;verschlusstasche Einiges wegstecken, z.B. die Metallkette, wenn diese nicht ben&ouml;tigt wird. Ton in Ton gehalten aus hochwertigem Rindsleder und erlesenem Lachsleder ist sie aufgrund ihrer puren Form zu vielen Outfits gut kombinierbar. Egal ob in der Freizeit, im Urlaub oder im Alltag getragen haben Sie mit der Beltissimo Tasche aus dem Hause AVRILLO eine variable Begleiterin gefunden. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren H&auml;ute von Zuchtlachsen aus Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der klassischen Form steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt. Details: &bull; aus Rindsleder und Lachsleder &bull; Ton in Ton Gestaltung &bull; r&uuml;ckseitige Lederschlaufe f&uuml;r den G&uuml;rtel &bull; durch Ringkarabiner abnehmbare silberfarbene Metallkette (120 cm L&auml;nge) &bull; Rei&szlig;verschlussinnentasche 10 x 8 cm &bull; Magnetverschluss &bull; Clutch, Schultertasche, G&uuml;rtel- / Bauchtasche &bull; L&auml;nge 17 cm / Breite 3 cm / H&ouml;he 11 cm');
