REPLACE INTO `catalogsearch_fulltext_scope3` VALUES (92,75,'Italienisches Design trifft auf Südtiroler Lifestyle. Der Gehäusekorpus sowie das Armband bestehen aus 100% Apfelholz und sind aus einem Stück Holz gefertigt. Die Bäume aus dem EDDI gefertigt wird haben unzählige Äpfel hervor gebracht und wurden nach Jahren ausgemustert. Wir schenken ihnen ein zweites Leben. Der Edelstahldeckel auf der Rückseite macht sie besonders stabil. Das Armband ist im Casual Design gehalten unterstreicht die maskuline Eleganz. Die Schließe dagegen ist aus Edelstahl. Das harte Mineralglas schützt die Uhr vor Beschädigung. Außerdem ist sie Spritzwasserfest, daher für Sport geeignet; sollte jedoch beim Schwimmen, Tauchen, Duschen und Hände waschen abgenommen werden. Durch die Möglichkeit die einzelnen Kettenglieder zu entnehmen ist die Größe verstellbar und daher geeignet für jedes Handgelenk. Die Uhr wird in einer schönen Holzbox geliefert.');
