REPLACE INTO `catalogsearch_fulltext_scope3` VALUES (217,75,'Die AVRILLO Domino Klassik Tasche ist ein komfortabler Begleiter durch den Tag sowie auch die Abendstunden. Auf hochwertig schwarzem Rindsleder kommt das erlesene Lachsleder optisch besonders zur Geltung. Durch seine typische Struktur verschafft es der Tasche einen Unikatscharakter. In ihrer zeitlos, klaren Form wird die Handtasche auf der Rückseite durch zwei, von einem Lachslederstreifen abgehobene, Fächer für persönliche Dinge ergänzt. Die Innentasche glänzt mit ihrer funktionalen Aufteilung: Zwei Fächer für Mobiltelefon, Schlüssel und Lippenstift, inklusive einer Reißverschlusstasche. Daneben bietet sie ausreichend Platz für die Geldbörse, einer 0,5 l Trinkflasche und weiteren Utensilien. Somit ist sie ideal für Ausflüge, Stadtbummel und mehr geeignet und macht sowohl als Handtasche als auch Umhängetasche eine gute Figur. AVRILLO vereint Luxus und Nachhaltigkeit. Feinste Lachsleder, deren Häute von Zuchtlachsen aus Lachsfarmen in Irland und Schottland stammen, in Deutschland zu Leder gegerbt werden, sind eines der Merkmale von AVRILLO. Neben der klassischen Form in bicolorer Gestaltung sorgen die Nähte für einen tollen Kontrast. Dabei steht die stilvolle Verbindung aus edlem Lachsleder und hochwertigem Rindsleder im Mittelpunkt. Details: • aus Rindsleder und Lachsleder • bicolore Gestaltung • zwei Außenfächer • seitlich angebrachte Metallringe für den Schultergurt • durch Ringkarabiner abnehmbarer und verstellbarer Schultergurt mit ledernem Schulterpolster • Innenfutter aus Baumwollstoff, Farbmuster kann von der Abbildung abweichen • zwei Innenfächer und Reißverschlußtasche • zugleich Hand- und Umhängetasche • Länge 24 cm / Breite 6 cm / Höhe 20 cm');
