REPLACE INTO `cms_block` VALUES (6,'block_5_2_layout_1','block_5_2_layout_1','<div class=\"custom-item-23\">\r\n<div class=\"title-static-block\">Welcome to MAGETIQUE, timeless modern furniture and decor.</div>\r\n<ul class=\"row\">\r\n<li class=\"col-sm-6\">\r\n<div class=\"custom-content\">\r\n<p>Magetique embraces all of our design and technical knowledge, which translates into the most advanced Magento 2 experience. It includes a myriad of marketing, design and administration tools. No other theme on the market offers this much functionality right off the bat - you\'re getting over 20 extensions that facilitate your business needs. From simple upsell modules, like Smart Product Labels and Featured Products, to advanced design functions, like Parallax &amp; Background Video.</p>\r\nSit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</div>\r\n</li>\r\n<li class=\"col-sm-6\">\r\n<div class=\"custom-content\">Easily edit pages, page blocks and various on-screen elements to provide a tailored shopping experience for your clients. You don\'t need any CSS knowledge or programming skills to do that. You get all of this eCommerce goodness for free. The package includes 5 layouts that were carefully crafted to fit a variety of niches. They are easily installed and managed with an intuitive interface and detailed documentation.</div>\r\n</li>\r\n</ul>\r\n</div>','2018-04-27 07:14:15','2018-04-27 07:25:07',1);
