REPLACE INTO `cms_page` VALUES (3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\n<ul>\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\n</ul>\n</div>','2018-04-26 09:40:21','2018-04-27 06:20:44',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
REPLACE INTO `cms_page` VALUES (4,'Datenschutzerklärung','1column','','','privacy-policy-cookie-restriction-mode','Datenschutzerklärung','<div class=\"gmt-cms-page\">\r\n<h2>Geltungsbereich</h2>\r\n<p>Das GERMANTOM-Team freut sich &uuml;ber Ihr Interesse an unserer Website. GERMANTOM respektiert die Privatsph&auml;re jeder Person, die unseren Internetauftritt besucht. Nachstehend informiert GERMANTOM Sie gem&auml;&szlig; Bundesdatenschutzgesetz und Telemediengesetz &uuml;ber die Art, den Umfang und den Zweck der Erhebung und Verwendung personenbezogener Daten durch die GERMANTOM International GmbH. Nach Ma&szlig;gabe dieser Datenschutzbestimmungen k&ouml;nnen Sie insgesamt oder f&uuml;r einzelne Ma&szlig;nahmen widersprechen. Senden Sie Ihren Widerspruch per E-Mail, Fax oder Brief an folgende Kontaktdaten: GERMANTOM International GmbH, Stolzenbergstr. 13, D-76532 Baden-Baden Telefax: +49 (0) 7221 9 20 40-10 oder per Mail an: <a href=\"mailto:support@germantom.com\">support@germantom.com</a> Dar&uuml;ber hinaus k&ouml;nnen Sie nat&uuml;rlich auch jederzeit unentgeltlich Auskunft &uuml;ber die bei uns gespeicherten Daten erhalten.</p>\r\n<p>Bedenken Sie, dass die Daten&uuml;bertragung im Internet grunds&auml;tzlich mit Sicherheitsl&uuml;cken verbunden sein kann. Ein vollumf&auml;nglicher Schutz vor dem Zugriff durch Fremde kann nicht gew&auml;hrleistet werden.</p>\r\n<h2>Zugriffsdaten</h2>\r\n<p>Wir erheben nur die Daten f&uuml;r eine personenbezogene Verarbeitung und Nutzung, wenn Sie sich freiwillig f&uuml;r die Eingabe der Daten entscheiden oder ausdr&uuml;cklich Ihr Einverst&auml;ndnis erkl&auml;ren und speichren diese als &bdquo;Server-Logfiles&ldquo; ab. Folgende Daten werden so protokolliert:</p>\r\n<ul>\r\n<li>Besuchte Website</li>\r\n<li>Uhrzeit zum Zeitpunkt des Zugriffes</li>\r\n<li>Menge der gesendeten Daten in Byte</li>\r\n<li>Quelle/Verweis, von welchem Sie auf die Seite gelangten</li>\r\n<li>Verwendeter Browser</li>\r\n<li>Verwendetes Betriebssystem</li>\r\n<li>Verwendete IP-Adresse</li>\r\n</ul>\r\n<p>Die erhobenen Daten dienen lediglich statistischen Auswertungen und zur Verbesserung der Website. Der Websitebetreiber beh&auml;lt sich allerdings vor, die Server-Logfiles nachtr&auml;glich zu &uuml;berpr&uuml;fen, sollten konkrete Anhaltspunkte auf eine rechtswidrige Nutzung hinweisen.</p>\r\n<p>Diese Daten k&ouml;nnen unter Umst&auml;nden R&uuml;ckschl&uuml;sse &uuml;ber einen bestimmten Besucher der Website zulassen. Personenbezogene Daten werden in diesem Zusammenhang jedoch nicht verwertet. Die Nutzung solcher Daten erfolgt ausschlie&szlig;lich anonym.</p>\r\n<p>Gibt GERMANTOM International GmbH Daten an externe Dienstleister weiter, so werden technische und organisatorische Ma&szlig;nahmen ergriffen, die gew&auml;hrleisten, dass die Weitergabe im Einklang mit den gesetzlichen Bestimmungen des Datenschutzes erfolgt. Vertragspartner werden vertraglich verpflichtet, diese Informationen geheim zu halten und d&uuml;rfen diese nicht zweckentfremdet verwenden.</p>\r\n<h2>Kundenkonto</h2>\r\n<p>Wir richten f&uuml;r jeden Kunden, der sich entsprechend registriert, einen passwortgesch&uuml;tzten direkten Zugang zu seinen bei uns gespeicherten Bestandsdaten (Kundenkonto) ein. Hier k&ouml;nnen Sie Daten &uuml;ber Ihre abgeschlossenen, offenen und k&uuml;rzlich versandten Bestellungen einsehen und Ihre Daten und den Newsletter verwalten. Sie verpflichten sich, die pers&ouml;nlichen Zugangsdaten vertraulich zu behandeln und keinem unbefugten Dritten zug&auml;nglich zu machen. Wir k&ouml;nnen keine Haftung f&uuml;r missbr&auml;uchlich verwendete Passw&ouml;rter &uuml;bernehmen, es sei denn, wir h&auml;tten den Missbrauch zu vertreten. Sofern Sie sich nicht abmelden, bleiben Sie automatisch eingeloggt. Diese Funktion erm&ouml;glicht Ihnen die Nutzung eines Teils unserer Dienste, ohne sich jedes Mal erneut einloggen zu m&uuml;ssen. Aus Sicherheitsgr&uuml;nden werden Sie jedoch nochmals zur Eingabe Ihres Passworts aufgefordert, wenn beispielsweise Ihre pers&ouml;nlichen Daten ge&auml;ndert werden sollen oder Sie eine Bestellung aufgeben m&ouml;chten.</p>\r\n<h2>Umgang mit personenbezogenen Daten</h2>\r\n<p>GERMANTOM erhebt, nutzt und gibt Ihre personenbezogenen Daten nur dann weiter, wenn dies im gesetzlichen Rahmen erlaubt ist oder Sie in die Datenerhebung einwilligen.</p>\r\n<p>Als personenbezogene Daten gelten s&auml;mtliche Informationen, welche dazu dienen, Ihre Person zu bestimmen und welche zu Ihnen zur&uuml;ckverfolgt werden k&ouml;nnen. Hierzu z&auml;hlen also beispielsweise Ihr Name, Ihre E-Mail-Adresse und Telefonnummer.</p>\r\n<h2>Personenbezogene Daten &uuml;ber Kinder:</h2>\r\n<p>GERMANTOM International GmbH m&ouml;chte keine pers&ouml;nlichen Daten von Personen unter 14 Jahren sammeln. Der Kunde wird &ndash; wenn erforderlich &ndash; an geeigneter Stelle Kinder ausdr&uuml;cklich darauf hinweisen, dass keine weitere Verarbeitung erfolgt.</p>\r\n<p>Sollten Eltern oder andere Erziehungsberechtigte feststellen, dass die von ihnen zu beaufsichtigenden Kinder uns personenbezogene Daten zur Verf&uuml;gung stellen, ersuchen wir sie, sich mit uns unter der nachstehenden Adresse in Verbindung zu setzen, wenn diese Daten gel&ouml;scht werden sollen. Wir werden sodann die L&ouml;schung dieser Informationen unverz&uuml;glich veranlassen.</p>\r\n<p>&Auml;nderungen unserer \"Informationen zum Datenschutz\" werden auf dieser Seite ver&ouml;ffentlicht. Auf diese Weise k&ouml;nnen Sie sich jederzeit dar&uuml;ber informieren, welche Daten wir speichern, wie wir sie sammeln und verwenden.</p>\r\n<dl class=\"custom-page privacy-policy-page\">Umgang mit Kontaktdaten</dl>\r\n<p>Nehmen Sie mit dem Websitebetreiber durch die angebotenen Kontaktm&ouml;glichkeiten Verbindung auf, werden Ihre Angaben gespeichert, damit auf diese zur Bearbeitung und Beantwortung Ihrer Anfrage zur&uuml;ckgegriffen werden kann. Ohne Ihre Einwilligung werden diese Daten nicht an Dritte weitergegeben.</p>\r\n<h2>Weitergabe personenbezogener Daten zur Bestellabwicklung</h2>\r\n<p>Die von uns erhobenen personenbezogenen Daten werden im Rahmen der Vertragsabwicklung an das mit der Lieferung beauftragte Transportunternehmen weitergegeben, soweit dies zur Lieferung der Ware erforderlich ist. Wir geben Ihre Zahlungsdaten im Rahmen der Abwicklung von Zahlungen an das beauftragte Kreditinstitut weiter.</p>\r\n<p>2.2</p>\r\n<p>Bei Zahlung per Kreditkarte via PayPal oder per Lastschrift via PayPal geben wir Ihre Zahlungsdaten im Rahmen der Zahlungsabwicklung an die PayPal (Europe) S.&agrave; r.l. et Cie, S.C.A., 22-24 Boulevard Royal, L-2449 Luxemburg, weiter. N&auml;here Informationen zum Datenschutz der PayPal (Europe) S.&agrave; r.l. et Cie, S.C.A. finden Sie hier: <a href=\"http://www.paypal.de/datenschutz\" target=\"_blank\">www.paypal.de/datenschutz</a></p>\r\n<p>2.3</p>\r\n<p>Wenn Sie sich f&uuml;r eine Zahlung per Kreditkarte via Paymentdienstleisters heidelpay entscheiden, erfolgt die Zahlungsabwicklung &uuml;ber den Paymentdienstleister Heidelberger Payment GmbH, Vangerowstra&szlig;e 18, 69115 Heidelberg, an den wir Ihre im Rahmen des Bestellvorgangs mitgeteilten Informationen nebst den Informationen &uuml;ber Ihre Bestellung weitergeben. Die Weitergabe Ihrer Daten erfolgt ausschlie&szlig;lich zum Zwecke der Zahlungsabwicklung mit dem Paymentdienstleister heidelpay. N&auml;here Informationen zum Datenschutz der heidelpay GmbH finden Sie hier: <a href=\"http://www.heidelpay.com/de/datenschutz/\" target=\"_blank\">www.heidelpay.com/de/datenschutz/</a></p>\r\n<h2>Cookies</h2>\r\n<p>Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu erm&ouml;glichen verwenden wir sog. &ldquo;Cookies&ldquo;. \" Dabei handelt es sich um kleine Textdateien, die von Ihrem Browser tempor&auml;r auf der Festplatte Ihres Computers gespeichert werden.</p>\r\n<p>Grunds&auml;tzlich unterscheidet man 2 verschiedenen Arten von Cookies, sogenannte Session-Cookies, die gel&ouml;scht werden, sobald Sie Ihren Browser schlie&szlig;en und tempor&auml;re/permanente Cookies, die f&uuml;r einen l&auml;ngeren Zeitraum oder unbegrenzt auf Ihrem Datentr&auml;ger gespeichert werden. Diese Speicherung hilft uns, unsere Webseiten und unsere Angebote auf Ihren Bedarf abgestimmt zu gestalten und erleichtert Ihnen die Nutzung, indem beispielsweise bestimmte Eingaben von Ihnen so gespeichert werden, dass Sie sie nicht st&auml;ndig wiederholen m&uuml;ssen.</p>\r\n<p>Die von uns verwendeten &ldquo;Cookies&ldquo; speichern keine personenspezifischen Informationen.</p>\r\n<p>G&auml;ngige Browser bieten die Einstellungsoption, Cookies nicht zuzulassen. Hinweis: Es ist nicht gew&auml;hrleistet, dass Sie auf alle Funktionen dieser Website ohne Einschr&auml;nkungen zugreifen k&ouml;nnen, wenn Sie entsprechende Einstellungen vornehmen.</p>\r\n<h2>Abonnements</h2>\r\n<p>Sie haben die M&ouml;glichkeit, sowohl die gesamte Website als auch Nachfolgekommentare auf Ihren Beitrag zu abonnieren. Sie erhalten eine E-Mail zur Best&auml;tigung Ihrer E-Mail-Adresse. Neben dieser werden keine weiteren Daten erhoben. Die gespeicherten Daten werden nicht an Dritte weitergereicht. Sie k&ouml;nnen ein Abonnement jederzeit abbestellen.</p>\r\n<h2>Google Analytics</h2>\r\n<p>Diese Website nutzt den Dienst &bdquo;Google Analytics&ldquo;, welcher von der Google Inc. (1600 Amphitheatre Parkway Mountain View, CA 94043, USA) angeboten wird, zur Analyse der Websitebenutzung durch Nutzer. Der Dienst verwendet &bdquo;Cookies&ldquo; &ndash; Textdateien, welche auf Ihrem Endger&auml;t gespeichert werden. Die durch die Cookies gesammelten Informationen werden im Regelfall an einen Google-Server in den USA gesandt und dort gespeichert.</p>\r\n<p>Im Falle der Aktivierung der IP-Anonymisierung auf dieser Webseite, wird Ihre IP-Adresse von Google jedoch innerhalb von Mitgliedstaaten der Europ&auml;ischen Union oder in anderen Vertragsstaaten des Abkommens &uuml;ber den Europ&auml;ischen Wirtschaftsraum zuvor gek&uuml;rzt. Nur in Ausnahmef&auml;llen wird die volle IP-Adresse an einen Server von Google in den USA &uuml;bertragen und dort gek&uuml;rzt. Die IP-Anonymisierung ist auf dieser Website aktiv.</p>\r\n<p>Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports &uuml;ber die Websiteaktivit&auml;ten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegen&uuml;ber dem Websitebetreiber zu erbringen</p>\r\n<p>Die im Rahmen von Google Analytics von Ihrem Browser &uuml;bermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengef&uuml;hrt. Sie k&ouml;nnen die Speicherung der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s&auml;mtliche Funktionen dieser Website vollumf&auml;nglich werden nutzen k&ouml;nnen.</p>\r\n<p>Sie k&ouml;nnen dar&uuml;ber hinaus die Erfassung der durch das Cookie erzeugten und auf Ihre Nutzung der Website bezogenen Daten (inkl. Ihrer IP-Adresse) an Google sowie die Verarbeitung dieser Daten durch Google verhindern, indem Sie das unter dem folgenden Link verf&uuml;gbare Browser-Plugin herunterladen und installieren: <a href=\"http://tools.google.com/dlpage/gaoptout?hl=de\" target=\"_blank\">http://tools.google.com/dlpage/gaoptout?hl=de</a> <br />Alternativ zum Browser-Plugin oder innerhalb von Browsern auf mobilen Ger&auml;ten klicken Sie bitte auf den folgenden Link, um ein Opt-Out-Cookie zu setzen, der die Erfassung durch Google Analytics innerhalb dieser Website zuk&uuml;nftig verhindert (dieses Opt-Out-Cookie funktioniert nur in diesem Browser und nur f&uuml;r diese Domain, l&ouml;schen Sie Ihre Cookies in diesem Browser, m&uuml;ssen Sie diesen Link erneut klicken): <a onclick=\"alert(\'Das Tracking durch Google Analytics wurde in Ihrem Browser f&uuml;r diese Website deaktiviert\');\" href=\"javascript:gaOptout()\">Hier klicken, um Google Analytics zu deaktivieren</a>. Es wird darauf hingewiesen, dass diese Website Google Analytics mit der Erweiterung &bdquo;_anonymizeIp()&ldquo; verwendet und daher IP-Adressen nur gek&uuml;rzt weiterverarbeitet werden, um eine direkte Personenbeziehbarkeit auszuschlie&szlig;en.</p>\r\n<p>N&auml;here Informationen zu Nutzungsbedingungen und Datenschutz finden Sie unter<br /> <a href=\"http://www.google.com/analytics/terms/de.html\" target=\"_blank\">http://www.google.com/analytics/terms/de.html</a> bzw. unter<br /> <a href=\"https://www.google.com/analytics/learn/privacy.html\" target=\"_blank\">https://www.google.com/analytics/learn/privacy.html</a> und<br /> <a href=\"https://www.google.de/intl/de/policies/privacy\" target=\"_blank\">https://www.google.de/intl/de/policies/privacy.</a></p>\r\n<h2>Nutzung von Social-Media-Plugins</h2>\r\n<p>Diese Website verwendet Facebook Social Plug-Ins, welches von der Facebook Inc. (1 Hacker Way, Menlo Park, California 94025, USA) betrieben wird. Erkennbar sind die Einbindungen an dem Facebook-Logo bzw. an den Begriffen &bdquo;Like&ldquo;, &bdquo;Gef&auml;llt mir&ldquo;, &bdquo;Teilen&ldquo; in den Farben Facebooks (Blau und Wei&szlig;). Informationen zu allen Facebook-Plug-Ins finden Sie im folgenden Link: <a href=\"https://developers.facebook.com/docs/plugins/\" target=\"_blank\">https://developers.facebook.com/docs/plugins/</a></p>\r\n<p>Das Plug-In stellt eine direkte Verbindung zwischen Ihrem Browser und den Facebook-Servern her. Der Websitebetreiber hat keinerlei Einfluss auf die Natur und den Umfang der Daten, welche das Plug-In an die Server der Facebook Inc. &uuml;bermittelt. Informationen dazu finden Sie hier: <a href=\"https://www.facebook.com/help/186325668085084\" target=\"_blank\">https://www.facebook.com/help/186325668085084</a> Das Plug-In informiert die Facebook Inc. dar&uuml;ber, dass Sie Nutzer diese Website besucht hat. Es besteht hierbei die M&ouml;glichkeit, dass Ihre IP-Adresse gespeichert wird. Sind Sie w&auml;hrend des Besuchs auf dieser Website in Ihrem Facebook-Konto eingeloggt, werden die genannten Informationen mit diesem verkn&uuml;pft.</p>\r\n<p>Nutzen Sie die Funktionen des Plug-Ins &ndash; etwa indem Sie einen Beitrag teilen oder &bdquo;liken&ldquo; &ndash; werden die entsprechenden Informationen ebenfalls an die Facebook Inc. &uuml;bermittelt.</p>\r\n<p>M&ouml;chten Sie verhindern, dass die Facebook. Inc. diese Daten mit Ihrem Facebook-Konto verkn&uuml;pft, loggen Sie sich bitte vor dem Besuch dieser Website bei Facebook aus.</p>\r\n<p>Weiterhin nutzt diese Website die &bdquo;+1&ldquo;-Schaltfl&auml;che von Google Plus. Betrieben wird diese von der Google Inc. (1600 Amphitheatre Parkway Mountain View, CA 94043, USA). Besuchen Sie eine Seite, welche die &bdquo;+1&ldquo;-Schaltfl&auml;che enth&auml;lt, entsteht eine direkte Verbindung zwischen Ihrem Browser und den Google-Servern. Der Websitebetreiber hat daher keinerlei Einfluss auf die Natur und den Umfang der Daten, welche das Plugin an die Server der Google Inc. &uuml;bermitteln. Klicken Sie auf den &bdquo;+1&ldquo;-Button, w&auml;hrend Sie in Google + angemeldet sind, teilen Sie die Inhalte der Seite auf Ihrem &ouml;ffentlichen Profil.</p>\r\n<p>Personenbezogene Daten werden laut der Google Inc. erst dann erhoben, wenn Sie auf die Schaltfl&auml;che klicken. Auch bei eingeloggten Google-Nutzern wird unter anderem die IP-Adresse gespeichert. M&ouml;chten Sie verhindern, dass die Google Inc. diese Daten speichert und mit Ihrem Konto verkn&uuml;pft, loggen Sie sich bitte vor dem Besuch dieser Website aus.</p>\r\n<p>Informationen zur &bdquo;+1&ldquo;-Schaltfl&auml;che finden Sie hier: <a href=\"https://developers.google.com/+/web/buttons-policy\" target=\"_blank\">https://developers.google.com/+/web/buttons-policy</a>.</p>\r\n<p>Weiterhin nutzt diese Website Twitter-Schaltfl&auml;chen. Betrieben werden diese von der Twitter Inc. (795 Folsom St., Suite 600, San Francisco, CA 94107, USA). Besuchen Sie eine Seite, welche eine solche Schaltfl&auml;che enth&auml;lt, entsteht eine direkte Verbindung zwischen Ihrem Browser und den Twitter-Servern. Der Websitebetreiber hat daher keinerlei Einfluss &uuml;ber die Natur und den Umfang der Daten, welche das Plug-In an die Server Twitter Inc. &uuml;bermittelt.</p>\r\n<p>Gem&auml;&szlig; der Twitter Inc. wird dabei allein Ihre IP-Adresse erhoben und gespeichert. Informationen zu dem Umgang mit personenbezogenen Daten durch die Twitter Inc. finden Sie hier: <a href=\"https://twitter.com/privacy?lang=de\" target=\"_blank\">https://twitter.com/privacy?lang=de</a></p>\r\n<h2>Newsletter-Abonnement</h2>\r\n<p>Um unsere Newsletter zu versenden, verwendet GERMANTOM das sogenannte Double Opt-In-Verfahren. Diesem Verfahren gem&auml;&szlig; wird GERMANTOM Ihnen erst einen Newsletter zusenden, wenn Sie zuvor ausdr&uuml;cklich die Erlaubnis zur Aktivierung des Newsletter-Dienstes gegeben haben. Nach Anmeldung zum Newsletter wird Ihnen daher eine Benachrichtigungs-E-Mail zugesendet. GERMANTOM bittet Sie Ihre Anmeldung und den Wunsch des zuk&uuml;nftigen Erhalts des Newsletters durch Anklicken eines in der E-Mail enthaltenen Links zu best&auml;tigen. Der Widerruf dieser Einwilligung und damit die Abmeldung vom Newsletter ist jederzeit m&ouml;glich. Hierf&uuml;r entstehen Ihnen keine &Uuml;bermittlungskosten. Eine Mitteilung in Textform z.B. per E-Mail, Fax oder Brief reicht hierf&uuml;r aus. Selbstverst&auml;ndlich finden Sie auch in jedem Newsletter einen Abmelde-Link.</p>\r\n<h2>Sicherheit der Daten&uuml;bertragung</h2>\r\n<p>Ihre pers&ouml;nlichen Daten werden bei uns sicher durch Verschl&uuml;sselung &uuml;bertragen. Dies gilt f&uuml;r Ihre Bestellung und auch f&uuml;r das Kundenlogin. Wir bedienen uns dabei des Codierungssystems SSL (Secure Socket Layer). Einen absoluten Schutz kann zwar niemand garantieren, allerdings sichert GERMANTOM seine Website und sonstigen Systeme durch technische und organisatorische Ma&szlig;nahmen gegen Verlust, Zerst&ouml;rung, Zugriff, Ver&auml;nderung und Verbreitung Ihrer Daten durch unbefugte Personen.</p>\r\n<h2>Auskunftsrecht</h2>\r\n<p>Nach dem Bundesdatenschutzgesetz haben unsere Kunden u.a. ein Recht auf unentgeltliche Auskunft &uuml;ber ihre gespeicherten Daten, sowie ggf. ein Recht auf Berichtigung, Sperrung oder L&ouml;schung von Daten, sofern Ihr Wunsch nicht mit einer gesetzlichen Pflicht zur Aufbewahrung von Daten (z. B. Vorratsdatenspeicherung) kollidiert. Um sicherzustellen, dass personenbezogene Daten nicht an Dritte herausgegeben werden, richten Sie Ihre schriftliche Anfrage bitte per E-Mail oder per Post unter eindeutiger Identifizierung Ihrer Person an:</p>\r\n<p>GERMANTOM International GmbH <br /> Stolzenbergstr. 13 <br /> D-76532 Baden-Baden <br /> Telefax: +49 (0) 7221 9 20 40-10 <br /> E-Mail: <a href=\"mailto:support@germantom.com\">support@germantom.com</a></p>\r\n</div>','2018-04-26 09:40:21','2018-05-15 12:19:05',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (5,'Customer Service','1column','','','customer-service','Customer Service','<div class=\"customer-service\">\n	<div class=\"text-block customer-service__block\">\n		<h3>Delivery</h3>\n		<h4>Hello and welcome to the shipping and delivery information page! Here you can get acquainted with useful information on terms \nand conditions of our goods delivery</h4>\n		<p>You can purchase your items online and pick them up at our street store, or ship them directly to your doorstep. Shipping is free on some orders. We use the best carriers in the business to make sure your order gets to you on time. From the Secure Checkout page you\'ll see your item description, price and delivery timing. Where available, you can also choose a faster delivery method for each item on your order, for an additional fee. Delivery times vary according to your selected delivery address, availability of your items and the time of day you place your order.</p>\n	</div>\n	<div class=\"table-block  customer-service__block\">\n		<h3>Cost</h3>\n		<div class=\"table-block_wrapper\">\n			<table>\n				<thead>\n					<th>Services</th>\n					<th>Locations</th>\n					<th>Delivery Schedule</th>\n					<th>Cost Per Shipment</th>\n				</thead>\n				<tbody>\n					<tr>\n						<td>Royal mail 1st Class Service (Order value $20 or less)</td>\n						<td>All of UK & some European Countries</td>\n						<td>1-3 days Monday - Saturday</td>\n						<td>$5</td>\n					</tr>\n					<tr>\n						<td>Royal mail Tracker (Order value $50 or less)</td>\n						<td>All of UK</td>\n						<td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\n						<td>$45</td>\n					</tr>\n					<tr>\n						<td>Standard Courier Delivery</td>\n						<td>UK mainland only</td>\n						<td>1-3 days Monday - Saturday</td>\n						<td>$124</td>\n					</tr>\n					<tr>\n						<td>Standard Courier Delivery</td>\n						<td>Northern Ireland, Eire, Scilly Isles</td>\n						<td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\n						<td>$11</td>\n					</tr>\n					<tr>\n						<td>Royal mail 1st Class Service (Order value $20 or less)</td>\n						<td>All of UK & some European Countries</td>\n						<td>1-3 days Monday - Saturday</td>\n						<td>$5</td>\n					</tr>\n					<tr>\n						<td>Priority courier pre 12pm Next Working Day</td>\n						<td>UK mainland only</td>\n						<td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\n						<td>$89</td>\n					</tr>\n					<tr>\n						<td>Royal mail 1st Class Service (Order value $20 or less)</td>\n						<td>All of UK & some European Countries</td>\n						<td>1-3 days Monday - Saturday</td>\n						<td>$72</td>\n					</tr>\n				</tbody>\n			</table>			\n		</div>\n	</div>\n	<div class=\"text-block  customer-service__block\">\n		<h3>Free Delivery</h3>\n		<p>Free two-day shipping is available on in-stock items. You can see in your bag if your item is in stock. Free two-day shipping is not available on customized, engraved products, and for certain order types, including orders paid for with financing or by bank transfer. To get free two-day shipping, you will need to place your order by 5pm, Monday to Friday. For instance, if you order your goods before 5:00 pm, Monday to Friday we will deliver them in two business days.</p>\n	</div>\n	<div class=\"list-block  customer-service__block\">\n		<h3>Terms & Conditions</h3>\n		<ul class=\"row\">\n			<li class=\"col-md-6\">\n				<h4>Entire agreement</h4>\n				<p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Entire agreement</h4>\n				<p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Controlling terms</h4>\n				<p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Controlling terms</h4>\n				<p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Entire agreement</h4>\n				<p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Entire agreement</h4>\n				<p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Controlling terms</h4>\n				<p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Controlling terms</h4>\n				<p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Entire agreement</h4>\n				<p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Entire agreement</h4>\n				<p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Controlling terms</h4>\n				<p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\n			</li>\n			<li class=\"col-md-6\">\n				<h4>Controlling terms</h4>\n				<p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\n			</li>\n		</ul>\n	</div>\n</div>\n\n<script>\nvar headertext = [];\nvar headers = document.querySelectorAll(\".table-block thead\");\nvar tablebody = document.querySelectorAll(\".table-block tbody\");\n\nfor (var i = 0; i < headers.length; i++) {\n	headertext[i]=[];\n	for (var j = 0, headrow; headrow = headers[i].rows[0].cells[j]; j++) {\n	  var current = headrow;\n	  headertext[i].push(current.textContent);\n	  }\n} \n\nfor (var h = 0, tbody; tbody = tablebody[h]; h++) {\n	for (var i = 0, row; row = tbody.rows[i]; i++) {\n	  for (var j = 0, col; col = row.cells[j]; j++) {\n	    col.setAttribute(\"data-th\", headertext[h][j]);\n	  } \n	}\n}\n</script>','2018-04-27 06:20:44','2018-04-27 06:20:44',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (6,'Über uns','1column','','','about-us','Über uns','<h2>GERMANTOM</h2>\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<p>The new player in global E-Commerce &ndash; Unser Team steht f&uuml;r Sie bereit!</p>\r\n<p>Unser Team aus 20 internationalen Mitarbeitern an unserem Standort in Baden-Baden besteht aus erfahrenen Professionals, Studenten und ambitionierten Quereinsteigern. Alle eint die Motivation, eine Erfolgsgeschichte mit diesem jungen Unternehmen zu schreiben und die ehrgeizigen Ziele zu erreichen, die wir uns gesetzt haben. Die verschiedensten Herk&uuml;nfte, Lebens- und Berufserfahrungen sind die idealen Voraussetzungen, um die Bed&uuml;rfnisse unserer Kunden und Lieferanten zu befriedigen.</p>\r\n<p>Gemeinsam bilden wir ein starkes Team, in dem jeder Einzelne seine St&auml;rken einbringt, um die vielf&auml;ltigen und komplexen Anforderungen, die heute an ein Erfolgsunternehmen gestellt werden, zu erf&uuml;llen.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<p>Mit GERMANTOM ist ein neues Modell des E-Commerce geschaffen worden. Anders als die anderen Online-Shops bietet GERMANTOM keine Quantit&auml;t sondern Qualit&auml;t an Produkten.</p>\r\n<p>GERMANTOM ist nicht nur ein weltweit agierender Online -Shop, sondern auch ein Produkt Accelerator, speziell f&uuml;r deutsche und europ&auml;ische Premiumprodukte.</p>\r\n<p>Es soll Spa&szlig; machen, in einer starken Gemeinschaft herausragende Ergebnisse zu erbringen! Dies ist uns wichtig, da wir erkannt haben, dass Spitzenleistungen nur dort entstehen k&ouml;nnen, wo Menschen sich wohlf&uuml;hlen.</p>\r\n</div>\r\n</div>','2018-04-27 06:20:44','2018-05-14 10:49:48',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
