REPLACE INTO `cms_page` VALUES (8,'Versand & Lieferung','1column','','','shipping-delivery','Versand & Lieferung','<div class=\"gmt-cms-page\">\r\n<p>Sofort verf&uuml;gbare Artikel liefern wir innerhalb von nur 3-5 Werktagen (Montag-Samstag) mit dem UPS Paketversand.</p>\r\n<p>Die f&uuml;r Ihren Wunschartikel geltende Lieferzeit zeigen wir Ihnen immer direkt am jeweiligen Artikel an. So sehen Sie auf einen Blick, wann Sie die Lieferung erwarten k&ouml;nnen.</p>\r\n<h2>Bitte beachten Sie:</h2>\r\n<p>Die Lieferung kann sich um einen Werktag verz&ouml;gern, wenn zwischen Bestellung und Lieferung ein Sonn- oder Feiertag liegt.</p>\r\n<p>Wenn Sie bereits Kunde sind, k&ouml;nnen Sie stattdessen als feste Lieferanschrift auch z. B. Ihre Firma oder Verwandte angeben. Alternativ k&ouml;nnen Sie - ganz flexibel - jede Bestellung an eine beliebige Adresse innerhalb Deutschlands liefern lassen.</p>\r\n<p>Sie zahlen pro Bestellung und Lieferanschrift nur eine geringe Versandkostenpauschale.</p>\r\n<h2>Unser Tipp: Einfach an ein UPS Access Point in Ihrer N&auml;he liefern lassen.</h2>\r\n<p>Einer UPS Access Point ist auch bei Ihnen vor Ort - ob in der Nachbarschaft, in der N&auml;he Ihres Arbeitsplatzes oder auf dem Nachhauseweg. <a target=\"_blank\">https://www.ups.com/dropoff</a></p>\r\n<p>Geben Sie einfach im Bestellvorgang unter \"Anschrift &auml;ndern\" die Adresse von gew&uuml;nschtem UPS Access Point.</p>\r\n<h2>Ihre Vorteile:</h2>\r\n<ul class=\"gmt-list-1\">\r\n<li>Pers&ouml;nliche Abholung unter Vorlage Ihres Personalausweises.</li>\r\n<li>Kostenlose Benachrichtigung per E-Mail und/oder SMS, sobald Ihre Bestellung angekommen ist.</li>\r\n<li>Auch eine R&uuml;cksendung k&ouml;nnen Sie einfach abgeben.</li>\r\n</ul>\r\n<p>Den UPS Access Point in Ihrer N&auml;he finden Sie &uuml;ber <a href=\"https://www.ups.com/dropoff\" target=\"_blank\">https://www.ups.com/dropoff</a></p>\r\n<table class=\"gmt-table-1\">\r\n<tbody>\r\n<tr><th>Standard-Lieferung</th><th>Versandkosten</th></tr>\r\n<tr>\r\n<td>Paket</td>\r\n<td>5,99 &euro;</td>\r\n</tr>\r\n<tr>\r\n<td>Paketlieferung an UPS Access Point</td>\r\n<td>5,99 &euro;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Sie wohnen auf einer deutschen Ostsee- oder Nordsee-Insel?</h2>\r\n<p>Selbstverst&auml;ndlich liefern wir Ihre Bestellungen auch auf deutsche Inseln!</p>\r\n</div>','2018-04-27 06:20:44','2018-05-16 13:39:28',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (9,'FAQ','1column','','','faq','FAQ','<div class=\"faq-page row\">\n	<div class=\"col-md-8 col-md-preffix-2\">\n		<div id=\"faq-accordion\">\n			<div class=\"accordion-block close\">\n				<div class=\"accordion-trigger close\">\n					<span>Is it necessary for me to register an account in order to buy an item?</span>\n				</div>\n				<div class=\"accordion-content\">\n					<p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\n					<ul>\n						<li>- keeping track of your order\'s delivery status</li>\n						<li>- changing or canceling the order</li>\n						<li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\n					</ul>\n              	</div>				\n			</div>\n			<div class=\"accordion-block close\">\n				<div class=\"accordion-trigger close\">\n					<span>Which shipping providers do you use?</span>\n				</div>\n				<div class=\"accordion-content\">\n					<p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\n					<ul>\n						<li>- keeping track of your order\'s delivery status</li>\n						<li>- changing or canceling the order</li>\n						<li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\n					</ul>\n              	</div>				\n			</div>\n			<div class=\"accordion-block close\">\n				<div class=\"accordion-trigger close\">\n					<span>How long it will take to receive the furniture?</span>\n				</div>\n				<div class=\"accordion-content\">\n					<p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\n					<ul>\n						<li>- keeping track of your order\'s delivery status</li>\n						<li>- changing or canceling the order</li>\n						<li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\n					</ul>\n              	</div>				\n			</div>\n			<div class=\"accordion-block close\">\n				<div class=\"accordion-trigger close\">\n					<span>How long it will take to receive the furniture?</span>\n				</div>\n				<div class=\"accordion-content\">\n					<p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\n					<ul>\n						<li>- keeping track of your order\'s delivery status</li>\n						<li>- changing or canceling the order</li>\n						<li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\n					</ul>\n              	</div>				\n			</div>\n			<div class=\"accordion-block close\">\n				<div class=\"accordion-trigger close\">\n					<span>Do you offer any kind of discounts?</span>\n				</div>\n				<div class=\"accordion-content\">\n					<p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\n					<ul>\n						<li>- keeping track of your order\'s delivery status</li>\n						<li>- changing or canceling the order</li>\n						<li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\n					</ul>\n              	</div>				\n			</div>\n			<div class=\"accordion-block close\">\n				<div class=\"accordion-trigger close\">\n					<span>Do you accept orders from all 50 US states?</span>\n				</div>\n				<div class=\"accordion-content\">\n					<p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\n					<ul>\n						<li>- keeping track of your order\'s delivery status</li>\n						<li>- changing or canceling the order</li>\n						<li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\n					</ul>\n              	</div>				\n			</div>\n		</div>\n	</div>\n</div>','2018-04-27 06:20:44','2018-04-27 06:20:44',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (10,'Support','1column','','','support','KUNDENSERVICE','<!--<div class=\"support-page row\">\r\n<div class=\"col-md-8 col-md-preffix-2\">\r\n<div class=\"text-block\">\r\n<p>Our customer support department is ready to come to your aid in a 24/7 manner, be your request in a form on email ticket or a phone call... We have a team of professional managers who will consult you regarding any technical, in-stock or billing question you might have. Also, should there be any problems with the delivery or if you would want to file a return, we will help you as well!</p>\r\n</div>\r\n<div class=\"boxes-block\">\r\n<h3>Have a Question?</h3>\r\n<ul class=\"row\">\r\n<li class=\"col-md-6\">\r\n<div><span class=\"support-page__archive-icon\">Knowledge Base</span></div>\r\n</li>\r\n<li class=\"col-md-6\">\r\n<div><span class=\"support-page__bubbles-icon\">Community Forum</span></div>\r\n</li>\r\n<li class=\"col-md-6\">\r\n<div><span class=\"support-page__bubble-question-icon\">24/7Ticket Support</span></div>\r\n</li>\r\n<li class=\"col-md-6\">\r\n<div><span class=\"support-page__envelope-icon\">Contact us</span></div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>-->\r\n<p></p>\r\n<!--########################-->\r\n<div class=\"customer-service\">\r\n<div class=\"text-block customer-service__block\">\r\n<h4>KONTAKTFORMULAR</h4>\r\n<p>Sie haben weitere Fragen? Bitte f&uuml;llen Sie dazu einfach dieses Formular aus und wir werden Ihre Anfrage umgehend bearbeiten.</p>\r\n<br />\r\n<p class=\"note no-label\">Bitte f&uuml;llen Sie alle mit * gekennzeicheneten Felder aus.</p>\r\n</div>\r\n<form class=\"form\" action=\"#\"><fieldset class=\"fieldset\">\r\n<div class=\"list-block  customer-service__block\">\r\n<ul class=\"row\">\r\n<li class=\"col-md-3\"><input name=\"bestellnummer\" type=\"text\" placeholder=\"*Bestellnummer\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"kundennummer\" type=\"text\" placeholder=\"*Kundennummer\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"anrede\" type=\"text\" placeholder=\"*Anrede\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"titel\" type=\"text\" placeholder=\"Titel\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"vorname\" type=\"text\" placeholder=\"*Vorname\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"nachname\" type=\"text\" placeholder=\"*Nachname\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"strasse\" type=\"text\" placeholder=\"*Stra&szlig;e\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"nr\" type=\"text\" placeholder=\"*Nr.\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-9\"><input name=\"adresszusatz\" type=\"text\" placeholder=\"Adresszusatz / Packstation\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"plz\" type=\"text\" placeholder=\"*PLZ\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"stadt\" type=\"text\" placeholder=\"*Stadt\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n<li class=\"col-md-3\"><input name=\"land\" type=\"text\" placeholder=\"*Land\" /></li>\r\n<li class=\"col-md-3\"></li>\r\n</ul>\r\n<div class=\"row\">\r\n<div class=\"actions-toolbar col-md-3\">\r\n<div class=\"primary\"><button id=\"submit\" class=\"action submit primary\" disabled=\"disabled\" type=\"submit\">Absenden</button></div>\r\n</div>\r\n</div>\r\n</div>\r\n</fieldset></form>\r\n<div class=\"text-block  customer-service__block\">\r\n<p>Unsere telefonischen Kundenservice erreichen Sie unter folgender Servicenummer:</p>\r\n<p>Telefon: +49 7221 920400 40*</p>\r\n<p class=\"small\">*Es fallen die &uuml;blichen Verbindungsgeb&uuml;hren zum Festnetzpreis an.</p>\r\n<br />\r\n<p><b>Gerne beanworten wir Ihre Fragen ebenfalls via E-Mail unter support@germantom.com</b></p>\r\n</div>\r\n</div>','2018-04-27 06:20:44','2018-05-19 12:51:29',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (11,'Guarantee','1column','','','guarantee','Guarantee & After-Sales Service','<div class=\"guarantee-page row\">\n	<div class=\"col-md-8 col-md-preffix-2\">\n		<div class=\"text-block\">\n			<p>Quite often, even after we’ve chosen an item and purchased it successfully, there may be some things we might want to change or repair afterward - either during or following the delivery process, when filing a return or applying for using our warranty. Here we\'ll try to explain in plain terms how does our store’s warranty policy works and how you can be using it when shopping with us!</p>\n		</div>\n		<div class=\"text-block\">\n			<h3>What Products are Provided with the Warranty?</h3>\n			<p>Some of our furniture items apply for an almost unconditional Lifetime Warranty. The items included in this policy are sofas, couches, love seats, upholstered chairs, ottomans, sectionals, and sleepers. As a retailer we warrant these components to you, the original retail purchaser, to be free from material manufacturing defects. The lifetime duration of the Warranty means the standardized usage cycle for a specific furniture item.</p>\n			<ul>\n				<li>\n					<h4>Repair & Refurbishing</h4>\n					<span>Our store will pay, within one year from the date of purchase, reasonable and conditional labor rates for refurbishing or replacing the defective parts and shipping costs.</span>\n				</li>\n				<li>\n					<h4>Different Types of Warranty</h4>\n					<span>While for some items we have a lifetime warranty, the springs in all of our items are offered with a 5 Year Limited type of a Warranty.</span>\n				</li>\n				<li>\n					<h4>Warranty Exceptions</h4>\n					<span>All seat cushion cores have a natural tendencey to become softer during a normal usage cycle, and will conform to the shape of the user. A Limited 1 Year Warranty applies.</span>\n				</li>\n			</ul>\n		</div>\n		<div class=\"text-block\">\n			<h3>Where to Apply for Warranty Services?</h3>\n			<p>Under these Limited Warranties, all of the legal liability of our store is limited to repair, or  if required (or requested by the customer), replacement. We are  ready to pay, within one year from the date of purchase, reasonable and customary labor rates to repair or replace the defective parts and shipping costs from the retailer...</p>\n			<p>These Limited Warranties are not applicable for any of our products which ave been altered by any person, dealer, or company without the express written authorization of our store. PLease note, that some States Do Not Allow Limitations On How Long An Implied Warranty Lasts, So The Above Limitations May Not Apply To You.</p>\n		</div>\n		<div class=\"text-block\">\n			<h3>In What Cases the Warranty is Not Provided?</h3>\n			<p>There can be two limits for the Warranties issued with the purchase of the furniture items on our website.</p>\n			<ul class=\"row\">\n				<li class=\"col-md-6\">\n					<h4>1, 3 & 5 Years Limited Warranty</h4>\n					<span>The first one is the Warranty time frame, if it is limited to 1, 3 or 5 years. Hence the Lifetime Warranty is not time-restricted.</span>\n				</li>\n				<li class=\"col-md-6\">\n					<h4>Regular Usage Check</h4>\n					<span>The second one is the examination of the item by our customer support agent, making sure the usage was regular.</span>\n				</li>\n			</ul>\n		</div>\n		<div class=\"text-block\">\n			<h3>Change and Return</h3>\n			<p>Filing a change or a return is an easy process, requiring nothing more than your proof of purchase (which usually is the receipt you received), the item itself and the return label printed out by you and put at the top of the package...</p>\n		</div>	\n	</div>\n</div>','2018-04-27 06:20:44','2018-04-27 06:20:44',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (12,'Secure payment','1column','','','secure-payment','Secure payment','<div class=\"secure-payment-page row\">\n	<div class=\"col-md-8 col-md-preffix-2\">\n		<p>\n			When it comes to purchasing something, anything online, the security question towers above everything else. We do not take our store’s overall cyber security and particularly the billing process security lightly. We can assure you that all of your shopping here will be a fun and safe experience, enhanced by the all of the factors listed below.\n		</p>\n		<ul>\n			<li>\n				<h4>SSL Certificate</h4>\n				<span>If the website has an SLL certificate, this means that the owners care about your shopping experience being secure, safe and sound and want to make sure that all the data (including financial) that you enter on our website will be securely encrypted!</span>\n			</li>\n			<li>\n				<h4>Multiple Gateways</h4>\n				<span>When we were considering which payment gateways to use on our website, the choice narrowed down to 5 most universal ones: Visa; MasterCard; PayPal; Discover; Stripe.</span>\n			</li>\n			<li>\n				<h4>24/7 Customer Support</h4>\n				<span>Also, it is comforting to know that should you experience any kind of technical bump in the road during the checkout process, you can always address our customer support department with your billing questions!</span>\n			</li>\n		</ul>\n		<div class=\"secure-payment_icons\">\n			<ul>\n				<li><a href=\"#\" class=\"fa fa-cc-visa\"></a></li>\n				<li><a href=\"#\" class=\"fa fa-cc-mastercard\"></a></li>\n				<li><a href=\"#\" class=\"fa fa-cc-paypal\"></a></li>\n				<li><a href=\"#\" class=\"fa fa-cc-discover\"></a></li>\n				<li><a href=\"#\" class=\"fa fa-cc-stripe\"></a></li>\n			</ul>\n		</div>\n	</div>\n</div>','2018-04-27 06:20:44','2018-04-27 06:20:44',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (13,'Allgemeine Geschäftsbedingungen','1column','','','terms-conditions','Allgemeine Geschäftsbedingungen','<div class=\"gmt-cms-page\">\r\n<h2>&sect;1 Geltung gegen&uuml;ber Unternehmern und Begriffsdefinitionen</h2>\r\n<p>(1) Die nachfolgenden Allgemeinen Gesch&auml;ftbedingungen gelten f&uuml;r alle Lieferungen zwischen uns und einem Verbraucher in ihrer zum Zeitpunkt der Bestellung g&uuml;ltigen Fassung.</p>\r\n<p>Verbraucher ist jede nat&uuml;rliche Person, die ein Rechtsgesch&auml;ft zu Zwecken abschlie&szlig;t, die &uuml;berwiegend weder ihrer gewerblichen noch ihrer selbst&auml;ndigen beruflichen T&auml;tigkeit zugerechnet werden k&ouml;nnen (&sect; 13 BGB).</p>\r\n<h2>&sect;2 Zustandekommen eines Vertrages, Speicherung des Verttragstextes</h2>\r\n<p>(1) Die folgenden Regelungen &uuml;ber den Vertragsabschluss gelten f&uuml;r Bestellungen &uuml;ber unseren Internetshop www.germantom.com.</p>\r\n<p>(2) Im Falle des Vertragsschlusses kommt der Vertrag mit</p>\r\n<p>Germantom International GmbH<br /> Harald Martin Wayer<br /> Stolzenbergstrasse 13<br /> D-76532 Baden-Baden<br /> Registernummer HRB 3519987<br /> Registergericht Mannheim</p>\r\n<p>zustande.</p>\r\n<p>(3) Die Pr&auml;sentation der Waren in unserem Internetshop stellen kein rechtlich bindendes Vertragsangebot unsererseits dar, sondern sind nur eine unverbindliche Aufforderungen an den Verbraucher, Waren zu bestellen. Mit der Bestellung der gew&uuml;nschten Ware gibt der Verbraucher ein f&uuml;r ihn verbindliches Angebot auf Abschluss eines Kaufvertrages ab.</p>\r\n<p>(4) Bei Eingang einer Bestellung in unserem Internetshop gelten folgende Regelungen: Der Verbraucher gibt ein bindendes Vertragsangebot ab, indem er die in unserem Internetshop vorgesehene Bestellprozedur erfolgreich durchl&auml;uft.</p>\r\n<p>Die Bestellung erfolgt in folgenden Schritten:</p>\r\n<ul>\r\n<li>1) Auswahl der gew&uuml;nschten Ware</li>\r\n<li>2) Best&auml;tigen durch Anklicken der Buttons &bdquo;Bestellen&ldquo;</li>\r\n<li>3) Pr&uuml;fung der Angaben im Warenkorb</li>\r\n<li>4) Bet&auml;tigung des Buttons &bdquo;zur Kasse&ldquo;</li>\r\n<li>5) Anmeldung im Internetshop nach Registrierung und Eingabe der Anmelderangaben (E-Mail-Adresse und Passwort).</li>\r\n<li>6) Nochmalige Pr&uuml;fung bzw. Berichtigung der jeweiligen eingegebenen Daten.</li>\r\n<li>7) Verbindliche Absendung der Bestellung durch Anklicken des Buttons &bdquo;kostenpflichtig bestellen&ldquo; bzw. &bdquo;kaufen&ldquo;</li>\r\n</ul>\r\n<p>Der Verbraucher kann vor dem verbindlichen Absenden der Bestellung durch Bet&auml;tigen der in dem von ihm verwendeten Internet-Browser enthaltenen &bdquo;Zur&uuml;ck&ldquo;-Taste nach Kontrolle seiner Angaben wieder zu der Internetseite gelangen, auf der die Angaben des Kunden erfasst werden und Eingabefehler berichtigen bzw. durch Schlie&szlig;en des Internetbrowsers den Bestellvorgang abbrechen. Wir best&auml;tigen den Eingang der Bestellung unmittelbar durch eine automatisch generierte E-Mail (&bdquo;Auftragsbest&auml;tigung&ldquo;). Mit dieser nehmen wir Ihr Angebot an.</p>\r\n<p>(5) Speicherung des Vertragstextes bei Bestellungen &uuml;ber unseren Internetshop : Wir senden Ihnen die Bestelldaten und unsere AGB per E-Mail zu. Die AGB k&ouml;nnen Sie jederzeit auch unter <a href=\"http://germantom.com\">www.germantom.com</a>. einsehen. Ihre Bestelldaten sind aus Sicherheitsgr&uuml;nden nicht mehr &uuml;ber das Internet zug&auml;nglich.</p>\r\n<h2>&sect;3 Preise, Versandkosten, Zahlung, F&auml;lligkeit</h2>\r\n<p>(1) Die angegebenen Preise enthalten die gesetzliche Umsatzsteuer und sonstige Preisbestandteile. Hinzu kommen etwaige Versandkosten.</p>\r\n<p>(2) Der Verbraucher hat die M&ouml;glichkeit der Zahlung per Vorkasse, Bankeinzug, PayPal, Kreditkarte (Visa, Mastercard, American Express).</p>\r\n<p>(3) Hat der Verbraucher die Zahlung per Vorkasse gew&auml;hlt, so verpflichtet er sich, den Kaufpreis unverz&uuml;glich nach Vertragsschluss zu zahlen.</p>\r\n<h2>&sect;4 Lieferung</h2>\r\n<p>(1) Sofern wir dies in der Produktbeschreibung nicht deutlich anders angegeben haben, sind alle von uns angebotenen Artikel sofort versandfertig. Die Lieferung erfolgt hier sp&auml;testen innerhalb von 5 Werktagen. Dabei beginnt die Frist f&uuml;r die Lieferung im Falle der Zahlung per Vorkasse am Tag nach Zahlungsauftrag an die mit der &Uuml;berweisung beauftragte Bank und bei allen anderen Zahlungsarten am Tag nach Vertragsschluss zu laufen. F&auml;llt das Fristende auf einen Samstag, Sonntag oder gesetzlichen Feiertag am Lieferort, so endet die Frist am n&auml;chsten Werktag.</p>\r\n<p>(2) Die Gefahr des zuf&auml;lligen Untergangs und der zuf&auml;lligen Verschlechterung der verkauften Sache geht auch beim Versendungskauf erst mit der &Uuml;bergabe der Sache an den K&auml;ufer auf diesen &uuml;ber.</p>\r\n<p>(3) Sendet das Transportunternehmen die versandte Ware an den Verk&auml;ufer zur&uuml;ck, da eine Zustellung beim Kunden nicht m&ouml;glich war, tr&auml;gt der Kunde die Kosten f&uuml;r den erfolglosen Versand. Dies gilt nicht, wenn der Kunde sein Widerrufsrecht wirksam aus&uuml;bt, wenn er den Umstand, der zur Unm&ouml;glichkeit der Zustellung gef&uuml;hrt hat, nicht zu vertreten hat oder wenn er vor&uuml;bergehend an der Annahme der angebotenen Leistung verhindert war, es sei denn, dass der Verk&auml;ufer ihm die Leistung eine angemessene Zeit vorher angek&uuml;ndigt hatte.</p>\r\n<h2>&sect;5 Eigentumsvorbehalt</h2>\r\n<p>Wir behalten uns das Eigentum an der Ware bis zur vollst&auml;ndigen Bezahlung des Kaufpreises vor.</p>\r\n<p>*************************</p>\r\n<h2>&sect;6 Wiederrufsrecht des Kunden als Verbraucher:</h2>\r\n<h3>Widerrufsrecht f&uuml;r Verbraucher</h3>\r\n<p>Verbrauchern steht ein Widerrufsrecht nach folgender Ma&szlig;gabe zu, wobei Verbraucher jede nat&uuml;rliche Person ist, die ein Rechtsgesch&auml;ft zu Zwecken abschlie&szlig;t, die &uuml;berwiegend weder ihrer gewerblichen noch ihrer selbst&auml;ndigen beruflichen T&auml;tigkeit zugerechnet werden k&ouml;nnen. Das Widerrufsrecht gilt nicht f&uuml;r Verbraucher, die zum Zeitpunkt des Vertragsschlusses keinem Mitgliedstaat der Europ&auml;ischen Union angeh&ouml;ren und deren alleiniger Wohnsitz und Lieferadresse zum Zeitpunkt des Vertragsschlusses au&szlig;erhalb der Europ&auml;ischen Union liegen.</p>\r\n<h2>Widerrufsbelehrung</h2>\r\n<h3>Widerrufsrecht</h3>\r\n<p>Sie haben das Recht, binnen vierzehn Tagen ohne Angabe von Gr&uuml;nden diesen Vertrag zu widerrufen.</p>\r\n<p>Die Widerrufsfrist betr&auml;gt vierzehn Tage, ab dem Tag, an dem Sie oder ein von Ihnen benannter Dritter, der nicht der Bef&ouml;rderer ist, die Waren in Besitz genommen haben bzw. hat.</p>\r\n<p>Um Ihr Widerrufsrecht auszu&uuml;ben, m&uuml;ssen Sie uns</p>\r\n<p>Germantom International GmbH<br /> Harald Martin Wayer<br /> Stolzenbergstrasse 13<br /> D-76532 Baden-Baden<br /> E-Mail info@germantom.com</p>\r\n<p>mittels einer eindeutigen Erkl&auml;rung (z.B. ein mit der Post versandter Brief, Telefax, E-Mail oder auf unserer Website) &uuml;ber Ihren Entschluss, diesen Vertrag zu widerrufen, informieren. Sie k&ouml;nnen daf&uuml;r das beigef&uuml;gte Muster-Widerrufsformular verwenden, das jedoch nicht vorgeschrieben ist.</p>\r\n<h3>Widerrufsfolgen</h3>\r\n<p>Wenn Sie diesen Vertrag widerrufen, haben wir Ihnen alle Zahlungen, die wir von Ihnen erhalten haben, einschlie&szlig;lich der Lieferkosten (mit Ausnahme der zus&auml;tzlichen Kosten, die sich daraus ergeben, dass Sie eine andere Art der Lieferung als die von uns angebotene, g&uuml;nstigste Standardlieferung gew&auml;hlt haben), unverz&uuml;glich und sp&auml;testens binnen vierzehn Tagen ab dem Tag zur&uuml;ckzuzahlen, an dem die Mitteilung &uuml;ber Ihren Widerruf dieses Vertrags bei uns eingegangen ist. F&uuml;r diese R&uuml;ckzahlung verwenden wir dasselbe Zahlungsmittel, das Sie bei der urspr&uuml;nglichen Transaktion eingesetzt haben, es sei denn, mit Ihnen wurde ausdr&uuml;cklich etwas anderes vereinbart; in keinem Fall werden Ihnen wegen dieser R&uuml;ckzahlung Entgelte berechnet.</p>\r\n<p>Wir k&ouml;nnen die R&uuml;ckzahlung verweigern, bis wir die Waren wieder zur&uuml;ckerhalten haben oder bis Sie den Nachweis erbracht haben, dass Sie die Waren zur&uuml;ckgesandt haben, je nachdem, welches der fr&uuml;here Zeitpunkt ist.</p>\r\n<p>Sie haben die Waren unverz&uuml;glich und in jedem Fall sp&auml;testens binnen vierzehn Tagen ab dem Tag, an dem Sie uns &uuml;ber den Widerruf dieses Vertrages unterrichten, an uns zur&uuml;ckzusenden oder zu &uuml;bergeben. Die Frist ist gewahrt, wenn Sie die Waren vor Ablauf der Frist von vierzehn Tagen absenden.</p>\r\n<p>Sie müssen für einen etwaigen Wertverlust der Waren nur aufkommen, wenn dieser Wertverlust auf einen zur Prüfung der Beschaffenheit, Eigenschaften und Funktionsweise der Waren nicht notwendigen Umgang mit ihnen zurückzuführen ist.</p>\r\n<p>Ende der Widerrufsbelehrung</p>\r\n<p>*************************</p>\r\n<h2>&sect;7 Wiederrufsformular</h2>\r\n<h3>Muster-Widerrufsformular</h3>\r\n<p>(Wenn Sie den Vertrag widerrufen wollen, dann f&uuml;llen Sie bitte dieses Formular aus und senden Sie es zur&uuml;ck.)</p>\r\n<div style=\"padding: 20px; border: 1px dotted #444444;\">\r\n<p>An :<br /> Germantom International GmbH<br /> Harald Martin Wayer<br /> Stolzenbergstrasse 13<br /> D-76532 Baden-Baden<br /> E-Mail info@germantom.com</p>\r\n<p>Hiermit widerrufe(n) ich/wir (*) den von mir/uns (*) abgeschlossenen Vertrag &uuml;ber den Kauf der folgenden Waren (*)/die Erbringung der folgenden Dienstleistung (*)</p>\r\n<p>_____________________________________________________</p>\r\n<p>Bestellt am (*)/erhalten am (*)</p>\r\n<p>__________________</p>\r\n<p>Name des/der Verbraucher(s)</p>\r\n<p>_____________________________________________________</p>\r\n<p>Anschrift des/der Verbraucher(s)</p>\r\n<p>_____________________________________________________</p>\r\n<p>Unterschrift des/der Verbraucher(s) (nur bei Mitteilung auf Papier)</p>\r\n<p>__________________</p>\r\n<p>Datum</p>\r\n<p>__________________</p>\r\n</div>\r\n<p>(*) Unzutreffendes streichen.</p>\r\n<h2>&sect;8 Gew&auml;hrleistung</h2>\r\n<p>Es gelten die gesetzlichen Gew&auml;hrleistungsregelungen.</p>\r\n<h2>&sect;9 Vertragssprache</h2>\r\n<p>Als Vertragssprache steht ausschlie&szlig;lich Deutsch zur Verf&uuml;gung.</p>\r\n<h2>&sect;10 Salvatorische Klausel</h2>\r\n<p>Sollte eine Bestimmung dieser Vereinbarung ganz oder teilweise unwirksam sein oder ihre Rechtswirksamkeit sp&auml;ter verlieren, so soll hierdurch die G&uuml;ltigkeit der &uuml;brigen Bestimmungen nicht ber&uuml;hrt werden. Anstelle der unwirksamen Bestimmung gelten die gesetzlichen Vorschriften.</p>\r\n<p>Stand der AGB Dez. 2017</p>\r\n<p>Gratis AGB erstellt von agb.de</p>\r\n</div>','2018-04-27 06:20:44','2018-05-18 08:51:10',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (14,'Magetique','landing_home','','','landing','','<div class=\"landing-page\">\n	<div id=\"home\"></div>\n	<header class=\"header\">\n		<div class=\"header-top\">\n			<div class=\"logo\"><a href=\"{{store url=\'\'}}\"><img src=\"{{media url=\'landing/logo.png}}\" alt=\"logo\"></a></div>\n			<div class=\"menu-wrapper\">\n				<ul class=\"menu\" id=\"landing-menu\">\n					<li><a href=\"#home\">Home</a></li>\n					<li><a href=\"#demos\">Demos</a></li>\n					<li><a href=\"#features\">Features</a></li>\n					<li><a href=\"#support\">Support</a></li>\n				</ul>\n			</div>\n			<a href=\"http://www.templatemonster.com/magetique.html\" class=\"l-button\">Buy theme!</a>			\n		</div>\n		<div class=\"header-content\">\n			<div class=\"header-content_text\">\n				<h3>Premium Magento theme</h3>\n				<h1>Magetique</h1>\n				<a href=\"{{store url=\'\'}}\" class=\"l-button\">Demos</a>\n			</div>\n			<img src=\"{{media url=\'landing/mockup-1.png}}\" alt=\"mockup-1\" class=\"mockup-1\">	\n		</div>\n	</header>\n	<div class=\"main-content\">\n		<div id=\"demos\"></div>\n		<div class=\"gallery\">\n			<h3>5 Premium Layouts for Any Niche</h3>\n			<p>This template is an absolute treat for any store and niche. You get 5 fully functional designs for the price of one.</p>\n			<div class=\"gallery-wrapper\">\n				<ul>\n					<li><div class=\"gallery-item gallery-item-1\"> \n						<a href=\"{{store url=\'\'}}?___store=english\"><div class=\"gallery-item_wrapper\">\n							<img src=\"{{media url=\'landing/theme-2.jpg}}\" alt=\"theme-img\">\n						</div><span>Lingerie</span></a>\n					</div></li>\n					<li><div class=\"gallery-item gallery-item-2 wow fadeInRight\" data-wow-offset=\"50\" data-wow-delay=\"0.4s\" >						\n						<a href=\"{{store url=\'\'}}?___store=furniture_store_view\"><div class=\"gallery-item_wrapper\">\n							<img src=\"{{media url=\'landing/theme-1.jpg}}\" alt=\"theme-img\">\n						</div><span>Furniture</span></a>\n					</div></li>\n					<li><div class=\"gallery-item gallery-item-3 wow fadeInLeft\" data-wow-offset=\"150\" data-wow-delay=\"0.2s\">\n						<a href=\"{{store url=\'\'}}?___store=bikes_store_view\"><div class=\"gallery-item_wrapper\">\n							<img src=\"{{media url=\'landing/theme-3.jpg}}\" alt=\"theme-img\">\n						</div><span>Bikes and Spare Parts</span></a>\n					</div></li>\n					<li><div class=\"gallery-item gallery-item-4 wow fadeInLeft\" data-wow-offset=\"-50\" data-wow-delay=\"0.4s\">\n						<a href=\"{{store url=\'\'}}?___store=medical_supplies_and_equipment\"><div class=\"gallery-item_wrapper\">\n							<img src=\"{{media url=\'landing/theme-4.jpg}}\" alt=\"theme-img\">\n						</div><span>Medical Equipment</span></a>\n					</div></li>\n					<li><div class=\"gallery-item gallery-item-5 comming-soon wow fadeInRight\" data-wow-offset=\"150\">\n						<div class=\"gallery-item_wrapper\">\n							<img src=\"{{media url=\'landing/theme-5.jpg}}\" alt=\"theme-img\">\n						</div><span>Spare parts</span>\n					</div></li>\n				</ul>\n			</div>\n		</div>\n		<div id=\"features\"></div>\n		<div class=\"info-1\">\n			<div class=\"info-1-content\">\n				<h3>Create Tailored Page Designs with the Color Scheme Tool</h3>\n				<p>Up until now, you required design prowess and knowledge of CSS files, along with their structures in order to make the necessary changes to your store’s color scheme. But as a part of Magetique’s functionality, you can edit color arrangements on any page of your website, using our intuitive visual interface. Experiment in order to boost your conversion rates.</p>\n			</div>\n			<img src=\"{{media url=\'landing/color_scheme.png}}\" alt=\"info-1-img\">\n		</div>\n		<div class=\"info-2\">\n			<div class=\"info-2-content wow fadeIn\" data-wow-offset=\"50\" data-wow-delay=\"0.3s\" data-wow-offset=\"-100\">\n				<h3>Dazzling Design</h3>\n				<p>Our 14 years of experience creating successful eCommerce designs was poured into optimizing Magetique. Everything in this theme, from the color schemes, UX, navigation to page structures, catalogs and product pages, creates the right conditions, which drive your visitors to successful conversions.</p>\n			</div>\n			<div class=\"info-2-img\">\n				<img src=\"{{media url=\'landing/box-1-1.jpg}}\" alt=\"info-2-img\" class=\"info-2-img-1 wow fadeInUp\">\n				<img src=\"{{media url=\'landing/box-1-3.jpg}}\" alt=\"info-2-img\" class=\"info-2-img-2 wow fadeInRight\" data-wow-delay=\"0.2s\" data-wow-offset=\"-100\">\n				<img src=\"{{media url=\'landing/box-1-2.jpg}}\" alt=\"info-2-img\" class=\"info-2-img-3 wow fadeInLeft\" data-wow-delay=\"0.5s\" data-wow-offset=\"-100\">				\n			</div>\n		</div>\n		<div class=\"info-3\">\n			<div class=\"info-3-content\">\n				<h3>Functional Header Designs</h3>\n				<p>Our selection of pre-made header layouts offers unparalleled usability and customization options. This means that you can precisely control where people are heading on your website, which paves the way for effortless product discovery and purchases.</p>\n			</div>\n			<div class=\"info-3-list\">\n				<ul>\n					<li class=\"wow fadeInLeft\" data-wow-delay=\"0.5s\"><img src=\"{{media url=\'landing/scheme-1-1.jpg}}\" alt=\"box-img\"></li>\n					<li class=\"wow fadeInUp\" data-wow-delay=\"0.3s\"><img src=\"{{media url=\'landing/scheme-1-2.jpg}}\" alt=\"box-img\"></li>\n					<li class=\"wow fadeInUp\"><img src=\"{{media url=\'landing/scheme-1-3.jpg}}\" alt=\"box-img\"></li>\n					<li class=\"wow fadeInUp\" data-wow-delay=\"0.3s\"><img src=\"{{media url=\'landing/scheme-1-4.jpg}}\" alt=\"box-img\"></li>\n					<li class=\"wow fadeInRight\" data-wow-delay=\"0.5s\"><img src=\"{{media url=\'landing/scheme-1-5.jpg}}\" alt=\"box-img\"></li>\n				</ul>\n			</div>\n		</div>\n		<div class=\"info-4\">\n			<div class=\"info-4-content\">\n				<h3>Flexible Footer Layouts</h3>\n				<p>Some people might shrug off the footer, but it play an important role in overall user experience. For example, many of us go straight to the footer, if we’re looking for certain contact details. That’s why our selection of footer designs provides a great myriad of customization options that’ll allow you to create a compact, informative and optimized footer, which might even play a role in your conversion rates.</p>\n			</div>\n			<div class=\"info-4-list\">\n				<ul>\n					<li class=\"wow fadeInUp\" data-wow-delay=\"0.3s\"  data-wow-offset=\"50\"><img src=\"{{media url=\'landing/scheme-2-1.jpg}}\" alt=\"box-img\"></li>\n					<li class=\"wow fadeInUp\" data-wow-delay=\"0.5s\"  data-wow-offset=\"50\"><img src=\"{{media url=\'landing/scheme-2-2.jpg}}\" alt=\"box-img\"></li>\n					<li class=\"wow fadeInUp\" data-wow-delay=\"0.7s\"  data-wow-offset=\"50\"><img src=\"{{media url=\'landing/scheme-2-3.jpg}}\" alt=\"box-img\"></li>\n					<li class=\"wow fadeInUp\" data-wow-delay=\"0.9s\"  data-wow-offset=\"50\"><img src=\"{{media url=\'landing/scheme-2-4.jpg}}\" alt=\"box-img\"></li>\n				</ul>\n			</div>\n		</div>\n		<div class=\"list-1\">\n			<h3>Save up to <em>$1718</em><span>on Premium Modules with Magetique Theme</span></h3>\n			<ul>\n				<li>\n					<div class=\"l-icon-megamenu\"></div>\n					<span>Megamenu</span>\n				</li>\n				<li>\n					<div class=\"l-icon-like\"></div>\n					<span>Ajax Wishlist</span>\n				</li>\n				<li>\n					<div class=\"l-icon-compare\"></div>\n					<span>Ajax Compare</span>\n				</li>\n				<li>\n					<div class=\"l-icon-filter\"></div>\n					<span>Ajax Catalog Filter</span>\n				</li>\n				<li>\n					<div class=\"l-icon-newsletter\"></div>\n					<span>Newsletter Popup</span>\n				</li>\n				<li>\n					<div class=\"l-icon-layout\"></div>\n					<span>Layout Switcher</span>\n				</li>\n				<li>\n					<div class=\"l-icon-paralax\"></div>\n					<span>Parallax</span>\n				</li>\n				<li>\n					<div class=\"l-icon-slider\"></div>\n					<span>Film Slider</span>\n				</li>\n				<li>\n					<div class=\"l-icon-search\"></div>\n					<span>Ajax Search</span>\n				</li>\n				<li>\n					<div class=\"l-icon-map\"></div>\n					<span>Google Map</span>\n				</li>\n				<li>\n					<div class=\"l-icon-img-grid\"></div>\n					<span>Catalog Images Grid</span>\n				</li>\n				<li>\n					<div class=\"l-icon-blog\"></div>\n					<span>Blog</span>\n				</li>\n				<li>\n					<div class=\"l-icon-options\"></div>\n					<span>Theme Options</span>\n				</li>\n				<li>\n					<div class=\"l-icon-featured\"></div>\n					<span>Featured Product</span>\n				</li>\n				<li>\n					<div class=\"l-icon-brands\"></div>\n					<span>Brands</span>\n				</li>\n				<li>\n					<div class=\"l-icon-video\"></div>\n					<span>Video Background</span>\n				</li>\n				<li>\n					<div class=\"l-icon-timer\"></div>\n					<span>Countdown Timer</span>\n				</li>\n				<li>\n					<div class=\"l-icon-labels\"></div>\n					<span>Smart Product Labels</span>\n				</li>\n				<li>\n					<div class=\"l-icon-zoom\"></div>\n					<span>Cloud Zoom</span>\n				</li>\n				<li>\n					<div class=\"l-icon-maintence\"></div>\n					<span>Maintenance</span>\n				</li>\n				<li>\n					<div class=\"l-icon-login\"></div>\n					<span>Social Login</span>\n				</li>\n				<li>\n					<div class=\"l-icon-sharing\"></div>\n					<span>Social Sharing</span>\n				</li>\n			</ul>\n		</div>\n		<div id=\"support\"></div>\n		<div class=\"info-5\">\n			<div class=\"info-5-content wow fadeInUp\" data-wow-offset=\"-100\">\n				<h3>Free and Comprehensive Lifetime Support</h3>\n				<p>Our support representatives will provide you with step-by-step instructions on any aspect of running, maintaining and customizing the Magetique theme. Our live chat is here for you 24/7.</p>\n			</div>\n			<img src=\"{{media url=\'landing/box-2.png}}\" alt=\"box-2-img\" class=\"wow fadeInRight\">			\n		</div>\n		<div class=\"list-2\">\n			<h3>Our Benefits</h3>\n			<ul>\n				<li>\n					<img src=\"{{media url=\'landing/box-3-1.jpg}}\" alt=\"list-2\" class=\"wow flipInY\" data-wow-offset=\"50\" data-wow-duration=\"0.4s\">\n					<h4>Built with Conversions in Mind</h4>\n					<p>We want your visitors to easily discover and purchase products from your store. This means that the path between arriving at your website and making a purchase becomes a smooth ride.</p>\n				</li>\n				<li>\n					<img src=\"{{media url=\'landing/box-3-2.jpg}}\" alt=\"list-2\" class=\"wow flipInY\" data-wow-offset=\"50\" data-wow-delay=\"0.1s\" data-wow-duration=\"0.4s\">\n					<h4>Make Way for Mobile Shoppers</h4>\n					<p>Many people are actively using mobile devices to shop. Magetique facilitates mobile users like no other Magento 2 theme. It’s smooth, touch-friendly, its design is perfect for Retina displays.</p>\n				</li>\n				<li>\n					<img src=\"{{media url=\'landing/box-3-3.jpg}}\" alt=\"list-2\" class=\"wow flipInY\" data-wow-offset=\"50\" data-wow-delay=\"0.2s\" data-wow-duration=\"0.4s\">\n					<h4>Amazingly Fast Performance</h4>\n					<p>Magetique’s code is optimized to make sure that your customers don’t waste precious seconds. Those seconds may cost you sales, so we’ve done everything for the lightning-fast performance.</p>\n				</li>\n				<li>\n					<img src=\"{{media url=\'landing/box-3-4.jpg}}\" alt=\"list-2\" class=\"wow flipInY\" data-wow-offset=\"50\" data-wow-delay=\"0.3s\" data-wow-duration=\"0.4s\">\n					<h4>Faster Market for Stores and Products</h4>\n					<p>Magetique offers great visual editing capabilities for anyone. This allows business owners to launch new stores and beat their competitors with simplified product launch routines.</p>\n				</li>\n			</ul>\n		</div>\n	</div>\n	<footer class=\"footer\">\n		<div class=\"footer-content\">\n			<div class=\"footer-content_text\">\n				<span class=\"footer-title\">Get Magetique Today</span>\n				<a href=\"http://www.templatemonster.com/magetique.html\" class=\"l-button\">Buy now!</a>\n			</div>\n			<img src=\"{{media url=\'landing/mockup-2.png}}\" alt=\"mockup-2\" class=\"mockup-2\">	\n		</div>\n		<div class=\"copyright\"><span>Magetique © 2016. All Rights Reserved.</span></div>\n	</footer>\n</div>','2018-04-27 06:20:44','2018-04-27 06:20:44',1,0,'<head>\n    <title>\n        Magetique\n    </title>\n    <script src=\"js/landing/jquery-2.2.4.min.js\"/>\n    <script src=\"js/landing/stickUp.min.js\"/>  \n    <script src=\"js/landing/wow.js\"/>\n    <script src=\"js/landing/landing-scripts.js\"/>\n\n    <css src=\"css/landing.css\" />\n\n    <remove src=\"requirejs/require.js\"/>\n\n    <remove src=\"mage/calendar.css\"/>\n    <remove src=\"TemplateMonster_FilmSlider::css/slider-pro.css\"/>\n    <remove src=\"TemplateMonster_FilmSlider::css/animate.css\"/>\n    <remove src=\"TemplateMonster_CountdownTimer::css/timer.css\"/>\n    <remove src=\"TemplateMonster_LayoutSwitcher::css/module.css\"/>\n    <remove src=\"TemplateMonster_LayoutSwitcher::fonts/font-awesome-4.5.0/css/font-awesome.min.css\"/>\n    <remove src=\"TemplateMonster_Parallax::css/rd-parallax/style.css\"/>\n    <remove src=\"TemplateMonster_Parallax::css/jquery-youtubebackground/style.css\"/>\n    <remove src=\"TemplateMonster_AjaxCompare::css/modal-compare.css\"/>\n    <remove src=\"TemplateMonster_FeaturedProduct::fonts/font-awesome-4.5.0/css/font-awesome.min.css\"/>\n    <remove src=\"TemplateMonster_FeaturedProduct::css/module.css\"/>\n    <remove src=\"css/material-icons.css\"/>\n    <remove src=\"css/font-awesome.css\"/>\n    <remove src=\"css/modules.css\"/>\n    <remove src=\"css/style.css\"/>\n</head>\n\n<referenceBlock name=\"page.preloader\" remove=\"true\" />\n<referenceBlock name=\"translate\" remove=\"true\" />\n<referenceBlock name=\"googlemap.page.content\" remove=\"true\" />\n<referenceBlock name=\"googlemap.init\" remove=\"true\" />\n<referenceContainer name=\"after.body.start\" remove=\"true\" />\n<referenceContainer name=\"before.body.end\" remove=\"true\" />\n<referenceContainer name=\"page.messages\" remove=\"true\" />\n<referenceContainer name=\"footer\" remove=\"true\" />',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (15,'Impressum','1column','','','impressum','Impressum','<div class=\"gmt-cms-page\">\r\n<h2>Angaben gemäss § 5 TMG:</h2>\r\n<p>\r\nGermantom International GmbH<br />\r\nStolzenbergstraße 13<br />\r\n76532 Baden-Baden\r\n</p>\r\n\r\n<h2>Vertreten durch:</h2>\r\n<p>Herr Harald Martin Wayer</p>\r\n\r\n<h2>Kontakt:</h2>\r\n<p>\r\nTelefon: +49 (0) 7221 920 40 0<br />\r\nTelefax: +49 (0) 7221 920 40 10<br />\r\nE-Mail: info@germantom.com\r\n</p>\r\n\r\n<h2>Registereintrag:</h2>\r\n<p>\r\nHandelsregister: Amtsgericht Mannheim, HRB 3519987\r\n</p>\r\n\r\n<h2>Umsatzsteuer:</h2>\r\n<p>\r\nUmsatzsteuer-Identifikationsnummer gemäß §27 a Umsatzsteuergesetz:<br />\r\nDE 813777057\r\n</=p>\r\n\r\n<h2>Hinweis auf EU-Streitschlichtung</h2>\r\n<p>\r\nDie Europäische Komission stellt eine Plattform zur Online-Streitbeilegung (OS) bereit:<br />\r\n<a href=\"http://ec.europa.eu/consumers/odr\" target=\"_blank\">http://ec.europa.eu/consumers/odr</a><br />\r\nUnsere E-Mail-Adresse finden Sie oben im Impressum.\r\n</p>\r\n\r\n<h2>Haftung für Inhalte</h2>\r\n<p>\r\nAls Diensteanbieter sind wir gemäß § 7 Abs.1 TMG für eigene Inhalte auf diesen Seiten nach den allgemeinen Gesetzen verantwortlich. Nach §§ 8 bis 10 TMG sind wir als Diensteanbieter jedoch nicht verpflichtet, übermittelte oder gespeicherte fremde Informationen zu überwachen oder nach Umständen zu forschen, die auf eine rechtswidrige Tätigkeit hinweisen.\r\n</p>\r\n<p>\r\nVerpflichtungen zur Entfernung oder Sperrung der Nutzung von Informationen nach den allgemeinen Gesetzen bleiben hiervon unberührt. Eine diesbezügliche Haftung ist jedoch erst ab dem Zeitpunkt der Kenntnis einer konkreten Rechtsverletzung möglich. Bei Bekanntwerden von entsprechenden Rechtsverletzungen werden wir diese Inhalte umgehend entfernen.\r\n</p>\r\n\r\n<h2>Haftung für Links</h2>\r\n<p>\r\nUnser Angebot enthält Links zu externen Webseiten Dritter, auf deren Inhalte wir keinen Einfluss haben. Deshalb können wir für diese fremden Inhalte auch keine Gewähr übernehmen. Für die Inhalte der verlinkten Seiten ist stets der jeweilige Anbieter oder Betreiber der Seiten verantwortlich. Die verlinkten Seiten wurden zum Zeitpunkt der Verlinkung auf mögliche Rechtsverstöße überprüft. Rechtswidrige Inhalte waren zum Zeitpunkt der Verlinkung nicht erkennbar.\r\n</p>\r\n<p>\r\nEine permanente inhaltliche Kontrolle der verlinkten Seiten ist jedoch ohne konkrete Anhaltspunkte einer Rechtsverletzung nicht zumutbar. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Links umgehend entfernen.\r\n</p>\r\n\r\n<h2>Urheberrecht</h2>\r\n<p>\r\nDie durch die Seitenbetreiber erstellten Inhalte und Werke auf diesen Seiten unterliegen dem deutschen Urheberrecht. Die Vervielfältigung, Bearbeitung, Verbreitung und jede Art der Verwertung außerhalb der Grenzen des Urheberrechtes bedürfen der schriftlichen Zustimmung des jeweiligen Autors bzw. Erstellers. Downloads und Kopien dieser Seite sind nur für den privaten, nicht kommerziellen Gebrauch gestattet.\r\n</p>\r\n<p>\r\nSoweit die Inhalte auf dieser Seite nicht vom Betreiber erstellt wurden, werden die Urheberrechte Dritter beachtet. Insbesondere werden Inhalte Dritter als solche gekennzeichnet. Sollten Sie trotzdem auf eine Urheberrechtsverletzung aufmerksam werden, bitten wir um einen entsprechenden Hinweis. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Inhalte umgehend entfernen.\r\n</p>\r\n<p>\r\nQuelle: <a href=\"https://www.e- recht24.de/impressum-generator.html\" target=\"_blank\">https://www.e- recht24.de/impressum-generator.html</a>\r\n</p>\r\n</div>','2018-05-04 05:44:33','2018-05-18 07:49:39',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (16,'Zahlung','1column',NULL,NULL,'zahlung','Zahlung','<h1>DISCLAIMER</h1>\n\n<p>Die hier bereitgestellten Mustertexte sind ausdrücklich als\n<strong>MUSTER</strong> zu verstehen und müssen in jedem Fall durch\neigene rechtssichere Texte unter CMS -> Statische Blöcke ersetzt\nwerden. Weder der FireGento e.V. noch Trusted Shops tragen für die\nRichtigkeit und Vollständigkeit dieser Texte eine Verantwortung.</p>\n\n<h2>Zahlungsarten</h2>\n\n<p>Wir bieten Ihnen folgende Zahlungsarten an. Suchen Sie sich einfach die für Sie optimale Zahlart aus. Die Versandkosten sind teilweise abhängig von der gewählten Zahlungsart.</p>\n\n<h3>Vorkasse</h3>\n\n<p>Bitte überweisen Sie den Gesamtbetrag Ihrer Bestellung auf unser Konto.</p>\n\n<h3>Rechnung</h3>\n\n<p>Nur für Schulen, Behörden und im Handelsregister eingetragene Unternehmen nach Prüfung.</p>\n\n<h3>Nachnahme</h3>\n\n<p>Bitte halten Sie den Rechnungsbetrag bereit; der Zusteller kassiert bei Lieferung in bar (keine Schecks). Bei Nachnahme fallen zusätzlich 2,-- EUR Nachnahmegebühren an, die direkt an den Paketzusteller zu entrichten sind.</p>\n\n<h3>Lastschrift</h3>\n\n<p>Wir ziehen den Rechnungsbetrag Ihrer Bestellung von Ihrem hinterlegten Bankkonto nach der getätigten Bestellung ein.</p>','2018-05-04 05:44:33','2018-05-04 05:44:33',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
REPLACE INTO `cms_page` VALUES (17,'Datenschutz','1column',NULL,NULL,'datenschutz','Datenschutz','<h2><i>Fügen Sie hier Ihre Datenschutzerklärung ein.</i></h2>','2018-05-04 05:44:33','2018-05-04 05:44:33',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
REPLACE INTO `cms_page` VALUES (18,'Lieferung','1column','','','lieferung','Lieferung','<div class=\"gmt-cms-page\">\r\n<p>Sofort verf&uuml;gbare Artikel liefern wir innerhalb von nur 3-5 Werktagen (Montag-Samstag) mit dem UPS Paketversand.</p>\r\n<p>Die f&uuml;r Ihren Wunschartikel geltende Lieferzeit zeigen wir Ihnen immer direkt am jeweiligen Artikel an. So sehen Sie auf einen Blick, wann Sie die Lieferung erwarten k&ouml;nnen.</p>\r\n<h2>Bitte beachten Sie:</h2>\r\n<p>Die Lieferung kann sich um einen Werktag verz&ouml;gern, wenn zwischen Bestellung und Lieferung ein Sonn- oder Feiertag liegt.</p>\r\n<p>Wenn Sie bereits Kunde sind, k&ouml;nnen Sie stattdessen als feste Lieferanschrift auch z. B. Ihre Firma oder Verwandte angeben. Alternativ k&ouml;nnen Sie - ganz flexibel - jede Bestellung an eine beliebige Adresse innerhalb Deutschlands liefern lassen.</p>\r\n<p>Sie zahlen pro Bestellung und Lieferanschrift nur eine geringe Versandkostenpauschale.</p>\r\n<h2>Unser Tipp: Einfach an ein UPS Access Point in Ihrer N&auml;he liefern lassen.</h2>\r\n<p>Einer UPS Access Point ist auch bei Ihnen vor Ort - ob in der Nachbarschaft, in der N&auml;he Ihres Arbeitsplatzes oder auf dem Nachhauseweg. <a target=\"_blank\">https://www.ups.com/dropoff</a></p>\r\n<p>Geben Sie einfach im Bestellvorgang unter \"Anschrift &auml;ndern\" die Adresse von gew&uuml;nschtem UPS Access Point.</p>\r\n<h2>Ihre Vorteile:</h2>\r\n<ul class=\"gmt-list-1\">\r\n<li>Pers&ouml;nliche Abholung unter Vorlage Ihres Personalausweises.</li>\r\n<li>Kostenlose Benachrichtigung per E-Mail und/oder SMS, sobald Ihre Bestellung angekommen ist.</li>\r\n<li>Auch eine R&uuml;cksendung k&ouml;nnen Sie einfach abgeben.</li>\r\n</ul>\r\n<p>Den UPS Access Point in Ihrer N&auml;he finden Sie &uuml;ber <a href=\"https://www.ups.com/dropoff\" target=\"_blank\">https://www.ups.com/dropoff</a></p>\r\n<table class=\"gmt-table-1\">\r\n<tbody>\r\n<tr><th>Standard-Lieferung</th><th>Versandkosten</th></tr>\r\n<tr>\r\n<td>Paket</td>\r\n<td>5,99 &euro;</td>\r\n</tr>\r\n<tr>\r\n<td>Paketlieferung an UPS Access Point</td>\r\n<td>5,99 &euro;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Sie wohnen auf einer deutschen Ostsee- oder Nordsee-Insel?</h2>\r\n<p>Selbstverst&auml;ndlich liefern wir Ihre Bestellungen auch auf deutsche Inseln!</p>\r\n</div>','2018-05-04 05:44:33','2018-05-28 15:50:16',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (19,'Bestellvorgang','1column',NULL,NULL,'bestellung','Bestellvorgang','<h1>DISCLAIMER</h1>\n\n<p>Die hier bereitgestellten Mustertexte sind ausdrücklich als\n<strong>MUSTER</strong> zu verstehen und müssen in jedem Fall durch\neigene rechtssichere Texte unter CMS -> Statische Blöcke ersetzt\nwerden. Weder FireGento e.V. noch Trusted Shops tragen für die\nRichtigkeit und Vollständigkeit dieser Texte eine Verantwortung.</p>\n\n<h2>Bestellvorgang, einfach und bequem bestellen</h2>\n\n<h3>Wie kann ich bei {{block class=\"FireGento\\MageSetup\\Block\\Imprint\\Field\" field=\"shop_name\"}} bestellen?</h3>\n\n<h4>1. Warenkorb</h4>\n\n<p>Wählen Sie die Produkte aus, die Sie bestellen möchten, indem Sie den \"In den Warenkorb\" Button anklicken. Dadurch wird Ihre Auswahl in den Warenkorb gelegt. Sie können diese Auswahl bis zum Absenden Ihrer Bestellung jederzeit ändern, in dem Sie die Anzahl der Produkte ändern, durch Anklicken des Kästchens \"Entfernen\" die Auswahl löschen oder den Bestellvorgang abbrechen. Durch Anklicken des Buttons \"Kasse\" gelangen Sie zum nächsten Bestellschritt.</p>\n\n<h4>2. Kasse</h4>\n\n<p>Melden Sie sich bitte mit Ihrer eMail Adresse und Ihrem Passwort an falls Sie bereits ein Kundenkonto besitzen, ansonsten registrieren Sie sich bitte als neuer Kunde. Ihre Daten werden unter Beachtung der datenschutzrechtlichen Bestimmungen erhoben, verarbeitet und genutzt (<a href=\"{{store url=\"datenschutz\"}}\">Datenschutzhinweis</a>). Eine anderweitige Verwendung oder Weitergabe an Dritte erfolgt nicht. Sind Sie bereits angemeldet, können Sie nun die Versandart auswählen. Durch klicken des Buttons \"Weiter\" gelangen Sie zum nächsten Bestellschritt.</p>\n\n<h4>3. Rechnungsadresse prüfen / Zahlungsweise auswählen</h4>\n\n<p>Überprüfen Sie nun Ihre Rechnungsadresse und geben Sie Ihre gewünschte <a href=\"{{store url=\"zahlung\"}}\">Zahlungsweise</a> an. Durch Klicken des Buttons \"Weiter\" gelangen Sie zum nächsten Bestellschritt. </p>\n\n<h4>4. Versandadresse prüfen / Versandart auswählen</h4>\n\n<p>Überprüfen Sie nun Ihre Versandadresse und geben Sie Ihre gewünschte <a href=\"{{store url=\"lieferung\"}}\">Versandart</a> an. Durch Klicken des Buttons \"Weiter\" gelangen Sie zum nächsten Bestellschritt.</p>\n\n<h4>5. Bestellvorgang abschließen / AGB und Widerrufsbelehrung</h4>\n\n<p>Sie erhalten eine Übersicht Ihrer Bestellung: die ausgewählten Produkte, die Versand- und Rechnungsadresse und Ihre Kontaktdaten. Überprüfen Sie, ob alle Angaben stimmen und lesen sich bitte die <a href=\"{{store url=\"agb\"}}\">Allgemeinen Geschäftsbedingungen</a> und die <a href=\"{{store url=\"widerruf\"}}\">Widerrufsbelehrung</a> aufmerksam durch. Sie können mit der Bestellung nur fortfahren, wenn Sie den AGB und der Widerrufsbelehrung zustimmen (Häkchen setzen). Mit dem Anklicken des Buttons \"Jetzt kaufen\" übersenden Sie Ihre Bestellung an uns. Hiermit geben Sie ein rechtsverbindliches Angebot ab.</p>\n\n<h4>Widerrufsrecht für Verbraucher</h4>\n\n<p>Alle Informationen zum <a href=\"{{store url=\"widerruf\"}}\">Widerrufsrecht</a></p>','2018-05-04 05:44:33','2018-05-04 05:44:33',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
