REPLACE INTO `cms_page` VALUES (22,'Formular zur Widerrufsbelehrung','1column',NULL,NULL,'widerrufsformular','Formular zur Widerrufsbelehrung','{{block class=\"Magento\\Cms\\Block\\Block\" block_id=\"revocation_form\"}}','2018-05-04 05:44:33','2018-05-04 05:44:33',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
REPLACE INTO `cms_page` VALUES (23,'Brands','1column','','','brands','Brands','<div class=\"row row-flex row-flex-wrap\">\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/shorokhoff-logo.jpg\"}}\" alt=\"\" />\r\n<h2>&Uuml;ber 25 JAHRE ALEXANDER SHOROKHOFF UHRENMANUFAKTUR</h2>\r\n<p>Die Alexander Shorokhoff Uhrenmanufaktur feierte am 10. September 2017 25-j&auml;hriges Bestehen. Unternehmensgr&uuml;nder, Gesch&auml;ftsf&uuml;hrer und Designer Alexander Shorokhov hat vom malerischen Alzenau in Bayern ausgehend seine Luxusuhrenmarke weltweit erfolgreich etabliert. Aus kleinen Anf&auml;ngen ist heute eine begehrenswerte und au&szlig;ergew&ouml;hnliche Marke f&uuml;r Uhrenliebhaber auf der ganzen Welt geworden. Mechanische Uhrwerke mit eigenen Anspr&uuml;chen an Verarbeitung, Qualit&auml;t und ungew&ouml;hnlichem Design. Spezielle Polituren, Vergoldungen von Br&uuml;cken und der Einsatz von polierten und gebl&auml;uten Schrauben entwickeln sich zu einem Markenzeichen der Uhren Shorokhovs. Jedes Detail des Designs ist akribisch durchdacht und ausgef&uuml;hrt. Das Geh&auml;use, das Zifferblatt, die Zeiger, das Werk und das Band harmonieren auf h&ouml;chstem Niveau miteinander. Alexander Shorokhov etabliert sich als aufgeschlossener Uhrendesigner. Mit seinen faszinierenden Kunstwerken f&uuml;r das Handgelenk gelingt es Alexander Shorokhov, die Uhrenwelt zu revolutionieren und seine Werke unvergessen zu machen.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/avrillo-logo.jpg\"}}\" alt=\"\" />\r\n<h2>Avrillo &ndash; das Besondere erschaffen</h2>\r\n<p>Seit 2011 werden im niedersächsischen Syke unter dem Namen AVRILLO, abgeleitet aus dem französischen Wort für April (Avril), dem Geburtsmonat der Inhaberin Sandra Leibner, exklusive Taschen, Gürtel, Etuis und Armbänder designt. Avrillo steht f&uuml;r exklusive Taschen und Accessoires, die Ihren Bed&uuml;rfnissen nach Individualit&auml;t und Originalit&auml;t gerecht werden. Avrillo Taschen sind eine perfekte Creation aus edlem Material und zeitlosem Design f&uuml;r gr&ouml;&szlig;te Anspr&uuml;che an Exklusivit&auml;t und Qualit&auml;t. Sie werden nur in kleinen Serien in limitierter Auflage hergestellt. Die Liebe zum Detail spiegelt sich auch in der Auswahl des Materials wider. Feinste Lachsleder verleihen Ihrem wertvollen Begleiter, ob im Alltag oder auf Festen, einen luxuri&ouml;sen Charakter. Lassen Sie sich von der funktionalen Vielseitigkeit der Avrillo Taschen begeistern, sie bringen Abwechslung ins Leben. Wo die wichtigsten Besprechungen stattfinden, wo gelacht und gefeiert wird - da begleitet Sie Avrillo. Und noch etwas ist dabei ganz besonders wichtig: AVRILLO steht f&uuml;r \"made in germany\". AVRILLO Taschen und Accessoires werden mit viel Liebe zum Detail gestaltet, ohne dabei verspielt zu wirken, in einer kleinen Manufaktur in Norddeutschland gefertigt.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row row-flex row-flex-wrap\">\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/coco-bont-logo.jpg\"}}\" alt=\"\" />\r\n<h2>Coco Bont &ndash; exklusiver Modeschmuck, der Farbe ins Leben bringt</h2>\r\n<p>Sie suchen nach einem kreativen und erstklassigen Schmuckst&uuml;ck? Ein Accessoire wertet das Outfit auf, bereitet Freude beim Tragen und darf nicht unbemerkt bleiben. Coco Bont zieht die Blicke auf ich, sodass Sie f&uuml;r Ihre Accessoires bunte Komplimente bekommen. Coco Bont sucht f&uuml;r Sie nach dem Besonderen, Geschmackvollen und Aparten. Die Accessoires faszinieren, sind ausgefallen, elegant und zugleich schlicht. Dabei legt Coco Bont sehr gro&szlig;en Wert auf Qualit&auml;t &ndash; im Besonderen im Hinblick auf die Materialien, als auch um die Verarbeitung und nicht zuletzt auch um den Tragekomfort. Alle Schmuckst&uuml;cke sind keine Massenware, sondern liebevoll ausgesuchte Schmuckst&uuml;cke in handgearbeitet kleinen Auflagen. Von dezent bis glamour&ouml;se, bietet Coco Bont eine gro&szlig;e Auswahl an qualitativ hochwertigen und im Design einzigartige Schmuckst&uuml;cke an. Die Kollektion besteht aus Halbedelsteinen, gefasst in vergoldetes Sterlingsilber.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/coscoon-logo.jpg\"}}\" alt=\"\" />\r\n<h2>Coscoon &ndash; Do it yourself Naturkosmetik</h2>\r\n<p>Das junge Berliner Naturkosmetik-Label Coscoon geht neue Wege in der Kosmetikbranche und bietet den Kunden die M&ouml;glichkeit nat&uuml;rliche Kosmetika individuell selbst herzustellen &ndash; pure &amp; simple. Die DYI-Kits sind einfach aber f&uuml;r alle Bed&uuml;rfnisse abgestimmt und durchdacht. Mit Coscoon wird der Einstieg in die Naturkosmetik leicht erkl&auml;rt und unique auf jeden einzelnen Kunden produziert. F&uuml;r die Produkte werden exklusiv nat&uuml;rliche Zutaten und Bio-Rohstoffe von h&ouml;chster Qualit&auml;t verwendet. Ebenfalls bei der Auswahl der Rezepte und Zulieferer wurde explizit darauf geachtet, dass die Produkte frei von Silikonen, Parabenen, synthetischen Duftstoffen, Parafinnen und anderen Erd&ouml;lprodukten sind. Die verwendeten &Ouml;le stammen aus zertifiziert kontrolliert biologischem Anbau. In der Manufaktur in Berlin-Sch&ouml;neberg werden die Rohstoffe sorgf&auml;ltig angef&uuml;llt und liebevoll f&uuml;r die Kunden zusammengestellt und verpackt. Die Gr&uuml;nderinnen stehen mit Herzblut und Leidenschaft hinter ihrem innovativen Label und wollen zu bewusstem Konsum und selbstbestimmter K&ouml;rperpflege inspirieren.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row row-flex row-flex-wrap\">\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/laimer-logo.jpg\"}}\" alt=\"\" />\r\n<h2>Hingucker der besonderen Art</h2>\r\n<p>Im Herzen S&uuml;dtirols verbindet das junge Label LAiMER Umweltschutz und Trends. Unternehmer Patrick Laimer war als Tischler t&auml;tig, arbeitet seit jeher im holzverarbeitenden Sektor und hat nach und nach seine Liebe zu Uhren und Accessoires aus nat&uuml;rlichen Materialien entdeckt. Das LAiMER Team hat erkannt was in Holz steckt. Sie designen einzigartige It-Pieces f&uuml;r den modebewussten Kunden von heute. Das Holz, das LAiMER verwendet, kommt aus FSC zertifiziertem Anbau und kein Baum wird wegen LAiMER gef&auml;llt. LAiMER verwendet ausschlie&szlig;lich Resth&ouml;lzer aus der M&ouml;belindustrie. Stil und Lifestyle in Kombination mit Umweltschutz und Nachhaltigkeit. Ungew&ouml;hnlich, auffallend, echt Holz. LAiMER hei&szlig;t: Neueste Entwicklung, Qualit&auml;t und Service! LAiMER verbindet: Natur, Eleganz und Lifestyle! LAiMER ist einzigartiges italienisches Design!</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/mantwill-logo.jpg\"}}\" alt=\"\" />\r\n<h2>Mantwill Porzellan &ndash; Made in Germany</h2>\r\n<p>Weil wir es lieben &ndash; ein Porzellan mit besonderer Transluzenz und ganz eigener Strahlkraft, handgefertigt vom Entwurf bis zum fertigen St&uuml;ck. Die Porzellanmanufaktur Mantwill fertigt in Bruchsal (Baden-W&uuml;rttemberg) in Kleinserie au&szlig;ergew&ouml;hnliche St&uuml;cke aus Porzellan. Jedes davon wird mit viel Liebe und hohem Qualit&auml;tsbewusstsein in verschiedenen Arbeitsschritten hergestellt. Dabei wird das Porzellan eines deutschen Herstellers verwendet. Auch sonst ist man bestrebt, alle Rohstoffe und Materialien aus Deutschland zu beziehen. Ebenso ist die Nachhaltigkeit ein wichtiger Punkt. So erfolgt die Stromversorgung unserer Manufaktur mit &Ouml;kostrom (EWS Sch&ouml;nau), der zu 100 Prozent aus erneuerbaren Energien stammt &ndash; ohne Verflechtungen mit der Kohle- und Atomindustrie. Mit Liebe zum Material und zum Handwerk geht die noch recht junge Manufaktur ungew&ouml;hnliche Wege zu einem individuellen und erlebbaren Porzellan, das seinen Besitzern viel Freude und Genuss bereiten soll.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row row-flex row-flex-wrap\">\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/staudt-logo.jpg\"}}\" alt=\"\" />\r\n<h2>Die Geschichte der Staudt Uhren</h2>\r\n<p>Hinter dem Namen Staudt Watches steht ein junger Mann mit holl&auml;ndischen Wurzeln, der eigentlich Musiker werden wollte &ndash; doch dann kam alles anders. Yvo Staudt spielt seit seinem f&uuml;nften Lebensjahr Akkordeon &ndash; klassische Musik, Tango und Jazz. Mit achtzehn Jahren packte Yvo seine Koffer und zog nach Italien, wo Yvo auf dem besten Weg war ein erstklassiger Akkordeonspieler zu werden. Zum Ausgleich fing er an sich in eine seiner fr&uuml;heren Leidenschaften zu vertiefen: Mechanische Uhren. Soviel wie m&ouml;glich &uuml;ber diese magische Welt zu lernen, wurde zur Obsession. Trotz umfangreicher Suche konnte er seine perfekte Uhr anderswo nicht finden, also gab es nichts anderes, als es selbst zu machen. Drei Kriterien musste &bdquo;seine&ldquo; Uhr erf&uuml;llen: Ein blaues Zifferblatt, Understatement im Design und Spitzenqualit&auml;t. Im Oktober 2014 pr&auml;sentierte Yvo seine erste Uhr und fertigte weitere 44 Exemplare dieses Modells selbst. Heute umfasst seine Kollektion vier Modelle, die in drei Farbvarianten erh&auml;ltlich sind. Was als Abenteuer begann, hat sich mit Staudt Watches zu einer Lebensaufgabe entwickelt.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"gmt-brandpage-block\"><img src=\"{{media url=\"wysiwyg/brandpages/wildwuchs-brand.jpg\"}}\" alt=\"\" />\r\n<h2>Wildwuchs Bartpflege &ndash; der Mann steht auf Wildheit, die Frau auf Pflege</h2>\r\n<p>Die kleine feine Firma hat ihren Sitz im hessischen Hanau. Eine one woman, one man Firma. Die Gr&uuml;nder von Wildwuchs, Valentin und Sarah Manthei, kreieren zusammen in liebevoller Handarbeit ausgew&auml;hlte Produkte f&uuml;r M&auml;nnerb&auml;rte, die bei aller Pflege auch durchaus wild aussehen d&uuml;rfen. Wer will, kann den Wildwuchs dennoch damit striegeln. Die Entscheidung wird dem Kunden &uuml;berlassen. WILDWUCHS Bartpflege ist keine Massenware. Jedes Produkt wird mit Leidenschaft formuliert, hergestellt, einzeln verpackt und etikettiert. In jedem Produkt stecken Inhaltsstoffe aus biologischem Anbau ohne k&uuml;nstliche Farb-, Duft- oder Konservierungsstoffe. Nat&uuml;rliche Produkte schaffen es viel besser, der Wildheit einen Touch Pflege zu verleihen. Sie erwarten, dass die Haut nicht juckt, der Bart richtig gut duftet, weich statt spr&ouml;de ist oder gar splisst und auch ein klein wenig gl&auml;nzt? Daf&uuml;r hat WILDWUCHS extra individuelle Bart&ouml;le gemixt, die auf nat&uuml;rliche Weise Feuchtigkeit und N&auml;hrstoffe in die Haut und Barthaare transportieren. Eines mit sehr frischem, holzigem Duft, der die Maskulinit&auml;t unterstreicht, eines mit s&uuml;&szlig;lichem Duft, der Sie von der Karibik tr&auml;umen l&auml;sst.</p>\r\n</div>\r\n</div>\r\n</div>','2018-05-04 12:05:01','2018-05-22 08:40:16',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
REPLACE INTO `cms_page` VALUES (24,'Rückgaberecht','1column','','','return','Rückgaberecht','<div class=\"gmt-cms-page\">\r\n<p>Uns ist bewusst, dass hin und wieder nicht alles Ihre Zustimmung findet. Selbstverst&auml;ndlich k&ouml;nnen Sie uns die bestellten Artikel zur&uuml;cksenden.</p>\r\n<p>Ware an uns zur&uuml;ck zu senden ist ganz einfach:</p>\r\n<p>Schreiben Sie uns eine E-Mail mit Angabe Ihrer Bestellnummer und Ihren dazugehörigen Daten sowie einen Grund der Rücksendung an <a href=\"support@germantom.com\">support@germantom.com</a>, um eine Retoure eines Artikels zu beauftragen. Wir erledigen f&uuml;r Sie alle Formalit&auml;ten und erstellen den Retouren-Aufkleber. Die Unterlagen bekommen Sie per E-Mail. Die R&uuml;cksendung ist f&uuml;r Sie nat&uuml;rlich kostenlos. Eine Einschr&auml;nkung Ihres Widerrufsrechts gem. &sect; 6 unserer AGB ist mit vorstehenden Regelungen nicht verbunden.</p>\r\n<h2>Bitte beachten Sie:</h2>\r\n<p>Um eine schnelle Bearbeitung Ihrer Retoure zu gew&auml;hrleisten, bitten wir Sie, R&uuml;cksendungen immer <strong>getrennt nach Sendungen mit dem zugeh&ouml;rigen R&uuml;cksendeetikett</strong> zur&uuml;ck zu schicken. Bitte legen Sie auch das zugeh&ouml;rige Widerrufsformular bei.</p>\r\n<h2>Einfach selbst abgeben</h2>\r\n<p>Geben Sie Ihre R&uuml;cksendung bei einem UPS Access Point in ganz Deutschland ab. Den UPS Access Point in Ihrer N&auml;he finden Sie &uuml;ber <a href=\"https://www.ups.com/dropoff\" target=\"_blank\">https://www.ups.com/dropoff.</a></p>\r\n<p>Der Wert der zur&uuml;ckgeschickten Ware wird Ihrem Zahlungsmittel wieder gutgeschrieben. Der Zeitraum der Gutschrift ist abh&auml;ngig vom Bankinstitut. Die Bearbeitungszeit kann allerdings bis zu 2 Wochen in Anspruch nehmen. Sie erhalten eine E-Mail nach Bearbeitung Ihrer Sendung. Der Betrag der R&uuml;ckbuchung f&auml;llt automatisch in den n&auml;chsten Zahlungslauf.</p>\r\n</div>','2018-05-16 13:25:50','2018-05-18 08:02:19',1,0,'',NULL,NULL,NULL,NULL,NULL,'');
