REPLACE INTO `email_template` VALUES (1,'order confirmation version1','{{template config_path=\"design/email/header_template\"}}\r\n\r\n<table>\r\n    <tr class=\"email-intro\">\r\n        <td style=\"padding-bottom: 1em;\">\r\n            <h1 style=\"padding-top:1em;\">BESTELLBESTÄTIGUNG</h1>\r\n            <p class=\"greeting\">Sehr geehrte (r) Frau/Herr {{trans \"%customer_name,\" customer_name=$order.getCustomerName()}}</p>\r\n            <p>\r\n                Vielen Dank für Ihren Einkauf bei GERMANTOM.com. Wir freuen uns, dass Sie etwas Schönes gefunden haben. Sobald Ihr Paket auf dem Weg zu Ihnen ist, erhalten Sie von uns eine Versandbestätigung per E- Mail.\r\n            </p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-summary\">\r\n        <td>\r\n            <h1 style=\"padding-top:1em; border-top: 1px solid black;\">{{trans \'Your Order <span class=\"no-link\">#%increment_id</span>\' increment_id=$order.increment_id |raw}}</h1>\r\n            <p>{{trans \'Placed on <span class=\"no-link\">%created_at</span>\' created_at=$order.getCreatedAtFormatted(2) |raw}}</p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-information\">\r\n        <td>\r\n            {{depend order.getEmailCustomerNote()}}\r\n            <table class=\"message-info\">\r\n                <tr>\r\n                    <td>\r\n                        {{var order.getEmailCustomerNote()|escape|nl2br}}\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n            {{/depend}}\r\n            <table class=\"order-details\">\r\n                <tr>\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Billing Info\"}}</h3>\r\n                        <p>{{var formattedBillingAddress|raw}}</p>\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Shipping Info\"}}</h3>\r\n                        <p>{{var formattedShippingAddress|raw}}</p>\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n                <tr>\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Payment Method\"}}</h3>\r\n                        {{var payment_html|raw}}\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Shipping Method\"}}</h3>\r\n                        <p>{{var order.getShippingDescription()}}</p>\r\n                        {{if shipping_msg}}\r\n                        <p>{{var shipping_msg}}</p>\r\n                        {{/if}}\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n                \r\n            </table>\r\n            {{layout handle=\"sales_email_order_items\" order=$order area=\"frontend\"}}\r\n        </td>\r\n    </tr>\r\n    <tr>\r\n            <td style=\"border-top: 1px solid black; padding:1em 0; margin-top:1em;\">\r\n                <p>Für eventuelle Fragen wenden Sie sich bitte an unser Kundenservice:<br>\r\n                    Tel.: <a href=\"tel:{{config path=\'general/store_information/phone\'}}\">{{config path=\"general/store_information/phone\"}}</a> oder verwalten Sie Ihre Bestellung in Ihrem Account unter <a href=\"{{config path=\"web/secure/base_url\"}}\">{{config path=\"web/secure/base_url\"}}</a> <br>\r\n                    <br>Die Widerrufsbelehrung sowie die Bestellbestätigung finden Sie im Anhang dieser E-Mail.\r\n                </p>\r\n            </td>\r\n\r\n\r\n        </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer_template\"}}',NULL,2,'{{trans \"Your %store_name order confirmation\" store_name=$store.getFrontendName()}}',NULL,NULL,'2018-05-17 09:29:58','2018-05-18 12:51:06','sales_email_order_template','{\"var formattedBillingAddress|raw\":\"Billing Address\",\"var order.getEmailCustomerNote()\":\"Email Order Note\",\"var order.increment_id\":\"Order Id\",\"layout handle=\\\"sales_email_order_items\\\" order=$order area=\\\"frontend\\\"\":\"Order Items Grid\",\"var payment_html|raw\":\"Payment Details\",\"var formattedShippingAddress|raw\":\"Shipping Address\",\"var order.getShippingDescription()\":\"Shipping Description\",\"var shipping_msg\":\"Shipping message\"}');
REPLACE INTO `email_template` VALUES (2,'header version1','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n    <meta name=\"viewport\" content=\"initial-scale=1.0, width=device-width\" />\r\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\" />\r\n    <style type=\"text/css\">\r\n        {{var template_styles|raw}}\r\n\r\n        {{css file=\"css/email.css\"}}\r\n    </style>\r\n</head>\r\n<body>\r\n{{inlinecss file=\"css/email-inline.css\"}}\r\n\r\n<!-- Begin wrapper table -->\r\n<table class=\"wrapper\" width=\"100%\">\r\n    <tr>\r\n        <td class=\"wrapper-inner\" align=\"center\">\r\n            <table class=\"main\" align=\"center\" style=\"width:100%\">\r\n                <tr style=\"width:100%\">\r\n                    <td class=\"header\" style=\"width:100%\">\r\n                        \r\n                        <a class=\"logo\" href=\"{{store url=\"\"}}\" style=\"display:bock; float:right\">\r\n                            <img \r\n                            width=\"256\"\r\n                            height=\"66\"\r\n                            src=\"{{var logo_url}}\"\r\n                            alt=\"{{var logo_alt}}\"\r\n                            border=\"0\"\r\n                            />\r\n                        </a>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td class=\"main-content\">\r\n                    <!-- Begin Content -->',NULL,2,'{{trans \"Header\"}}',NULL,NULL,'2018-05-18 09:22:23','2018-05-18 12:47:50','design_email_header_template','{\"var logo_height\":\"Email Logo Image Height\",\"var logo_width\":\"Email Logo Image Width\",\"var template_styles|raw\":\"Template CSS\"}');
REPLACE INTO `email_template` VALUES (3,'footer version1','<!-- End Content -->\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td class=\"footer\" style=\"margin-top:1em; padding-top:1em; border-top:1px solid black\">\r\n                        <p class=\"closing\" style=\"font-weight: bold;\">\r\n                            Liebe Grüße aus Baden-Baden und bis bald <br>\r\n                            Das GERMANTOM-TEAM<br><br>\r\n                            Anlage: Widerrufsbelehrung AGB\r\n                        </p>\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n<!-- End wrapper table -->\r\n</body>',NULL,2,'{{trans \"Footer\"}}',NULL,NULL,'2018-05-18 09:59:06','2018-05-18 12:33:40','design_email_footer_template','{\"var store.getFrontendName()\":\"Store Name\"}');
