REPLACE INTO `tm_blog_post` VALUES (7,0,'push-your-limits-with-us','Push your limits with us! ',NULL,'Grey',NULL,'You can’t buy happiness, but you can buy a bike and that’s pretty close. Riding a bike, feeling the wind blow in your face, having your favorite music in your headphones and letting ground beneath you fly - what can be better? We can’t think of anything. ',NULL,NULL,'2016-09-11 22:00:00','2018-04-27 10:22:00',NULL,1);
REPLACE INTO `tm_blog_post` VALUES (8,0,'women-will-enjoy-a-selection-of-special-bikes','Women will enjoy a selection of special bikes',NULL,'Ged','There is a huge team working with customers helping you choose your perfect bike. Give it a test, make sure you gear up, get must-haves and preferably nice-to-haves. Helmet, hydration, bell, spare tube and floor pump are necessary. Among nice-to-haves there are bike shorts, cycling shoes, clip-in pedals, cycling socks, bike gloves, sunglasses, lock, cycling computer and some more (the full list is at the bottom of the website). \r\n\r\nDon’t forget to adjust the bike to your body before you start riding. Everyone is unique and the way your bike is adjusted is responsible for your safety and comfort. When testing the bike, test several of them and remember that everyone has a different experience, so listen to your body and how it feels your new vehicle. \r\n\r\nWhat is so great about riding a bike is that you can do you it regardless of your age and professional skills. You may enjoy your ride in the park or conquer the most dangerous spots of the world with a bike, and in both cases it is your devoted friend, which lets you into the world of rapid eco-friendly freedom. \r\n\r\nDepending on the type of a bike that you need, there are dozens of them available to you. Use a bike finder to find your perfect bicycle. Filter down the bikes by type, size, sex of the future owner.\r\n\r\nPush your limits with us! ','There is a huge team working with customers helping you choose your perfect bike. ',NULL,NULL,'2016-09-15 22:00:00','2018-04-27 10:22:05',NULL,1);
REPLACE INTO `tm_blog_post` VALUES (9,0,'don-t-forget-to-adjust-the-bike-to-your-body-before-you-start-riding','Don’t forget to adjust the bike to your body before you start riding.',NULL,'Joy','What is so great about riding a bike is that you can do you it regardless of your age and professional skills. You may enjoy your ride in the park or conquer the most dangerous spots of the world with a bike, and in both cases it is your devoted friend, which lets you into the world of rapid eco-friendly freedom. \r\n\r\nWomen will enjoy a selection of special bikes. There are numerous reasons why special bikes are better for women and the whole list of them you may find in our blog. Don’t forget that you also can pick an e-bike for yourself or your closed ones. \r\nDon’t forget to adjust the bike to your body before you start riding. Everyone is unique and the way your bike is adjusted is responsible for your safety and comfort. When testing the bike, test several of them and remember that everyone has a different experience, so listen to your body and how it feels your new vehicle. \r\n\r\nWe are happy to say that since last September you have a possibility to attend indoor riding classes. Train together and get ready for a new biking season. \r\n\r\nYou can’t buy happiness, but you can buy a bike and that’s pretty close. Riding a bike, feeling the wind blow in your face, having your favorite music in your headphones and letting ground beneath you fly - what can be better? We can’t think of anything.  ','You may enjoy your ride in the park or conquer the most dangerous spots of the world with a bike, and in both cases it is your devoted friend, which lets you into the world of rapid eco-friendly freedom. ',NULL,NULL,'2016-09-11 22:00:00','2018-04-27 10:22:08',NULL,1);
